var book = {
	"name": "ချဲၩ့ဒီၩ့လၩ့",
	"numChapters": 31,
	"chapters": {
		"1": {
			"1": "<sup>1</sup> အံၫစရ့လၭအစဎွၩ စဒၫဝံၭအဖိၪခွၫ စစီလမၧၫ့အ",
			"2": "<sup>2</sup> ဆၧချဲၩ့ဒီၩ့လၩ့ၥံၪး- ဘဲၫၥိၭၦမိၥ့ၪယၫ ဆၧကိၪ့ဘၪ ကိၪ့ၥ့ၪ, ဒဲဆၧၥီၪ့လိၪအဂဲးအကၠီၪ့, ဘဲၫၥိၭအနၪမိၥ့ၪ",
			"3": "<sup>3</sup> ၦၥုၪ့ဆၭၥၭဆၭ အဆၧချဲၩ့လဖၪး- ဘဲၫၥိၭအမိထိး ဆၧၫ့ ဆၧကိၪ့ဘၪကိၪ့ၥ့ၪ ဆၧတီၩဆၧလီၩ့, ဆၧစ့ၩရၫ့ တီၩ ဒဲဆၧလယိဒိၪဆံၭအၪၡၩဘၪ အဆၧၥီၪ့ဆၧၥၫ့",
			"4": "<sup>4</sup> တၭး- ဘဲၫၥိၭအမိဒုၭကိၪ့ ၦလၧအလမၩလိၪဘၪဆၧ, ဒဲဖ့ၪလၫ့ဆၧၥ့ၪယၫ ဒဲဆၧထီးလၩ့အၥၭ လၧၦၥၭဘၪ့",
			"5": "<sup>5</sup> ၥံၪနီၪလီၫ.- ၦကိၪ့ဆၧၥ့ၪလဖၪမိခိၭနၪ, ဒဲအဆၧၥ့ၪ ယၫနီၪမိအၪထၪ့ဝ့ၫတၭ, ၦလၧအၥုၪ့ဆၭအၥၭဆၭမိ",
			"6": "<sup>6</sup> န့ဘၪဆၧၥိၫ့ဝ့ၫနီၪး- ဘဲၫၥိၭအနၪမိၥ့ၪဆၧချဲၩ့ဒီၩ့လၩ့ ဒဲဆၧချဲၩ့အဒိၪအယိၬၥံၪး ၦကိၪ့ၥ့ၪအဆၧချဲၩ့လဖၪဒဲ အဝ့ၫၥံၪအဆၧချဲၩ့ ၡီၩ့ၡါဆၧၥံၪနီၪလီၫ.",
			"7": "<sup>7</sup> ဆၧၥၭမဲၪယဟိဝၩနီၪ, မွဲဆၧၥ့ၪယၫအခၪ့ထံၭတၭ, ဆၧကိၪ့ၥ့ၪဒဲဆၧၥီၪ့လိၪနီၪ ၦအဂီၩ့ၥံၪမၩကြၩ့ထမးဝ့ၫ",
			"8": "<sup>8</sup> လီၫ.- ယဖိၪခွၫဧ့, ခိၭနၪနဖါ အဆၧၥီၪ့ဆၧၥၫ့နီၪဆံၭး",
			"9": "<sup>9</sup> ဒဲနမိအၥနိၫနီၪ ထီးခွံၬၡိၭလဂ့ၩ.- အဂဲးဘဲၫယီၩအဝ့ၫ ၥံၪမိကဲၪဆၧအခိးအတၩ အကယၧၩ့လၧနခိၪဎွံၪအဂး, ဒဲၥွ့ၫဖျံၩၥံၪ လၧနခိၬအဂးနီၪလီၫ.",
			"10": "<sup>10</sup> ယဖိၪခွၫဧ့, ၦဒဲၩဘၭဖိၪၥံၪအ့ၪအၪ့လွ့ၫနၧၩနီၪ, ထီး",
			"11": "<sup>11</sup> အုၩ့လၩ့လဂ့ၩ,ဧီၪ.- အဝ့ၫၥံၪအ့ၪစံၭး လ့ၩဆၧလၧပ ၥိၭဘီၪ, မွဲပမိခိၭၥူၪၡီၩ့ဆၧလၧအၥွံၪအဂးဘီၪး အလး လအီၪဘၪတၭ, မွဲပယိၥူၪဆၧလၧ ၦလၧအဆၧဒဲၩဘၭ",
			"12": "<sup>12</sup> လအီၪဘၪအဂးဘီၪ.- ဘဲၫဖျႃဖၧၩ့အၥိၭနီၪ, မွဲပမိယု လၩ့မၧၫ့အဝ့ၫၥံၪ, ဒဲထၧၫ့ဂၩယၫ ဘဲၫၦလၧအလ့ၩလၩ့",
			"13": "<sup>13</sup> လၧဆၧဖၧၩ့အၥိၭနီၪလီၫ.- ကယဲဆၧလူဒိၪဎွ့ၩဒိၪၥံၪ ပမိဒၪန့ထီးအလူၬတၭး ပမိမၩဎွ့ၩထၪ့ပဂံၪ့ၥံၪလၧဆၧ",
			"14": "<sup>14</sup> အၪ့ဂူၬန့လဖၪနီၪလီၫ.- နဂးနီၪမွဲအလၩ့ဘၪလၧပကျၩ ယီၩဧီၪ. မွဲပမိအီၪလၧထိၪ့လဖျိၪ့ဎး ကိၭဂၩဒ့ၭဆံၭ.",
			"15": "<sup>15</sup> ယဖိၪခွၫဧ့, ထီးလ့ၩဖိၬဖၧၩ့ၥၭ လၧအဝ့ၫၥံၪအၥိၭလ",
			"16": "<sup>16</sup> ဂ့ၩ,ပဒၩ့နခၪ့ လၧအဝ့ၫၥံၪအဖၧၩ့ၥၭနီၪဘီၪ.- အဂဲးဘဲၫ ယီၩအဝ့ၫၥံၪ အခၪ့စဲၪ့တလဲးလၧဆၧအၧၩ့အဂး, ဒဲဖျဲၪ",
			"17": "<sup>17</sup> ဝ့ၫလၧအမိလူၫလၩ့ဆၧၥွံၪလီၫ.- အဂဲးဘဲၫယီၩ မွဲမၬ ၦဒၩလၩ့ၡၬ လၧထိၪလမံၩ့လါလါအမ့ၬယၫ ပျီၩပျီၩ",
			"18": "<sup>18</sup> လီၫ.- တၭအဝ့ၫၥံၪခိၭၥူၪဆၧ လၧအၥွံၪဒၪဝ့ၫအဂး,ဒဲ အယိၥူၪဆၧနီၪ လၧအနၫ့ဆါၥံၪ အၥၭမၧၫ့ဒၪဝ့ၫအဂး",
			"19": "<sup>19</sup> လီၫ.- ၦလၧအၥၭလိဖၭလဂၩလါလါနီၪ အဖၧၩ့ၥၭမွဲ ဘဲၫနီၪၥိၭဆ့, ဆၧနီၪမၩန့ခွံၬအကဆါအၥၭမၧၫ့လီၫ.",
			"20": "<sup>20</sup> ဆၧကိၪ့ဘၪကိၪ့ၥ့ၪနီၪ ကိၭထၪ့ဆၧလၧခီၫ့တၭး ဒုၭ",
			"21": "<sup>21</sup> ၥီၫထၪ့အလူ လၧဖၧၩ့ၥၭၥံၪအဖၧၩ့နီၪလီၫ.- ကိၭထၪ့ ဆၧလၧဆၧအီၪကီၪ့ အလးအခၪ့ထံၭ လၧတရၫ့ၥံၪဝဲ ထၪ့အၥၭအလး, လၧဒိၩ့ဖၧၩ့ဒုၭၥီၫထၪ့ အဆၧချဲၩ့လ",
			"22": "<sup>22</sup> ဖၪနီၪလီၫ.- တၭစံၭဝ့ၫဒၪ, ၦလၧအလမၩလိၪဘၪဆၧ ၥံၪဧ့, နၥံၪမိအဲၪဆၧလမၩလိၪဘၪး ဒဲၦမၩကြၩ့ထမး ဆၧမုၬလၩအၥၭ လၧဆၧမၩကြၩ့ထမးအဖၧၩ့း ဒဲၦအ",
			"23": "<sup>23</sup> ဂီၩ့ၥံၪမိၥၭဂဲၫ့ဆၧၥ့ၪယၫနီၪ, မွဲဆံၭယံၬလဲၪ.- ကၠၪထဲၩ့ နၥံၪအၥၭ လၧယအၪ့ၥီၪ့ဆၧအကၠီၩ့နီၪဆံၭး ယိခွါ,ယ မိလူၫလၩ့ယၥၭ လၧနၥံၪအလီၩ့တၭ, ယမိဒုၭၥ့ၪယၫ နၥံၪလၧယဆၧချဲၩ့လဖၪ နီၪလီၫ.",
			"24": "<sup>24</sup> လၧယကိၭယူၭဆၧနၥံၪလခိၭနၪဘၪး ယယူၬထၪ့",
			"25": "<sup>25</sup> ယူၭယစူၪတၭ, ၦလယူၭယၪ့ဘၪဝ့ၫနးဂၩး- ဒဲယဒုၭ ကိၪ့ဆၧလဖၪ နၥံၪခွံၬၡိၭခွံၬထီးအလူၬ, ယဆၧအၪ့ၥီၪ့",
			"26": "<sup>26</sup> ၥံၪနီၪနၥံၪလထိးဆၧၫ့ဘၪ နးဆံၭအကၠီၩ့နီၪတၭ,-အခိး မွဲထီးနၥံၪအ့ၪဘၪၡၪ့ဘၪနၭနီၪ ယမိနံဆ့း ဒဲနၥံၪအ့ၪ ဘၪဆၧၥၭမဲၪၥၭဖျဲၩ့အဘိၩ့ဘၭနီၪ ယမိချဲၩ့လိနၥံၪး",
			"27": "<sup>27</sup> ထီးနၥံၪအဆၧၥၭမဲၪ အ့ၪဂဲၫဘဲၫလဖုၬအၥိၭး ဒဲနၥံၪအ ဆၧၡၪ့ဆၧနၭဘဲၫလံၩၥဝံၭအၥိၭနီၪး ထီးဆၧခိဆၧဝီၩ ဒဲဆၧဂၪ့အုၩဂၪ့ထိၬ အ့ၪလၩ့ဘၪလၧနၥံၪအလီၩ့နီၪး",
			"28": "<sup>28</sup> ထီးနီၪလဖၧၫ့ အဝ့ၫၥံၪမိကိၭထၪ့လါနၫ့ယၧၩတၭ,ယမိ ချဲၩ့ဆၧၫ့ဝ့ၫအ့ၬး အဝ့ၫၥံၪ မိအၪ့ဎူၫအၪ့ဎၬ ဆိၫယၧၩ",
			"29": "<sup>29</sup> လါနၫ့တၭ, ဒၪဘၪယၧၩအ့ၬ.- အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪ ၥၭဂဲၫ့မ့ၬလဲၩဆၧၥ့ၪယၫတၭ, ရွံန့ဆၧၥၭမဲၪယဟိဝၩ",
			"30": "<sup>30</sup> ဆ့အ့ၬ.- ယဒုၭကိၪ့ဆၧနီၪအဝ့ၫၥံၪဘၪအၥၭအ့ၬးဒဲမၩ",
			"31": "<sup>31</sup> ကြၩ့ထမးယဆၧအၪ့ၥီၪ့လဖၪ ထီးအလူၬဆ့း-အခိးမွဲ ဆၧမၩအၥၭဘဲၫနီၪတၭ, အဝ့ၫၥံၪမိဘၪအၪ့အဖၧၩ့ၥၭ ဒၪဝ့ၫအဆၧၥၪနီၪ, ဒဲဘၪလၧၫ့ထၪ့ဎွ့ၩထၪ့လၧအဆၧ",
			"32": "<sup>32</sup> ကိၪ့ဒၪဝ့ၫဆ့လီၫ.- အဂဲးဘဲၫယီၩ ၦလၧအလမၩလိၪ ဘၪဆၧအဆၧကၠၪခွံၬအၥၭနီၪ မိမၩၥံၫအဝ့ၫၥံၪတၭ, ၦအဂီၩ့အဆၧဒိၭနဲၩ့အၥၭနီၪ မိမၩဂၭဂီၩ့ခွံၬအဝ့ၫၥံၪ",
			"33": "<sup>33</sup> ဆ့လီၫ.- အ့ၪမွဲၦလၧအခိၭနၪယလူလဂၩနီၪမိအီၪဂုး ခၧၫ့လၧဆၧမုၬအဖၧၩ့, ဒဲဖီၩ့ဖျ့ၭလၧအၥၭမဲၪဆၧအၧၩ့ တၭ, အီၪပွံၭဝ့ၫဒၪ ဘဲၫနီၪလီၫ."
		},
		"2": {
			"1": "<sup>1</sup> ယဖိၪခွၫဧ့, နအ့ၪထိးဆၧၫ့ယဆၧချဲၩ့ၥံၪ, ဒဲအီၪ",
			"2": "<sup>2</sup> က့ၪကီၪ့ယဆၧမၪလူၬၥံၪလၧနဖၧၩ့း- ဘဲၫၥိၭနမိဒိၭနနါ လၧဆၧကိၪ့ဘၪကိၪ့ၥ့ၪနီၪ, ဒဲကၠၪထဲၩ့နၥၭလၧဆၧၥုၪ့",
			"3": "<sup>3</sup> ဆၭၥၭဆၭတၭး- မွဲမၬ, နအ့ၪကိၭၡၭထၪ့ လၧဆၧၥ့ၪ ယၫအဂး, ဒဲထုၭထၪ့နလူ လၧဆၧၥုၪ့ဆၭၥၭဆၭအဂး",
			"4": "<sup>4</sup> နီၪ,- အ့ၪအၪ့ဎူၫအၪ့ဎၬဝ့ၫ ဘဲၫကျိၪၥံၪစ့ၩၥံၪအၥိၭနီၪ, ဒဲခုၪ့အၪ့ဎၬဝ့ၫ ဘဲၫလၧဆၧလူဒိၪဎွ့ၩဒိၪ အီၪၥူၪဝ့ၫအ",
			"5": "<sup>5</sup> ဂးအၥိၭနီၪး- ထီးနီၪလဖၧၫ့ နနၪမိၥ့ၪဆၧၥၭမဲၪယဟိ",
			"6": "<sup>6</sup> ဝၩ,ဒဲနမိဒၪန့ ဆၧၥ့ၪယၫယွၩဆ့လီၫ.- အဂဲးဘဲၫယီၩ ယဟိဝၩ ဖ့ၪလၫ့ဆၧကိၪ့ဘၪကိၪ့ၥ့ၪတၭ, ဆၧၥ့ၪယၫ ဒဲၥုၪ့ဆၭၥၭဆၭနီၪ ထၪ့ဖျ့ၭလၧအဝ့ၫဒၪ အနိၭလခီၫး",
			"7": "<sup>7</sup> အဝ့ၫနီၪ အီၪက့ၪကီၪ့ဝဲၩ ဆၧမၩဘိၭမၩဆၧၩ့ လၧၦ အၥၭ ဆုးလီၩ့အဂး ဒဲထၩ့ဖံၭ လၧၦလၧအလ့ၩဆၧ",
			"8": "<sup>8</sup> လၧၫ့လၧၫ့ ဎွ့ၩဎွ့ၩအဂးလီၫ.- အဝ့ၫဒၪခိၭဆၧစ့ၩရၫ့ အဖၧၩ့ၥၭတၭး ယိထဲၩ့ခွါထဲၩ့ အၡၩဆံၫ့ဎံၪၥံၪအဖၧၩ့",
			"9": "<sup>9</sup> ၥၭလီၫ.- ထီးနီၪလဖၧၫ့နနၪမိၥ့ၪဆၧတီၩဆၧလီၩ့ဒဲဆၧ စ့ၩရၫ့ဒဲဆၧမၩတီၩလိၬအၥၭ, ဒဲကယဲဖၧၩ့ၥၭ အဂ့ၩ",
			"10": "<sup>10</sup> ကိၭဘီၩ့ဒ့ၭဆ့လီၫ.- အဂဲးဘဲၫယီၩ ဆၧကိၪ့ဘၪကိၪ့ ၥ့ၪမိနုၬလၧနၥၭခံဖၧၩ့, ဒဲဆၧၥ့ၪယၫနီၪ မိမုၬလၧနၥၭ",
			"11": "<sup>11</sup> အဂးတၭး- ဆၧဒုၭထီးလၩ့နၥၭ မိယိထဲၩ့ခွါထဲၩ့နၧၩ",
			"12": "<sup>12</sup> ဆၧၥုၪ့ဆၭၥၭဆၭမိခိၭထၬနၧၩ,- ဘဲၫၥိၭအမိဒုၭဖီၩ့ ဖျ့ၭနၧၩ လၧဆၧအၧၩ့အဖၧၩ့ၥၭ, ဒဲလၧၦၡၩချဲၩ့ကဒံၩ",
			"13": "<sup>13</sup> ကဒၩဆၧလဂ့ၩး- ၦလၧအစဲၪ့ဒၪခွံၬ ဆၧတီၩဆၧလီၩ့",
			"14": "<sup>14</sup> အဖၧၩ့ၥၭ, ဘဲၫၥိၭအမိဖိၬဆၧခံၭအဖၧၩ့ၥၭး- ၦလၧ အၥုၪ့ဎွံၫၥၭယီၫ လၧအမၩဆၧအၧၩ့လခီၫ ၥုၪ့ထိၬၥၭ",
			"15": "<sup>15</sup> ထိၬလၧၦအအၧၩ့ အဆၧမၩကဲၪ့ကီၪ့အဖၧၩ့,- ၦၡၩ လၧအဖၧၩ့ၥၭၥံၪကဲၪ့ကီၪ့, ဒဲအဝ့ၫၥံၪအဖၧၩ့ၥၭလဖၪ",
			"16": "<sup>16</sup> မွဲဆၧအၧၩ့ဆၧၥၫ့နီၪလီၫ.- မိမၩဖီၩ့မၩဖျ့ၭနၧၩ လၧၦ မုၪလၩ့မဲၩဒၪဆၧၦမွံၩမုၪ လၧအချဲၩ့ဆၧချဲၩ့မုၬနါၥံၪး",
			"17": "<sup>17</sup> လၧအစဲၪ့ဒၪခွံၬ ၦလၧအကဲၪအထံၩအၥိၭ လၧအၥၭ ဘၪ့ဒံၭအခၫနီၪ, ဒဲၥၭနၪ့ခွံၬအယွၩ အဆၧအုၩ့လၩ့နီၪး",
			"18": "<sup>18</sup> အဂဲးဘဲၫယီၩ ၦမုၪနီၪအဂံၪ့ဒၪဝ့ၫ ဒံၩ့ခံၫ့လၩ့ လၧဆၧ",
			"19": "<sup>19</sup> ၥံၫဒဲအဖၧၩ့ၥၭၥံၪ ဖိးလၧဖျႃဖၧၩ့တၭး- ၦလၧအလ့ၩ ဆၧလၧအအီၪနီၪ လဂဲၫထဲၩ့ထဲၩ့ဘၪနးဂၩတၭ, ထီၩ့",
			"20": "<sup>20</sup> လၧဖၧၩ့ၥၭမၧၫ့ လဖၪဆ့အ့ၬ.- မၩအၥၭဘဲၫနီၪတၭ, လ့ၩနဝ့ၫလၧၦအဂ့ၩအဖၧၩ့ၥၭ, ဒဲဖိၬၦအတီၩအလီၩ့",
			"21": "<sup>21</sup> အဖၧၩ့ၥၭနီၪဆံၭ.- အဂဲးဘဲၫယီၩ ၦအတီၩအလီၩ့ၥံၪ မိအီၪလၧထံၫၥံၪခးၥံၪအဖၧၩ့တၭ, ၦအလၧၫ့အဎွ့ၩၥံၪ",
			"22": "<sup>22</sup> မိအီၪဂုးခၧၫ့ လၧအဖၧၩ့လီၫ.- အ့ၪမွဲၦအၧၩ့ဖိၪၥံၪမိဘၪ ဆၧဒၪ့ထ့ၬခွံၬဝ့ၫ လၧထံၫၥံၪခးၥံၪအဖၧၩ့, ဒဲၦမၩမၪ ဆၧလဖၪနီၪ မိဘၪဆၧထ့ၭထၪ့ခွံၬဝ့ၫ လၧအဖၧၩ့လီၫ."
		},
		"3": {
			"1": "<sup>1</sup> ယဖိၪခွၫဧ့, ယဆၧၥီၪ့ဆၧၥၫ့နီၪ ထီးၥၭနၪ့လဂ့ၩ,",
			"2": "<sup>2</sup> မွဲနၥၭထီးန့ဖံၭထၬ ယဆၧမၪလူၬၥံၪဆံၭ.- အဂဲးဘဲၫ ယီၩ အဝ့ၫၥံၪမိအီၪက့ၪကီၪ့မုနံၩအၪနံၩ, ဒဲၥၭမၧၫ့အ",
			"3": "<sup>3</sup> နံၪ့ၥံၪ, ဒဲဆၧမုၬဆၧဎၩ့လၧနဂးဆ့လီၫ.- ဆၧအခိးအ တၩ ဒဲဆၧမွဲဆၧတီၩနီၪ, မွဲအထီးစဲၪ့ဒၪခွံၬနၧၩလဂ့ၩ, ခဲးထၬအဝ့ၫၥံၪ လၧနခိၬလီၩ့, ကွ့ၭလၩ့အဝ့ၫၥံၪ လၧန",
			"4": "<sup>4</sup> ၥၭအပၪလီၩ့နီၪဆံၭ.- နမိဒၪန့ဆၧအခိးအတၩ ဒဲၥုၪ့ ဆၭၥၭဆၭဂ့ၩဘၪစဲၪ, လၧယွၩ ဒဲၦၡၩအမ့ၬၥၪဖၧၩ့ ဘဲၫနီၪလီၫ.",
			"5": "<sup>5</sup> ဒိၭနဲၩ့နၥၭ လၧယဟိဝၩအဖၧၩ့ လၧနၥၭထၧၫ့ဖျိၪ့ ယၫဆံၭ, တၭထီးဒိၭနဲၩ့နၥၭ လၧနဆၧကိၪ့ၥ့ၪကိၪ့ဘၪ",
			"6": "<sup>6</sup> ဒၪနဝ့ၫလဂ့ၩ.- အုၩ့လၩ့အဝ့ၫဒၪလဂၩ လၧနဖၧၩ့ၥၭ ထီးအလူၬအဖၧၩ့တၭ, အဝ့ၫနီၪ မိမၩပျၩ့နဖၧၩ့ၥၭလ",
			"7": "<sup>7</sup> ဖၪလီၫ.- ထီးကဲၪၦကိၪ့ဘၪကိၪ့ၥ့ၪ လၧနမ့ၬၥၪဒၪနဝ့ၫ အဖၧၩ့လဂ့ၩ, ၥၭမဲၪယဟိဝၩတၭ,ကၠၪခွံၬနၥၭလၧဆၧ",
			"8": "<sup>8</sup> အၧၩ့ဆံၭ.- အနီၪမိကဲၪထၪ့ဆၧ လၧအဒုၭဆီၪ့နထီၪ့ လဖၪ, ဒဲခံလၧနဎွံၪၥံၪအဂးလီၫ.",
			"9": "<sup>9</sup> မၩလၩမၩဖၩ့ယဟိဝၩ လၧနစူၪလးနခၪ့ခိၪ,ဒဲလၧ",
			"10": "<sup>10</sup> နဆၧအၪထၪ့ထီးအလူၬ အၥၪဆိၫနီၪဆ့ဆံၭ.- နဖၫ့ၥံၪ မိလၧၫ့ဎွ့ၩ လၧဆၧအၪအၪလ့ၬတၭ, နဘံၭခွံၬစဘံၭၥၪ အလးလဖၪ မိဎွ့ၩလၨၪခွံၬ လၧစဘံၭထံၫအၥၫ့ဘဲၫနီၪ လီၫ.",
			"11": "<sup>11</sup> ယဖိၪခွၫဧ့, ယဟိဝၩအဆၧစ့ၩရၫ့နီၪ, ထီးမၩကြၩ့ ထမးလဂ့ၩ, ဒဲအဆၧအၪ့ၥီၪ့နီၪ, ထီးအီၪက့ၪလၧဆၧ",
			"12": "<sup>12</sup> ၥၭလိၪလဂ့ၩ.- အဂဲးဘဲၫယီၩ ထီးဒၪၦလၧ ယဟိဝၩ အဲၪဝ့ၫလဂၩဂၩနီၪ, အၪ့ၥီၪ့ဝ့ၫ, ဘဲၫဖါအၪ့ၥီၪ့အဖိၪခွၫ လၧအအဲၪဝ့ၫလဂၩ နီၪလီၫ.",
			"13": "<sup>13</sup> ၦလဂၩလၧအဒၪန့ ဆၧကိၪ့ဘၪကိၪ့ၥ့ၪနီၪ ဒဲၦလဂၩ",
			"14": "<sup>14</sup> လၧအန့ဘၪၥုၪ့ဆၭၥၭဆၭနီၪ ဘၪဆိၪဂ့ၩဝ့ၫလီၫ.- အ ဂဲးဘဲၫယီၩ အနီၪဒုၭအီၪထၪ့ဆၧဂ့ၩနဲၪ့ ဆၧလၧကျိၪ ၥံၪစ့ၩၥံၪ ဒုၭအီၪထၪ့ဝ့ၫနီၪ, ဒဲအဆၧအၪထၪ့ဂ့ၩနဲၪ့",
			"15": "<sup>15</sup> ထီၫ့ၥံၪလွ့ၫၥံၪဆ့လီၫ.- အဎွ့ၩဒိၪနဲၪ့ မနံၬထၫ့မျါၥံၪး ဒဲကယဲဆၧလၧ နဆိၫ့န့ဘၪထီးအလူၬလဖၪနီၪ,ဆၧယိ",
			"16": "<sup>16</sup> ဎီၩ့လၧအနီၪၥ့ၪအ့ၬ.- မုနံၩအၪအီၪလၧ အစူၪထွ့ၪအ ဖၧၩ့ ဆၧလၧၫ့ဆၧဎွ့ၩ ဒဲဆၧလၩဆၧဖၩ့အီၪလၧအစူၪ",
			"17": "<sup>17</sup> စ့ၪအဖၧၩ့နီၪဆ့လီၫ.- အဖၧၩ့ၥၭၥံၪမွဲဖၧၩ့ၥၭအမုၬအ ဂ့ၩ, ဒဲကယဲအဖၧၩ့ၥၭလဖၪ မွဲဆၧမုၬဆၧဎၩ့ထီးအလူၬ",
			"18": "<sup>18</sup> လီၫ.- မွဲၥံၪ့မၧၫ့လထံၭ လၧၦလၧအဖီၪ့ထၬဝ့ၫအဂး, ဒဲကယဲၦလၧအဖီၪ့ထၬခၧၫ့ လဂၩလါလါနီၪ ဘၪဆၧ ဆိၪဂ့ၩဝ့ၫလီၫ.",
			"19": "<sup>19</sup> ယဟိဝၩအီၪက့ၪလၩ့ဂၪ့ခိၪ လၧဆၧကိၪ့ဘၪကိၪ့ၥ့ၪ,",
			"20": "<sup>20</sup> တဲၩ့လၩ့မူၭခိၪ လၧအဆၧကိၪ့ဆၧဆၭလီၫ.- ဆၧယိၬ ၥံၪဘၪထ့ဖၭဝ့ၫ လၧအဆၧၥ့ၪယၫ, ဒဲဆၧအုၪ့ၥံၪဒုၭလၩ့",
			"21": "<sup>21</sup> ဆၩ့ထံၫနီၪဆ့လီၫ.- ယဖိၪခွၫဧ့, ထီးဒုၭစဲၪ့ထၪ့ခွံၬအ ဝ့ၫၥံၪလၧနမ့ၬၥၪနီၪလဂ့ၩ, ခိၭထၬဆၧကိၪ့ဘၪကိၪ့ၥ့ၪ",
			"22": "<sup>22</sup> တၡါနီၪ, ဒဲဆၧထီးလၩ့နၥၭနီၪဆံၭ.- တၭအဝ့ၫၥံၪမိ ကဲၪထၪ့ဆၧမၧၫ့ လၧနၥၭၡီၩ့အဂး, ဒဲဆၧအဎံၫအလၩ",
			"23": "<sup>23</sup> လၧနခိၬအဂးလီၫ.- ထီးနီၪလဖၧၫ့နမိဖိၬ နဖၧၩ့ၥၭဂုး",
			"24": "<sup>24</sup> ဂုးခၧၫ့ခၧၫ့တၭ, နခၪ့မိဘၪထၧၩ့အ့ၬ.- ထီးနအ့ၪမံၫနၩ့ တၭ,နမိၥၭမဲၪဆၧအ့ၬ, မွဲမၬ, နမိမံၫနၩ့တၭ, မံၫမၪမုၬ",
			"25": "<sup>25</sup> မုၬလီၫ.-ဆၧၥၭမဲၪရှုၭနီၪထီးၥၭမဲၪလဂ့ၩ, ၦအၧၩ့ၥံၪ",
			"26": "<sup>26</sup> အဆၧဂၭဂီၩ့အ့ၪလၩ့ဘၪဝ့ၫနီၪ, ၥၭမဲၪဆ့လဂ့ၩ,- အဂဲး ဘဲၫယီၩ ယဟိဝၩ မိကဲၪထၪ့နဆၧဒိၭနဲၩ့အလးတၭ, အဝ့ၫဒၪမိခိၭထၬနခၪ့ ဘဲၫၥိၭဆၧထီးဖီၪ့န့ဘၪလဂ့ၩ လီၫ.",
			"27": "<sup>27</sup> ထီးနစူၪၥံၪမၩအ့ၪၥ့ၪတၭ, ပဒၩ့ဆၧဂ့ၩလၧၦလၧအ",
			"28": "<sup>28</sup> ကြၨၭန့ဘၪဝ့ၫနီၪလဂ့ၩ,- ဆၧအ့ၪအီၪ လၧနစူၪဖၧၩ့ တၭ, စံၭၦလၧနနဲၩ့ထံၭ, လ့ၩကဒၪဘီၪ, ဂဲၫထဲၩ့နးဖၧၫ့ ဒီၭ, ကဲဂီၩခိၬနီၪ ယမိဖ့ၪလၫ့နၧၩ,ဧီၪ, ထီးစံၭလဂ့ၩ,",
			"29": "<sup>29</sup> ထီးၦၡၩအ့ၪအီၪဂုးခၧၫ့ လၧနနဲၩ့ထံၭနီၪတၭ, ထီးကိၪ့",
			"30": "<sup>30</sup> ဆၧအၧၩ့ ထၫ့ဒုၪဒၩအဝ့ၫနီၪလဂ့ၩ.- ၦၡၩအ့ၪလမၩ အၧၩ့ဘၪနၧၩနီၪ, ထီးဂဲးလိၬတ့ၭလိၬ လၧအဝ့ၫနီၪပျီၩ",
			"31": "<sup>31</sup> ပျီၩလဂ့ၩ,- ထီးၥၭခ့ၬၦၡၩမၩဆီၪ့ဆၧနီၪလဂ့ၩ, ဒဲရွံန့",
			"32": "<sup>32</sup> အဝ့ၫဒၪအဖၧၩ့ၥၭၥံၪ နးဘီၩ့လဂ့ၩ,- အဂဲးဘဲၫယီၩ ၦလၧအၥၭကဲၪ့နီၪ မွဲဆၧၥၭလိၪလၧယဟိဝၩ အမ့ၬယၫ လီၫ. အ့ၪမွဲအခိးအတၩ အီၪလၧၦအတီၩအလီၩ့လီၫ.",
			"33": "<sup>33</sup> ယဟိဝၩအဆၧဆိၪအၧၩ့ အီၪလၧၦလတီၩလလီၩ့ဘၪ အဂံၪ့ဖၧၩ့တၭ, အ့ၪမွဲဆၧမိဆိၪဂ့ၩ ၦအတီၩအလီၩ့",
			"34": "<sup>34</sup> အီၪဝ့ၫအလးနီၪလီၫ.- ၦလၧအမၩကြၩ့ထမးဆၧနီၪ, အဝ့ၫဒၪမၩကြၩ့ထမး အဝ့ၫၥံၪလါနၫ့ဘိၩ, မွဲအဖ့ၪလၫ့ ဆၧအခိးအတၩ လၧၦလၧအဆၪ့လၩ့အၥၭ လဖၪနီၪ",
			"35": "<sup>35</sup> လီၫ.- ၦလၧအကိၪ့ဘၪကိၪ့ၥ့ၪလဖၪ မိန့ၥၫဆၧလၩဖၩ့, အ့ၪမွဲၦအဂီၩ့ၥံၪ အဝ့ၫဒၪအီၪက့ၪထၪ့ထီၫဝ့ၫ လၧဆၧ မ့ၬမဲအလးလီၫ."
		},
		"4": {
			"1": "<sup>1</sup> ဖိၪခွၫၥံၪဧ့, ခိၭနၪဖါအဆၧၥီၪ့ဆၧၥၫ့နီၪဆံၭး ဒဲဒိၭ နၥံၪအနါ, ဘဲၫၥိၭနၥံၪမိၥ့ၪယၫ ဆၧၥုၪ့ဆၭၥၭဆၭနီၪ",
			"2": "<sup>2</sup> ဆံၭ.- အဂဲးဘဲၫယီၩ ယဖ့ၪလၫ့နၥံၪ ဆၧၥီၪ့ဆၧၥၫ့အ",
			"3": "<sup>3</sup> ဂ့ၩတၭ, ထီးစဲၪ့ဒၪယဆၧၥီၪ့ဆၧၥၫ့နီၪလဂ့ၩ.- အဂဲး ဘဲၫယီၩ ယမွဲယဖါအဖိၪခွၫ ဒဲဖိၪၥၭဘီၩ့လဂၩဎးလၧ",
			"4": "<sup>4</sup> ယမိအမ့ၬယၫနီၪလီၫ.- ဖါၥီၪ့ထဲၩ့ၥၫ့ထဲၩ့ယၧၩတၭ, စံၭယၧၩ, မွဲနၥၭဖီၪ့ထၬယဆၧချဲၩ့ဆံၭး ထီးန့ယဆၧ",
			"5": "<sup>5</sup> မၪလူၬၥံၪတၭ, အီၪမၧၫ့နဝ့ၫဆံၭ.- အၪ့မၩန့ဆၧကိၪ့ ၥ့ၪဆံၭ, အၪ့မၩန့ၥုၪ့ဆၭၥၭဆၭး ထီးၥၭနၪ့လဂ့ၩး",
			"6": "<sup>6</sup> ထီးကၠၪခွံၬနၥၭ လၧယနိၭ အဆၧချဲၩ့ၥံၪလဂ့ၩ.- ထီး စဲၪ့ဒၪအဝ့ၫလဂ့ၩတၭ, မိခိၭထၬနၧၩ, အဲၪအဝ့ၫဆံၭ,မိ",
			"7": "<sup>7</sup> ယိထဲၩ့ခွါထဲၩ့နၧၩလီၫ.- ဆၧအခိၪလမံၩ့ မွဲဆၧကိၪ့ ဘၪကိၪ့ၥ့ၪတၭ, အၪ့မၩန့ဆၧကိၪ့ဘၪကိၪ့ၥ့ၪနီၪဆံၭ, ဒဲလၧနမၩန့ဆၧထီးအလူၬနီၪ, အၪ့မၩန့ၥုၪ့ဆၭၥၭဆၭ",
			"8": "<sup>8</sup> ဆံၭ.- အီၪက့ၪထၪ့ထီၫအဝ့ၫနီၪဆံၭ, တၭဆၧမိဒုၭထီၫ ထၪ့နလး, ထီးနအ့ၪဖိၭဂိၫ့အဝ့ၫနီၪတၭ, မိဒုၭလၩဖၩ့",
			"9": "<sup>9</sup> နၧၩလီၫ.- အဝ့ၫဒၪမိဖ့ၪလၫ့ဆၧကယၧၩ့ လၧနခိၪဎွံၪ အဂး မိဖ့ၪလၫ့နၧၩ ဆၧဎံၫလၩအၥရဖူၩနီၪလီၫ.",
			"10": "<sup>10</sup> ယဖိၪခွၫဧ့ ခိၭနၪဘီၪ, ဒဲထီးန့ယဆၧချဲၩ့လဖၪဆံၭ, တၭနၥၭမၧၫ့အနံၪ့ၥံၪ မိအၪထၪ့လၧနဂး အၪအၪလ့ၬ",
			"11": "<sup>11</sup> ဆ့လီၫ.- ယၥီၪ့လိၪနၧၩ လၧဆၧကိၪ့ဘၪကိၪ့ၥ့ၪအဖၧၩ့ ၥၭလဘီၩ့နီၪး ယၥိၫ့နၧၩလၧ ဆၧတီၩဆၧလီၩ့အဖၧၩ့",
			"12": "<sup>12</sup> ၥၭၥံၪလီၫ.- ထီးနအ့ၪလ့ၩဆၧတၭ, နခၫထၪ့လၧနဆၧ အံၪ့အဖၧၩ့အ့ၬး ထီးနအ့ၪစဲၪ့တလဲးတၭ, နခၪ့မိဘၪ",
			"13": "<sup>13</sup> ထၧၩ့အ့ၬ.- ဖီၪ့ထၬဆၧၥီၪ့ဆၧၥၫ့ ဂုးဂုးခၧၫ့ခၧၫ့ဆံၭ, ထီးဖျါခွံၬလဂ့ၩး ခိၭထၬဝ့ၫဆံၭ, အဂဲးဘဲၫယီၩ မွဲနဆၧ",
			"14": "<sup>14</sup> မၧၫ့လီၫ.- ထီးလ့ၩနုၬ လၧၦလတီၩလလီၩ့ဘၪအဖၧၩ့ ၥၭနီၪလဂ့ၩး ဒဲၦအၧၩ့အဖၧၩ့ၥၭနီၪ ထီးဖိၬလၧယၫ",
			"15": "<sup>15</sup> လၩလါလဂ့ၩ.- ဂၭဎ့ၭခွံၬဆံၭး ထီးခၫ့ဂၬလဂ့ၩး ကၠၪ",
			"16": "<sup>16</sup> ခွံၬလၧအအီၪတၭ, စဲၪ့ဒၪခွံၬဆံၭ.- အဂဲးဘဲၫယီၩအ ဝ့ၫၥံၪအ့ၪလမၩဒံၭဘၪဆၧအၧၩ့နီၪ, မံၫဝ့ၫအ့ၬး အဝ့ၫ ၥံၪအ့ၪလဒုၭလၩ့ထံၩဖါဘၪ ၦလဂၩဂၩတၭ, မံၫဝ့ၫန့",
			"17": "<sup>17</sup> အ့ၬ.- အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪအၪ့ဆၧအၧၩ့အကိၪးဒဲ",
			"18": "<sup>18</sup> အီၩဆၧမၩဆီၪ့အစဘံၭထံၫဆ့လီၫ.- အ့ၪမွဲၦအတီၩ အလီၩ့အဖၧၩ့ၥၭ မွဲဘဲၫဆၧဖၩ့ယုၩ့ယဲအၥိၭတၭ, အ ဆၧဖၩ့နီၪဒံၩ့ယံၬဒံၩ့ဖၩ့ထၪ့, ဒံၩ့ယံၬဒံၩ့ဖၩ့ထၪ့ထီးမု",
			"19": "<sup>19</sup> ထုၪ့နီၪလီၫ.- ၦလတီၩလလီၩ့ဘၪအဖၧၩ့ၥၭ မၩအၥၭ ဘဲၫဆၧခံၭၥၧၫ့အၥိၭတၭ, အခၪ့ဘၪထၧၩ့လၧနီၫလဲၪ နီၫလဲၪနီၪၥ့ၪယၫဝ့ၫအ့ၬ.",
			"20": "<sup>20</sup> ယဖိၪခွၫဧ့, ခိၭနၪယဆၧချဲၩ့ၥံၪဆံၭးဒိၭနနါလၧယ",
			"21": "<sup>21</sup> ဆၧချဲၩ့လဖၪနီၪဆံၭ.- ထီးဒုၭစဲၪ့ဒၪခွံၬအဝ့ၫၥံၪလၧန မ့ၬၥၪဖၧၩ့နီၪလဂ့ၩ ခိၭထၬဝ့ၫလၧနၥၭခံဖၧၩ့နီၪဆံၭ.",
			"22": "<sup>22</sup> အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪမွဲဆၧမၧၫ့ လၧၦလၧအဒၪန့ဝ့ၫ ကိၭဂၩဒ့ၭအဂး, ဆၧဒုၭဆီၪ့ထၪ့ လၧအဖံၭအယၪထၧၫ့",
			"23": "<sup>23</sup> ဂၩယၫအဂးလီၫ.- လၧဆၧလၧနဘၪခိၭထၬဝ့ၫကိၭအ မံၩ့ဒ့ၭအဖၫ့ခိၪနီၪ, ခိၭထၬနၥၭဆံၭ, အဂဲးဘဲၫယီၩၥၭ",
			"24": "<sup>24</sup> မၧၫ့အဆၧဖံၭဆၧမၩ ဂဲၫထၪ့ခွံၬလၧအဖၧၩ့လီၫ.- နိၭ အၪ့လီၫဆၧနီၪၥုၭခွံၬလၧနအီၪဆံၭး ဒဲနိၭဖျံၩကဲၪ့လ",
			"25": "<sup>25</sup> ဖၪနီၪအီၪက့ၪယဲၩ့ထၪ့ လၧနၧၩဆံၭ.- မွဲနမ့ၬၥၪၥံၪယိ ဆၧတီၩတီၩလၧနမ့ၬယၫဆံၭး ဒဲနမ့ၬဖံၭအီၪဆုးလီၩ့",
			"26": "<sup>26</sup> လၧနမ့ၬယၫဆံၭ.- ယိဆီၫ့မီၪ့နခၪ့အဖၧၩ့ၥၭတၭး ဒဲန ဖၧၩ့ၥၭထီးအလူၬလဖၪနီၪ, မွဲအအီၪဂုးဂုးခၧၫ့ခၧၫ့",
			"27": "<sup>27</sup> ဆံၭ.- ၥုၭခွံၬနခၪ့လၧဆၧအၧၩ့တၭ, လၧစူၪထွ့ၪမွဲဂ့ၩ, လၧစူၪစ့ၪမွဲဂ့ၩ, ထီးကၠၪနၥၭလဂ့ၩ."
		},
		"5": {
			"1": "<sup>1</sup> ယဖိၪခွၫဧ့, ထီးလၩ့နၥၭခိၭနၪယဆၧကိၪ့ဘၪကိၪ့",
			"2": "<sup>2</sup> ၥ့ၪဆံၭး ဒိၭနနါလၧယဆၧကိၪ့ဆၧဆၭနီၪဆံၭ.- မွဲဘဲၫ ၥိၭနမိဒူၩယၪ့ဆၧဒုၭကိၪ့ၥံၪ ဒဲနနိၭဖျံၩၥံၪမိပၧၩ့ဆၧၥ့ၪ",
			"3": "<sup>3</sup> ယၫနီၪလီၫ.- အဂဲးဘဲၫယီၩ ၦလၩ့မဲၩမုၪနီၪအနိၭဖျံၩ ဒုၭလၩ့ဆၩ့န့ၫစၩ့တၭ, အနိၭနီၪဖျ့ၫနဲၪ့ဒံၭၥိၪလီၫ.",
			"4": "<sup>4</sup> အ့ၪမွဲအထုၬခၪဘဲၫရီးခၥီၫအၥိၭ, အဲၪ့ဝ့ၫဘဲၫနၭလၧအ",
			"5": "<sup>5</sup> နါအီၪနံၫခီၫလူၬအၥိၭနီၪလီၫ.- အခၪ့ၥံၪလ့ၩလၩ့လၧ",
			"6": "<sup>6</sup> ဆၧၥံၫတၭ, အခၫထၪ့လဖၪ ဖီၪ့ထၬဖျႃဖၧၩ့း- ဘဲၫၥိၭန ထီးဆီၫ့မီၪ့လၩ့နၥၭ လၧၥၭမၧၫ့ အဖၧၩ့ၥၭနီၪလဂ့ၩ, အဝ့ၫဒၪအဖၧၩ့ၥၭၥံၪ လ့ၩဝံၩ့ဝၩ့ဝ့ၫ နချႃၭၥ့ၪယၫအဂဲး အကၠီၪ့အ့ၬ.",
			"7": "<sup>7</sup> အခိးမွဲဘိၩ့နဲၪ့ယီၩ, ဖိၪၥံၪလံၩၥံၪဧ့, ခိၭနၪယၧၩ ဆံၭ,ထီးကၠၪခွံၬနၥံၪအၥၭ လၧယနိၭအဆၧ ချဲၩ့လဖၪ",
			"8": "<sup>8</sup> လဂ့ၩ.- ၥုၭယဲၩ့ထၪ့ခွံၬနဖၧၩ့ၥၭလၧၦမုၪနီၪဆံၭး တၭ ထီးၥုၭဘူၭနၥၭလၧအဝ့ၫဒၪအဂံၪ့ အတရၫ့နီၪ လဂ့ၩ.",
			"9": "<sup>9</sup> ဘဲၫၥိၭနထီးဖ့ၪလၫ့နလၩနဖၩ့ လၧဂူၫဂၩလဂ့ၩ, ဒဲနနံၪ့ ၥံၪလၩၥံၪ လၧၦလၧအလယၫ့ၥၭဘၪ ဆၧနီၪလဂ့ၩ,",
			"10": "<sup>10</sup> ဘဲၫၥိၭၦလခီၫဘၩ့မုးဖိၪ ထီးလၧၫ့ဎွ့ၩလၧနစူၪလးခၪ့ ခိၪလဂ့ၩ, ဒဲနမၩဆၧအလံၩ့အလဲၫထီးအီၪလၧၦလခီၫ",
			"11": "<sup>11</sup> ဘၩ့မုးဖိၪအဂံၪ့ဖၧၩ့နီၪလဂ့ၩး- ထီးနဖံၭနယၪဒဲနဆၧ လၧၫ့ဎွ့ၩအ့ၪလူၬခွံၬဝ့ၫတၭ, နဂၪ့အုၩဂၪ့ထိၬလၧနဖၧၩ့",
			"12": "<sup>12</sup> ၥၭထုၬတၭး- စံၭ, ယဝ့ၫဒၪယၥၭဂဲၫ့မ့ၬလဲၩဆၧၥီၪ့ဆၧ ၥၫ့နီၪဆံၭအၪလဲၪၬ ဒဲယၥၭမၩကြၩ့ထမး ဆၧအၪ့ၥီၪ့",
			"13": "<sup>13</sup> ဆ့တၭၬ-ဒဲယလခိၭနၪဘၪ ယဆရၫၥံၪအလူတၭ, ယ ဒိၭဘၪယနါ လၧၦလၧအၥီၪ့လိၪယၧၩ လဖၪနီၪဆ့",
			"14": "<sup>14</sup> အ့ၬ.-တၭလၧၦခမျၧး ဒဲဆၧအီၪကီၪ့အကျၩနီၪ လၩ့ဘူၭ လၧယမိအီၪလၧဆၧအၧၩ့ ထီးအလူၬအဖၧၩ့လီၫ.",
			"15": "<sup>15</sup> အီၩထံၫလၧနထံၫဖၧၩ့ဒၪနဝ့ၫး ဒဲထံၫအလၩ့ယွၩလၧ",
			"16": "<sup>16</sup> နထံၫထၪ့ဖျိၭဒၪနဝ့ၫအဖၧၩ့နီၪဘီၪ.- မွဲနထံၫထၪ့ဖျိၭၥံၪ မိလၩ့ယွၩလၧခီၫ့,ထံၫချိၬၥံၪလၧဖၧၩ့ၥၭ ဖၭဒိၪအဖၧၩ့",
			"17": "<sup>17</sup> ဆ့ဧၪ.- မွဲအအီၪလၧနဂးဒၪနဝ့ၫဘီၪ, မွဲအထီးအီၪလၧ",
			"18": "<sup>18</sup> ၦလခီၫဘၩ့မုးဖိၪအဂးနီၪလဂ့ၩ.- မွဲနထံၫထၪ့ဖျိၭနီၪ ဘၪဆၧဆိၪဂ့ၩဆံၭး ဒဲၥုၪ့ထိၬၥၭထိၬလၧနမၫလၧနဖိၪ",
			"19": "<sup>19</sup> ၥၪခွၫထၪ့နီၪဘီၪ.- မွဲဝ့ၫခ့ၫဘၩ့မိအဂ့ၩ, ဒဲခ့ၫဘၫ့မိအ ဎံၫအလၩၬ မွဲအဝ့ၫဒၪအနူၥံၪ ဒုၭမံၫ့ၥုၪ့မံၫ့ၥၭနၧၩလၧ ကိၭအဆၧၫ့အထီဒ့ၭ, ဒဲအဝ့ၫဒၪအဆၧအဲၪနီၪ, မွဲအ",
			"20": "<sup>20</sup> မၩမၧၩ့နၥၭလထံၪဎးဘီၩ့ဎးဆ့ဆံၭ.- ယဖိၪခွၫဧ့, န မၩမၧၩ့နၥၭလၧၦမုၪလၩ့မဲၩနီၪ, ဒဲဖိၭဂိၫ့ၦလခီၫဘၩ့",
			"21": "<sup>21</sup> မုးအၥၭနၫနီၪ, မွဲဘၪလဲၪ.- အဂဲးဘဲၫယီၩ ၦၡၩအဖၧၩ့ ၥၭၥံၪအီၪ လၧယဟိဝၩအမ့ၬၥၪ အမ့ၬယၫတၭ, အဝ့ၫ",
			"22": "<sup>22</sup> ဒၪဆီၫ့မီၪ့အဖၧၩ့ၥၭထီးအလူၬ အဂဲးအကၠီၪ့လီၫ.- ၦလ တီၩလလီၩ့ဘၪ အဆၧအၧၩ့ဆၧၥၫ့ ၥံၪမိဖီၪ့ထၬ အနၫ့ ဆါဒၪဝ့ၫတၭ, အဆၧဒဲၩဘၭဒၪဝ့ၫ အဖျံၩၥံၪမိစၧၩ့ထၬ",
			"23": "<sup>23</sup> အဝ့ၫနီၪလီၫ.- ဆၧၥီၪ့ဆၧၥၫ့ လအီၪဘၪနီၪ မိၥံၫဝ့ၫ တၭ, မိမၩမၧၩ့အၥၭ လၧအဆၧဂၭဂီၩ့ဖိၪ အဆၧအၪ အၪလ့ၬလီၫ."
		},
		"6": {
			"1": "<sup>1</sup> ယဖိၪခွၫဧ့, နအ့ၪထိးနၥၭ လၧနထံၩနၥိၭအဂး, န",
			"2": "<sup>2</sup> အ့ၪဖီၪ့ၦအစူၪလၧၦဂူၫဂၩအဂးတၭ,- နဘၪယူၭဖျံၩ ခွၩ့လၧနနိၭ အဆၧချဲၩ့ၥံၪတၭ, နဘၪဆၧမၩန့နၧၩလၧ",
			"3": "<sup>3</sup> နနိၭအဆၧချဲၩ့လဖၪလီၫ.- ဘိၩ့နဲၪ့ယီၩ, ယဖိၪခွၫဧ့, မၩဘဲၫယီၩတၭ, မၩဖီၩ့ဖျ့ၭနနၫ့ဆါဒၪနဝ့ၫဘီၪ, အဂဲး ဘဲၫယီၩနလၩ့ဘၪယူၭ လၧနထံၩနၥိၭအစီၩ့အမၩ့အ ဖၧၩ့ယူၭတၭ, လ့ၩဘီၪ, ဆၪ့လၩ့နၥၭနနၫ့ဆါဒၪနဝ့ၫ,",
			"4": "<sup>4</sup> ဒဲအၪ့ဂူၬကျ့ၭစၨၭဆီၪ့ လၧနထံၩနၥိၭဆံၭ.- ထီးဒုၭမံၫ",
			"5": "<sup>5</sup> နမ့ၬၥၪၥံၪလဂ့ၩ, ဒဲထီးဒုၭမံၫမၪနမ့ၬဖံၭလဂ့ၩ.- မၩ ဖီၩ့ဖျ့ၭနနၫ့ဆါဒၪနဝ့ၫ ဘဲၫခ့ၫဘၩ့မိလၧၦအစူၪဖၧၩ့အ ၥိၭ,ဒဲဘဲၫထိၪၥံၪလံၪၥံၪ လၧၦဖီၪ့ထိၪအစူၪဖၧၩ့အၥိၭ နီၪဆံၭ.",
			"6": "<sup>6</sup> ၦအကၠႃၪ့လဂၩဧ့, လ့ၩစိၩ လၧထုးအအီၪနီၪဘီၪ, ယိဆီၫ့မီၪ့အဖၧၩ့ၥၭၥံၪနီၪတၭ, အီၪလၧဆၧကိၪ့ဘၪ",
			"7": "<sup>7</sup> ကိၪ့ၥ့ၪဆံၭ,- အဝ့ၫၥံၪအၦဒိၪဖၭဒိၪမွဲဂ့ၩ, ၦယိဝ့ၫမွဲ",
			"8": "<sup>8</sup> ဂ့ၩ,ၦပၧၩ့ဝ့ၫမွဲဂ့ၩ, လအီၪဘၪလါနၫ့ဘိၩ,- တဲၩ့ဝဲၩအ ဆၧအၪ့ဆၧအီၩ လၧဆၧခိအခၫ, ဒဲအီၪက့ၪကီၪ့အဆၧ",
			"9": "<sup>9</sup> အၪ့လၧကူၭဘုၪအထီနီၪလီၫ.- ၦအကၠႃၪ့လဂၩဧ့, မွဲ နမိမံၫနၩ့ဆံၭယံၬလဲၪ, မွဲနမိနၪ့ထၪ့ထဲၩ့နၥၭ ဆံၭယံၬ",
			"10": "<sup>10</sup> ခိၬလဲၪ.- မိမံၫလဆံၭဆံၭ, မံၫမၪဒံၭလဆံၭဆံၭ, ခါချံၭ",
			"11": "<sup>11</sup> လၩ့စူၪၥံၪအီၪပွံၭဒၪခလူၬ လဆံၭဆံၭး- တၭနဆၧၡၪ့ ဆၧယၬမိဂဲၫ ဘဲၫၦထမျၬဆၧအၥိၭ, ဒဲနဆၧကြၨၭန့ ဘၪနီၪဘဲၫၦအီၪ လၧအစူၪဝဲၩၥံၪ လဂၩအၥိၭနီၪလီၫ.",
			"12": "<sup>12</sup> ၦလၧအလ့ၩဆၧ လၧဆၧအဘျံၭအဘျၪအဖၧၩ့လ ဂၩနီၪ, မွဲၦအအၧၩ့, ၦအၪ့ဂူၬ မၩဆီၪ့ဆၧလဂ့ၩဘၪနီၪ",
			"13": "<sup>13</sup> လီၫ.- အဝ့ၫဒၪဖျၭအမ့ၬ, ချဲၩ့ဆၧလၧအခၪ့ၥ့ၪ, ဒုၭနဲၪ",
			"14": "<sup>14</sup> ဆၧလၧအစူၪနိၩ့ၥံၪတၭး- အၪ့လီၫဆၧလၧအၥၭခံ ဖၧၩ့, ကၩ့ကၩဆၧအၧၩ့ကိၭအဆၧၫ့အထီဒ့ၭး အဝ့ၫ",
			"15": "<sup>15</sup> ဒၪဎွံၪဆၧအဲၪ့လိၬဆိၭချဲၩ့လီၫ.- မၩအၥၭဘဲၫနီၪတၭ အဆၧၡၪ့ဆၧနၭ မိလၩ့ဘၪရှုၭဝ့ၫတၭး အဆၧဂၭဂီၩ့ မိဘၪရှုၭဝ့ၫ ထီးဆၧမၩဖီၩ့မၩဖျ့ၭၥ့ၪ နးမံၩ့အ့ၬ.",
			"16": "<sup>16</sup> ဆၧလၧယဟိဝၩၥၭဂဲၫ့မ့ၬလဲၩဝ့ၫ အီၪဎူၫမံၩ့, ဒဲနွ့ၫ",
			"17": "<sup>17</sup> မံၩ့အၥၭအီၪက့ၪဝ့ၫ လၧၥၭလိၪလီၫ.- ၦအမ့ၬၥၪထၪ့ ထီၫဝ့ၫ ၦအဖျ့ၩချဲၩ့ဆၧအဘျံၭအဘျၪ, ၦအစူၪလၧအ",
			"18": "<sup>18</sup> လူၫလၩ့ ၦအဆၧဒဲၩဘၭ လအီၪဘၪအၥွံၪ,- ၦအၥၭ ကိၪ့ဝဲၩဆၧကိၪ့အအၧၩ့, ၦအခၪ့ဖျဲၪၥံၪ ဘဲၫၥိၭအမိမၩ",
			"19": "<sup>19</sup> ဆၧအၧၩ့း- ၦလၧအၥၪထၪ့ဆၧလတီၩဘၪ, ထိးအၥၭ အဘျံၭအဘျၪး ဒဲၦလၧဎွံၪဆၧအဲၪ့လိၬ ဆိၭချဲၩ့လၧ ၦထၧၫ့ဖုဝဲၥံၪ အကျၩနီၪလီၫ.",
			"20": "<sup>20</sup> ယဖိၪခွၫဧ့, ထီးန့ဖံၭထၬ နဖါအဆၧမၪလူၬလဖၪနီၪ",
			"21": "<sup>21</sup> ဆံၭး ဒဲနမိအဆၧၥီၪ့ဆၧၥၫ့နီၪ ထီးခွံၬၡိၭလဂ့ၩ.- ဘဲၩ့ ထၬအဝ့ၫၥံၪ လၧနၥၭလီၩ့လထံၪဎးလဘီၩ့ဎးဆံၭး ဒဲ",
			"22": "<sup>22</sup> စၧၩ့ထၬဝ့ၫ လၧနခိၬအလီၩ့နီၪဆံၭ.- ထီးနအ့ၪလ့ၩ ဆၧတၭ, အဝ့ၫဒၪမိၥိၫ့နၧၩတၭး ထီးနအ့ၪမံၫနၩ့တၭ အဝ့ၫနီၪမိခိၭယိနၧၩး ထီးနအ့ၪနၪ့ထၪ့နၥၭ, အဝ့ၫနီၪ",
			"23": "<sup>23</sup> မိချဲၩ့ဒုၪ့နၧၩလီၫ.- အဂဲးဘဲၫယီၩ ဆၧမၪလူၬမွဲမ့ၪဒိၩ့, ဒဲဆၧၥီၪ့ဆၧၥၫ့နီၪ မွဲဆၧဖၩ့း ဒဲဆၧအၪ့ၥီၪ့အဆၧၥီၪ့",
			"24": "<sup>24</sup> ထဲၩ့ၥၫ့ထဲၩ့နီၪ မွဲဆၧမၧၫ့အဖၧၩ့ၥၭတၭး- ဘဲၫၥိၭအမိ ခိၭထၬနၧၩ လၧၦမုၪအအၧၩ့နီၪ, လၧၦမုၪလၩ့မဲၩအ",
			"25": "<sup>25</sup> ဖျ့ၩချဲၩ့မုၬနါဆၧလီၫ.- အဝ့ၫဒၪ အခံးဘၪဂၩ့ဂ့ၩနီၪ, ထီးၥၭကွံၩလၧနၥၭခံဖၧၩ့လဂ့ၩး ထီးဖ့ၪလၫ့အဝ့ၫဒၪ",
			"26": "<sup>26</sup> ဖီၪ့န့နၧၩလၧအမ့ၬဖံၭၥံၪလဂ့ၩ.- အဂဲးဘဲၫယီၩလၧၦ အ့ၭကံၫမုၪအကၠီၩ့နီၪ ၦဘၪၡၪ့ဘၪနၭထီးအကိၪအီၪ န့ၫလလီၪ့နီၪလီၫ. အ့ၪမွဲၦမုၪလၧအအဲၪဘိၩ့အဝၩနီၪ အၪ့ဎူၫအၪ့ဎၬ ၦအၥၭမၧၫ့လၧအမွဲ ဆၧလူဒိၪဎွ့ၩဒိၪနီၪ",
			"27": "<sup>27</sup> လီၫ.- ၦလဂၩအီၪက့ၪမ့ၪ လၧအၥၭနၫအဖၧၩ့တၭ, အ",
			"28": "<sup>28</sup> ကီၩ့အၥိၭလခဲၩထၪ့ဘၪနီၪ, ဘၪမိၥ့ၪဧၪ.- ၦၡၩဂၭ ဖၬလၧမ့ၪအၧၩ့အဖၫ့ခိၪတၭ, အခၪ့ၥံၪလခိဎီၩဘၪနီၪ,",
			"29": "<sup>29</sup> ဘၪမိၥ့ၪဧၪ.- ဘဲၫနီၪၥိၭဆ့ ၦၡၩအ့ၪနုၬ လၧၦအီၪလၧ အနဲၩ့ထံၭလဂၩအမၫအအီၪတၭး ကယဲၦလၧအထိၭ ဘၪၦမုၪနီၪ လဂၩလါလါ ဘၪမၪဝ့ၫကိၭဂၩဒ့ၭလီၫ.",
			"30": "<sup>30</sup> ဆၧအၪ့ဂူၪထီးအၥၭဝံအၥၭ အဘိၩ့ဘၭနီၪ, အ့ၪအၪ့ ဂူၪဆၧဘဲၫၥိၭ အမိဘျဲၩအၪ့ဝ့ၫတၭ, ၦယိဖၬခွံၬဝ့ၫ",
			"31": "<sup>31</sup> အ့ၬး- တၭၦအ့ၪဒၪန့ဝ့ၫနီၪ, အဝ့ၫဒၪဘၪဖ့ၪထဲၩ့ဆၧ နွ့ၫစၩ, အဂံၪ့ဒဲအစူၪလးခၪ့ခိၪ ထီးအလူၬနီၪမိဘၪဖ့ၪ",
			"32": "<sup>32</sup> ထဲၩ့ဝ့ၫဒၪဆ့လီၫ.- ၦလဂၩအ့ၪအဲၪဘိၩ့ၦၡၩအမၫနီၪ, အီၪလၧအၥုၪ့ဆၭ ၥၭဆၭဆ့အ့ၬး ၦလၧအမၩဝ့ၫနီၪ",
			"33": "<sup>33</sup> မၩဂၭဂီၩ့အၥၭၡီၩ့ဒၪဝ့ၫဆ့လီၫ.- အဝ့ၫဒၪမိန့ဘၪဆၧ ထးဝ့ၫ,ဒဲဆၧမ့ၬမဲတၭ, အဆၧဒုၪဒွ့ၪနီၪ ဆၧမိထူၭခွံၬ",
			"34": "<sup>34</sup> ဝ့ၫအ့ၬ.- အဂဲးဘဲၫယီၩ ဆၧၥၭကဲၪ့နီၪမွဲၦဝၩအဆၧၥၭ ထၪ့ဆီၪ့တၭ, လၧမုနံၩဖ့ၪဆၧၫ့ဆၧနီၪ အဝ့ၫဒၪယၫ့ၥၭ",
			"35": "<sup>35</sup> ဆၧအ့ၬ.- လၬဆီၪ့နီၪအဝ့ၫ ထိးဆၧၫ့ဝ့ၫနးမံၩ့အ့ၬး န ဖ့ၪလၫ့ဆၧအၪအၪလ့ၬ လါနၫ့နီၪ, အုၩ့လၩ့ဝ့ၫနးမံၩ့ အ့ၬ."
		},
		"7": {
			"1": "<sup>1</sup> ယဖိၪခွၫဧ့, ထီးန့ယဆၧချဲၩ့လဖၪဆံၭး ဒဲအီၪက့ၪ",
			"2": "<sup>2</sup> ကီၪ့ယဆၧမၪလူၬၥံၪ လၧနအီၪဆံၭ.- ထီးန့ယဆၧမၪ လူၬၥံၪတၭ, နမိမၧၫ့လီၫ. ဒဲအီၪက့ၪယဆၧၥီၪ့ဆၧၥၫ့",
			"3": "<sup>3</sup> ဘဲၫမ့ၬၡၩလၧနမ့ၬၥၪအဖၧၩ့အၥိၭနီၪဆံၭ.- ဘဲၩ့ထၬ အဝ့ၫၥံၪလၧနစူၪနိၩ့ၥံၪအလီၩ့ ကွ့ၭအဝ့ၫၥံၪ လၧနၥၭ",
			"4": "<sup>4</sup> အပၪအလီၩ့နီၪဆံၭ.- စံၭဆၧကိၪ့ဘၪကိၪ့ၥ့ၪနီၪ, နမွဲယ ထၧၫ့ဖုဝဲမုၪး ဒဲကိၭဆၧၥုၪ့ဆၭၥၭဆၭနီၪ လၧနဘူၭန",
			"5": "<sup>5</sup> ထံးမုၪဆံၭ.- ဘဲၫၥိၭအမိမၩဖီၩ့ဖျ့ၭနၧၩ လၧၦမုၪလၩ့ မဲၩနီၪ, လၧၦလခီၫဘၩ့မုးမုၪ လၧအချဲၩ့မုၬနါဆၧလၧ အနိၭအဆၧချဲၩ့ၥံၪလီၫ.",
			"6": "<sup>6</sup> အဂဲးဘဲၫယီၩ ယယိလၩ့ဆၧလၧယဂံၪ့အတရၫ့ လံၩလၧဆၧဆူၭဖၧၩ့တၭ, ယဒၪဘၪလၧၦလမၩလိၪဘၪ",
			"7": "<sup>7</sup> ဆၧအကျၩး- လၧၦဖိၪၥၪခွၫၥံၪအကျၩနီၪ, ယဒၪဘၪၦ ဖိၪၥၪခွၫလဂၩ လၧအၥုၪ့ဆၭၥၭဆၭ လအီၪဘၪတၭ,",
			"8": "<sup>8</sup> အဝ့ၫဒၪလ့ၩ လၧဖၧၩ့ၥၭဘူၭ လၧၦမုၪအီၪအနိၪ့တၭ,",
			"9": "<sup>9</sup> လ့ၩစိၩလၧအဝ့ၫဒၪအဂံၪ့း- လၧဆၧခံၭလၩ့မံၭမူၭမု",
			"10": "<sup>10</sup> ဂၪလၩ့အထီနီၪ, လၧဖိၭဖၫ့မုဆၧခံၭနီၪး- တၭ, ယိခွါ, ၦမုၪအီၪလၧၦအ့ၭကံၫမုၪအကီၩ့အၥိၭ, ဒဲအီၪလၧဆၧ အၪ့လီၫလၧအၥၭခံဖၧၩ့လဂၩ, ဂဲၫထၪ့ဒၪခီၩ့အဝ့ၫဒၪ",
			"11": "<sup>11</sup> လီၫ.- ၦမုၪနီၪအလူၥီၫမၩနၧၩ့ထၧၫ့အၥၭတၭး အခၪ့",
			"12": "<sup>12</sup> ၥံၪအီၪဂုးခၧၫ့ လၧအဂံၪ့ဖၧၩ့အ့ၬး- ဘၪလဖၧၫ့ဖၧၫ့အီၪ လၧဂံၪ့ဖၧၩ့, ဘၪလဖၧၫ့ဖၧၫ့အီၪ လၧဖၧၩ့ၥၭၥံၪး ဒဲလၧ",
			"13": "<sup>13</sup> နိၪ့ၥံၪကိၭစီၪ့ဒ့ၭနီၪ အီၪခိၭယိဂူၪဆၧလီၫ.- တၭဖီၪ့ထၬ ဖိၪၥၪခွၫနီၪ, အဲၪဂါဝ့ၫတၭ, လၧအမ့ၬလဲးနီၪ, စံၭအဝ့ၫ",
			"14": "<sup>14</sup> ဒၪး- ဆၧဘိၪ့မၩမုၬမၩဎၩ့ဆၧအီၪလၧယစူၪဖၧၩ့တၭ, မုဆၫလနံၩယီၩ ယမၩယူၭဆၧဆိၪလၩ့ယၥၭလဖၪ",
			"15": "<sup>15</sup> နီၪး- မၩအၥၭဘဲၫနီၪတၭယဂဲၫဆီးနၧၩ, ဘဲၫၥိၭယမိ",
			"16": "<sup>16</sup> အၪ့ဎူၫအၪ့ဎၬနမ့ၬတၭ, ယဒၪဘၪယူၭနၧၩယူၭး- ယ ဒၩလၩ့ယူၭယလးမံၫ လၧဆၧလုၬဘံၭဆၧ, ဆၭကံၪဝ့ၫ",
			"17": "<sup>17</sup> လၧအံဇံၭ အလူၪနီၪလီၫ.- ယဒုၭနၧၫ့မၧၫ့ ယလးမံၫ",
			"18": "<sup>18</sup> လၧမူၫရၫ့, ဒဲအကၠီၪ, ဒဲခဒၫရၫဆ့လီၫ.- ဂဲၫဘီၪ, မွဲပ ဘျဲၩအီၩၡီၩ့ဆၧ အဲၪထီးမုဆဲၪ့ထၪ့နီၪဆံၭ, ဒဲမုၬလၩ",
			"19": "<sup>19</sup> လိၬပၥၭ လၧဆၧအဲၪအဖၧၩ့နီၪဆံၭ.- အဂဲးဘဲၫယီၩ ဂံၪ့ကဆါအီၪလၧအဖၧၩ့အ့ၬး လ့ၩဆၧလၧအယဲၩ့",
			"20": "<sup>20</sup> တၭး- လ့ၩဆိၬစ့ၩအထိၪ့နီၪ, ထီးအ့ၪဘၪလၩဎွ့ၩအ",
			"21": "<sup>21</sup> နံၩနီၪမိဂဲၫထဲၩ့ထီၩ့ဝ့ၫဒၪလီၫ.- လၧအဆၧအၪ့လွ့ၫအၪ နီၪ, ဘိၭကၠၪန့အဝ့ၫအၥၭတၭ, မၩဆီၪ့ဝ့ၫလၧအနိၭ",
			"22": "<sup>22</sup> ဖျံၩအဆၧချဲၩ့မုၬနါနီၪဆ့လီၫ.- အဝ့ၫဒၪလ့ၩဖိၬအခဲၫ့ ချဲၫ့လ့ၬဘဲၫချီဖၫလ့ၩ လၧဆၧမၩၥံၫအလးအၥိၭ, ဒဲဘဲၫ ၦအဂီၩ့လဂၩ လၧဆၧအၪ့ၥီၪ့ဝ့ၫ အလးအၥိၭတၭး",
			"23": "<sup>23</sup> ဘဲၫထိၪၥံၪလံၪၥံၪ လ့ၩစိၩချဲၫ့ချဲၫ့ လၧဖျံၩခွၩ့အအီၪအ ၥိၭနီၪ, ဘိၩ့ဖျါလချႃၭနုၬဖိး လၧအၥုၪ့ဖၧၩ့ဒံၭဘၪနီၪ,",
			"24": "<sup>24</sup> အဝ့ၫၥ့ၪယၫ လၧအမွဲလၧအၥၭမၧၫ့အဂးနီၪအ့ၬ.- မၩ အၥၭဘဲၫနီၪတၭ, ဘိၩ့နဲၪ့ယီၩ, ဖိၪၥၪၥံၪဧ့, ခိၭနၪယ လူဆံၭး ဒိၭနၥံၪအနါလၧယနိၭ အဆၧချဲၩ့လဖၪနီၪ",
			"25": "<sup>25</sup> ဆံၭ.- နၥၭနီၪမွဲအထီးကၠၪစိၩအၥၭ လၧၦမုၪအဖၧၩ့ ၥၭနီၪလဂ့ၩး ထီးဂၭဖျိၭနုၬ လၧအဝ့ၫဒၪအဖၧၩ့ၥၭအ",
			"26": "<sup>26</sup> ဖၧၩ့လဂ့ၩ.- အဂဲးဘဲၫယီၩ ၦလၧအဝ့ၫဒၪ မၩလၩ့ထံၩ ဖါဝ့ၫဘၪထံၭဆၫနီၪ, မွဲၦအၪဂၩတၭး ၦအဆီၪ့လၧအ ဝ့ၫနီၪမၩၥံၫဝ့ၫထီးအလူၬနီၪ, မွဲၦအၪအၪလ့ၬဆ့လီၫ.",
			"27": "<sup>27</sup> အဝ့ၫဒၪအဂံၪ့ မွဲဖၧၩ့ၥၭဖိးလၩ့ လၧဖျႃဖၧၩ့တၭ, ဖိး လၩ့ဝ့ၫလၧ ဆၧၥံၫအဒူၭဖၧၩ့ၥံၪလီၫ."
		},
		"8": {
			"1": "<sup>1</sup> ဆၧကိၪ့ဘၪကိၪ့ၥ့ၪကိၭထၪ့ဆၧမွဲအ့ၬဧၪ, ဒဲဆၧၥုၪ့",
			"2": "<sup>2</sup> ဖၭၥၭဖၭထုၭထၪ့အလူနီၪမွဲအ့ၬဧၪ.- ဆၧၫ့ထုၪ့ဝ့ၫလၧ ဆၧအလးထၪ့ထီၫၥံၪအဒၩ့ခိၪ လၧဖၧၩ့ၥၭနဲၩ့ထီးအ",
			"3": "<sup>3</sup> လး လၧဖၧၩ့ၥၭအထါဖၧၩ့း- လၧတရၫ့ထံၭ, ထီးအ လးလၧၦၡၩလ့ၩနုၬဝ့ၫ လၧဒိၩ့ဖၧၩ့လၧတရၫ့ၥံၪအလး",
			"4": "<sup>4</sup> နီၪ, ကိၭၡၭထၪ့, စံၭဝ့ၫဒၪ,- ၦၡၩၥံၪဧ့,ယကိၭထၪ့န",
			"5": "<sup>5</sup> ၥံၪ, ဒဲယလူဘၪၦၡၩအဖိၪခွၫၥံၪလီၫ.- ၦလၧအလမၩ လိၪဘၪဆၧၥံၪဧ့, မၩလိၪဆၧကိၪ့ၥ့ၪဆံၭး ဒဲၦအဂီၩ့",
			"6": "<sup>6</sup> ၥံၪဧ့, အီၪလၧၥၭကိၪ့ဘၪကိၪ့ၥ့ၪနီၪဆံၭ.- ခိၭနၪဆံၭ, အဂဲးဘဲၫယီၩ ယမိချဲၩ့ဆၧလၧအအီၪ လၧဆၧလၩဆၧ ဖၩ့အဂဲးအကၠီၪ့း ဒဲယအၩ့ထၪ့ယနိၭမွဲ လၧဆၧတီၩလ",
			"7": "<sup>7</sup> ဖၪအဂးလီၫ.- အဂဲးဘဲၫယီၩ ယနိၭမိဘၪချဲၩ့ဆၧတီၩ တီၩတၭး ဆၧအၧၩ့ဆၧၥၫ့ မွဲယနိၭဖျံၩအဆၧၥၭလိၪ",
			"8": "<sup>8</sup> လီၫ.- ယနိၭအဆၧချဲၩ့ၥံၪ ထီးအလူၬအီၪလၧဆၧတီၩ ဆၧလီၩ့အဖၧၩ့း ဆၧကဲၪ့ကီၪ့ဒဲဆၧအၪ့လီၫ အီၪလၧ",
			"9": "<sup>9</sup> အဝ့ၫၥံၪအဖၧၩ့နးဆံၭအ့ၬ.- ဖျီၪထၪ့ဝ့ၫထီးအလူၬလၧ ၦလၧအနၪၥ့ၪဆၧအမ့ၬယၫနီၪ, ဒဲလီၩ့ဝ့ၫ လၧကယဲၦ",
			"10": "<sup>10</sup> လၧအဒၪန့ဆၧၥ့ၪယၫနီၪ အမ့ၬယၫလီၫ.- ဒိၭန့ယဆၧ ၥီၪ့ဆၧၥၫ့ လၧကျိၪၥံၪစ့ၩၥံၪအမ့ၬယၫး ဒဲဆၧၥ့ၪယၫ",
			"11": "<sup>11</sup> နီၪဆိၫနဲၪ့ထီၫ့ဆံၫ့ဆ့ဆံၭ.- အဂဲးဘဲၫယီၩ ဆၧကိၪ့ဘၪ ကိၪ့ၥ့ၪမွဲဆၧဂ့ၩနဲၪ့မနံၬထၫ့မျါၥံၪ, ဒဲကယဲဆၧမုၬဆၧ လၩၥံၪထီးအလူၬနီၪ, ဆၧယိဎီၩ့ လၧအနီၪၥ့ၪနးမံၩ့ အ့ၬ.",
			"12": "<sup>12</sup> ယဝ့ၫဒၪ, ယဆၧကိၪ့ဘၪကိၪ့ၥ့ၪ, အီၪဂုးခၧၫ့လၧဆၧ ထီးလၩ့ၥၭအဖၧၩ့, ဒဲဒၪန့ဆၧဒုၭကိၪ့ၥ့ၪလဖၪ အဆၧ",
			"13": "<sup>13</sup> ၥ့ၪယၫအဂဲးအကၠီၪ့လီၫ.- ဆၧၥၭမဲၪယဟိဝၩနီၪမွဲဆၧ မ့ၬလဲၩၥၭဂဲၫ့ ဆၧအၧၩ့တၭး ဆၧအီၪက့ၪထၪ့ထီၫအ ၥၭ,ဆၧမၩဖိၫလိၫအၥၭ, ဒဲဖၧၩ့ၥၭအၧၩ့,ဒဲနိၭအၪ့လီၫ",
			"14": "<sup>14</sup> ဆၧနီၪ,ယမ့ၬလဲၩၥၭဂဲၫ့လီၫ.- ဆၧဒုၭကိၪ့ဆၧ, ဒဲဆၧ ကိၪ့ဘၪကိၪ့ၥ့ၪ လၩ့ထံးလၩ့ဆ့ၭနီၪ, မွဲယဆၧးဆၧၥုၪ့",
			"15": "<sup>15</sup> ဖၭၥၭဖၭ, ဒဲဆၧဂဲးဆၧဘၭမွဲယဆၧလီၫ.- စဎွၩၥံၪပၧၩ့ ဆၧလၧယကၠီၩ့း ဒဲၦဒိၪဖၭဒိၪၥံၪစ့ၩရၫ့ ဆၧတီၩဆၧ",
			"16": "<sup>16</sup> လီၩ့လၧယကၠီၩ့ဆ့လီၫ.- ၦဒိၪဖၭဒိၪၥံၪပၧၩ့ဆၧလၧ ယကၠီၩ့ ဒဲၦအီၪလၧအလၩအဖၩ့, ဒဲကယဲၦစ့ၩရၫ့ဂၪ့",
			"17": "<sup>17</sup> ခိၪဖိၪၥံၪထီးအလူၬနီၪလီၫ.- ယအဲၪၦလၧအအဲၪယၧၩ တၭး ၦလၧအအၪ့ဎူၫအၪ့ဎၬဆိၫယၧၩ မိဒၪန့ယၧၩ",
			"18": "<sup>18</sup> လီၫ.- ဆၧအစူၪလးအခၪ့ခိၪဒဲဆၧလၩဆၧဖၩ့း ဆၧလူ ဒိၪဎွ့ၩဒိၪ အီၪဂုးအီၪခၧၫ့ဝ့ၫ, ဒဲဆၧတီၩဆၧလီၩ့ၥံၪအီၪ",
			"19": "<sup>19</sup> လၧယအီၪလီၫ.- ယဆၧၥၪဂ့ၩနဲၪ့ထီၫ့, မွဲမၬ,ထီၫ့လၧ ဆၧမၩဆံၫ့ထၪ့ဝ့ၫနီၪး ဒဲယဆၧအၪထၪ့နီၪ ဂ့ၩနဲၪ့စ့ၩ",
			"20": "<sup>20</sup> လၧအဘၪဆၧရွံန့ဝ့ၫနီၪလီၫ.- ယလ့ၩဆၧလၧဆၧတီၩ ဆၧလီၩ့အဖၧၩ့ၥၭ, လၧဆၧစ့ၩရၫ့တီၩအဖၧၩ့ၥၭၥံၪ",
			"21": "<sup>21</sup> လီၫ.- ဘဲၫၥိၭယမိဒုၭန့ၥၫ ၦလၧအအဲၪယၧၩအဆၧန့ ၥၫနီၪ, ဒဲအဆၧအီၪက့ၪကီၪ့အလးလဖၪနီၪ, ယမိမၩ ဎွ့ၩထၪ့ဆ့လီၫ.",
			"22": "<sup>22</sup> ယဟိဝၩမၩန့ထၬယၧၩ လၧအဖၧၩ့ၥၭအခၪ့ထံၭ,",
			"23": "<sup>23</sup> လၧအဆၧမၩလၧဖျိၩ့ လချႃၭအီၪဒံၭဘၪနီၪလီၫ.- ယ ဘၪဆၧဂုၪယၧၩ လၧဆၧအဆိၩဆိၩ အကၠၪကၠၪလၧအ ခၪ့ထံၭနီၪ, လၧဆၧအဆၧၫ့အထီ ဂၪ့ခိၪလချႃၭကဲၪထၪ့",
			"24": "<sup>24</sup> ဒံၭဘၪနီၪလီၫ.- လၧထံၫယိၬၥံၪ လချႃၭအီၪဒံၭဘၪနီၪ, ဆၧဆီၫ့အီၪန့ယၧၩး ဘိၩ့အဆၧၫ့အထီ လၧထံၫထၪ့",
			"25": "<sup>25</sup> ဖျိၭၥံၪအီၪဒံၭနးစီၪ့ဒံၭအ့ၬ.- လၧခိၪလီၩ့ၥံၪလချႃၭအီၪ လၧအလးဒံၭဘၪ, လၧစီၩ့ခိၪၥံၪလချႃၭအီၪဒံၭဘၪနီၪ",
			"26": "<sup>26</sup> ဆၧဆီၫ့အီၪန့ယူၭယၧၩယူၭလီၫ.- အဆၧၫ့အထီလၧ အလတဲၩ့လၩ့ဒံၭဘၪ ဂၪ့ခိၪမွဲဂ့ၩ, ဆံၬၥံၪနၩၥံၪမွဲဂ့ၩ, ဒဲဂၪ့ခိၪလၧၦၡၩအီၪဝ့ၫအလးနီၪ, န့ၫလလီၪ့အခၪ့ထံၭ",
			"27": "<sup>27</sup> နီၪ, အီၪဒံၭဆ့အ့ၬ.- လၧအတဲၩ့ဝဲၩမူၭခိၪၥံၪယအီၪ ထီးနီၪ, အဆၧၫ့အထီလၧအမၩဆၧဝၩ့ဒၩ့လၧထံၫယိၬ",
			"28": "<sup>28</sup> အဖၫ့ခိၪနီၪလီၫ.- လၧအအီၪက့ၪဂုးခၧၫ့အဆၧအုၪ့လၧ ထၭနီၪ, လၧအမၩဆီၪ့ထၪ့ထံၫယိၬ အဆၧထၪ့ဖျိၭနီၪ",
			"29": "<sup>29</sup> လီၫ.- လၧအအီၪက့ၪမၫဆမံၭအနဲၩ့ထံၭနီၪ, ဘဲၫၥိၭ အထံၫၥံၪ ထီးခၫ့ဖၬအဆၧမၪလူၬနီၪလဂ့ၩး ထီးအ",
			"30": "<sup>30</sup> အီၪက့ၪလၩ့ဂၪ့ခိၪ အခၪ့ထံၭလဖၪနီၪး- ယအီၪလၧ အဝ့ၫဒၪ ဘဲၫၦဒိၪထၪ့ လၧအနဲၩ့ထံၭအၥိၭနီၪ, လနံၩ ဘၪလနံၩ, လနံၩဘၪလနံၩ, ယမွဲအဝ့ၫဒၪ အဆၧမုၬ လၩ, ၥုၪ့ထိၬၥၭထိၬလၧအမ့ၬယၫလထံၪဎးလဘီၩ့ဎး",
			"31": "<sup>31</sup> တၭး- မုၬလၩယၥၭဘဲၫနီၪ လၧအဝ့ၫဒၪအဂၪ့ခိၪလၧ ၦၡၩအီၪဝ့ၫအလး, ဒဲယဆၧၥုၪ့ဎွံၫၥၭယီၫနီၪ အီၪလၧ ၦၡၩအဖိၪခွၫၥံၪအကျၩလီၫ.",
			"32": "<sup>32</sup> အခိးမွဲဘိၩ့နဲၪ့ယီၩ, ဖိၪၥၪၥံၪဧ့, ခိၭနၪယလူဆံၭး အဂဲးဘဲၫယီၩ ၦလၧအထီးန့ယဖၧၩ့ၥၭၥံၪနီၪ ဘၪဆိၪ",
			"33": "<sup>33</sup> ဂ့ၩဝ့ၫလီၫ.- ခိၭနၪဆၧၥီၪ့လိၪ, ဒဲအီၪလၧဆၧကိၪ့ဘၪ ကိၪ့ၥ့ၪနီၪတၭ, ထီးခွံၬၡိၭခွံၬလဂ့ၩ.",
			"34": "<sup>34</sup> ၦလဂၩလၧအခိၭနၪယလူ, ဘဲၫၥိၭအမိခိၭဆၧၥံၫ့ၥံၫ့ နံၩလၧယတရၫ့ထံၭ, ဒဲအီၪခိၭဆၧလၧယတရၫ့ထုၪ့ၥံၪ",
			"35": "<sup>35</sup> အဂၩ့ထံၭနီၪ, ဘၪဆိၪဂ့ၩဝ့ၫလီၫ.- အဂဲးဘဲၫယီၩၦလၧ အဒၪန့ယၧၩယီၩ ဒၪန့ဆၧမၧၫ့, ဒဲမိဘၪယဟိဝၩအခိး",
			"36": "<sup>36</sup> အတၩနီၪလီၫ.- အ့ၪမွဲၦလၧအလဒၪန့ဘၪယၧၩတၭ, အဝ့ၫဒၪမၪဘၪအၥၭဒၪဝ့ၫတၭ, ကယဲၦလၧအမ့ၬလဲၩ ၥၭဂဲၫ့ယၧၩနီၪ အဲၪဆၧၥံၫကိၭဂၩဒ့ၭလီၫ."
		},
		"9": {
			"1": "<sup>1</sup> ဆၧကိၪ့ဘၪကိၪ့ၥ့ၪ မၩထၪ့ယူၭအဂံၪ့ယူၭး တဲၩန့",
			"2": "<sup>2</sup> ယူၭအထုၪ့နွ့ၫထုၪ့ယူၭ.- အဝ့ၫဒၪမၩၥံၫယူၭ အဆၧ ဖိၪဆၧဎါၥံၪ, လဲၩဎုၬယူၭအစဘံၭထံၫနီၪ, မွဲမၬ. တဲၩ့",
			"3": "<sup>3</sup> ဝဲၩယူၭအစပွဲယူၭ.- အၪ့မၧၫ့လၩ့ယူၭအဖိၪၥၪမုၪၥံၪ တၭ,လၧဒိၩ့အဆၧထၪ့ထီၫထုၬအလးလဖၪ, ကိၭၡၭ",
			"4": "<sup>4</sup> ထၪ့,စံၭဝ့ၫဒၪး- ၦလၧအလမၩလိၪဒံၭဘၪဆၧနီၪ, မွဲ အကၠၪထဲၩ့အၥၭ လၧယီၩဘီၪး ၦလၧအၥုၪ့ဖၭၥၭဖၭ",
			"5": "<sup>5</sup> လအီၪဘၪနီၪ, အဝ့ၫဒၪစံၭအဝ့ၫ,- ဂဲၫဘီၪ, အၪ့ယဆၧ",
			"6": "<sup>6</sup> အၪ့တၭ, အီၩစဘံၭထံၫ လၧယလဲၩဎုၬနီၪဆံၭ.- စဲၪ့ဒၪ ခွံၬဆၧအဂီၩ့ၥံၪတၭ, မၧၫ့ထၪ့ဝ့ၫဆံၭး ဒဲလၧၥုၪ့ဖၭၥၭ ဖၭအဖၧၩ့ၥၭနီၪ, ဖိၬဒၪခလူၬ လၧယၫဆံၭ.",
			"7": "<sup>7</sup> ၦလၧအအၪ့ၥီၪ့ၦလဂၩ လၧအဒုၪဒွ့ၪဆၧနီၪ, န့ဘၪ ဆၧမ့ၬမဲလၧအနၫ့ဆါဒၪဝ့ၫအဂးတၭး ၦလၧအအၪ့ၥီၪ့ ၦအအၧၩ့နီၪ, န့ဘၪဆၧမဲၪၥၧၫ့မဲၪဝီၩ လၧအနၫ့ဆါဒၪ",
			"8": "<sup>8</sup> ဝ့ၫအလီၩ့နီၪလီၫ.- ၦလၧအဒုၪဒွ့ၪဆၧနီၪ, ထီးအၪ့ၥီၪ့ လဂ့ၩ, မိမ့ၬလဲၩဘၪခိၬနၧၩး အၪ့ၥီၪ့ၦကိၪ့ဘၪကိၪ့ၥ့ၪ",
			"9": "<sup>9</sup> နီၪတၭ,အဝ့ၫမိအဲၪနၧၩလီၫ.- ဖ့ၪလၫ့ဆၧလၧၦအကိၪ့ ဘၪကိၪ့ၥ့ၪတၭ, အဆၧကိၪ့မိအၪထၪ့ဝ့ၫ, ၥီၪ့ထဲၩ့ၥၫ့ ထဲၩ့ၦအတီၩအလီၩ့တၭ, အဆၧၥ့ၪယၫမိအၪထၪ့ဝ့ၫ ဒၪလီၫ.",
			"10": "<sup>10</sup> ဆၧၥၭမဲၪ ယဟိဝၩနီၪ မွဲဆၧကိၪ့ဘၪကိၪ့ၥ့ၪအခၪ့ ထံၭ, ဒဲဆၧၥ့ၪယၫ ၦဆံၫ့ဎံၪလဂၩနီၪ, မွဲဆၧၥုၪ့ဖၭ",
			"11": "<sup>11</sup> ၥၭဖၭလီၫ.- အဂဲးဘဲၫယီၩ နမုနံၩမုနၩၥံၪမိအၪထၪ့လၧ ယကၠီၩ့တၭး ဒဲဆၧမၧၫ့အနံၪ့ၥံၪလၩၥံၪ မိဘၪဆၧအီၪ",
			"12": "<sup>12</sup> က့ၪအၪထၪ့လၧနဂးလီၫ.- နအ့ၪအီၪလၧဆၧကိၪ့ဘၪ ကိၪ့ၥ့ၪနီၪ, မွဲနဆၧကိၪ့အီၪလၧနနၫ့ဆါဒၪနဝ့ၫအဂး ဒဲ နအ့ၪဒုၪဒွ့ၪဆၧနီၪ, နဘၪထိးန့ၫနနၫ့ဆါဒၪ နဝ့ၫလီၫ.",
			"13": "<sup>13</sup> ၦမုၪအဂီၩ့နီၪၥူၭဝ့ၫတၭ, အၥၭလဖၭဘၪနီၪ,ၥ့ၪယၫ",
			"14": "<sup>14</sup> ဆၧနးမံၩ့အ့ၬး- ဆၧၫ့နၩ့လၧအဂံၪ့အတရၫ့ဖၧၩ့, လၧ",
			"15": "<sup>15</sup> ဒိၩ့အလးထၪ့ထီၫၥံၪအဆၧၫ့နၩ့အလးနီၪး- ဘဲၫၥိၭအ မိကိၭထၪ့ၦလၧအလဲးလီၩ့ လၧဖၧၩ့ၥၭနီၪ, လၧအဖိၬ",
			"16": "<sup>16</sup> အဖၧၩ့ၥၭဒၪဝ့ၫလီၩ့လီၩ့နီၪလီၫ.- တၭစံၭဝ့ၫဒၪ, ၦလၧ အလမၩလိၪဘၪဆၧလဂၩနီၪ, မွဲနကၠၪထဲၩ့နၥၭ နုၬလၧ ယီၩဘီၪ, ဒဲၦလၧအၥုၪ့လဖၭ အၥၭလဖၭဘၪလဂၩနီၪ,",
			"17": "<sup>17</sup> အဝ့ၫဒၪစံၭအဝ့ၫး- ထံၫၥံၪလၧဆၧအၪ့ဂူၪန့ဝ့ၫနီၪဆၧၫ့",
			"18": "<sup>18</sup> ဝ့ၫဒၪတၭ, ကိၪလၧအအီၪၥူၪနီၪ မွဲဆၧအွံၪလီၫ.- ၦလ ဂၩနီၪလၥ့ၪယၫဘၪ လၧၦအလၩၥံၪအီၪထီးနီၪ, ဒဲၦလၧ ၦမုၪနီၪကိၭန့ဝ့ၫလဖၪ အီၪလၧဖျႃဖၧၩ့လီၫ."
		},
		"10": {
			"1": "<sup>1</sup> ဖိၪခွၫအီၪလၧဆၧကိၪ့ၥ့ၪနီၪ ဒုၭၥုၪ့ထိၬၥၭထိၬအဖါ တၭးအ့ၪမွဲဖိၪခွၫအဂီၩ့နီၪ မွဲအမိအဆၧၥုၪ့အုၭၥၭအုၭ လီၫ.",
			"2": "<sup>2</sup> ဆၧအၧၩ့ဆၧၥၫ့အဆၧအီၪက့ၪကီၪ့နီၪ န့ကၩဆၧနး မံၩ့အ့ၬး အ့ၪမွဲဆၧတီၩဆၧလီၩ့ မၩဖီၩ့မၩဖျ့ၭ ဆၧၥံၫ လီၫ.",
			"3": "<sup>3</sup> ၦအတီၩအလီၩ့နီၪ ယဟိဝၩဒုၭၥၭဝံလၩ့ဘဲၩအ့ၬး အ့ၪမွဲၦလတီၩလလီၩ့ဘၪ အဆၧၥၭကွံၩနီၪ, ခွံၬၡိၭခွံၬ ဝ့ၫဒၪလီၫ.",
			"4": "<sup>4</sup> ၦလၧအမၩဆၧလၧအစူၪကၠႃၪ့အၥၭနီၪ ဘၪၡၪ့ဘၪ ယၬး အ့ၪမွဲၦအဎၭအစူၪနီၪ ဒုၭကဲၪထၪ့ဆၧလူဒိၪဎွ့ၩ ဒိၪလီၫ.",
			"5": "<sup>5</sup> ၦလၧအအၪ့ထုၫ့ကီၪ့ဆၧ လၧဆၧခိခၫနီၪ မွဲဖိၪခွၫအီၪ လၧဆၧကိၪ့ၥ့ၪး အ့ၪမွဲၦလၧအမံၫမၪဝ့ၫ လၧကူၭဆၧ အထီနီၪ, မွဲဖိၪခွၫလၧအဒုၭအီၪထၪ့ဆၧမ့ၬမဲလီၫ.",
			"6": "<sup>6</sup> ဆၧဆိၪဂ့ၩၥံၪ အီၪလၧၦတီၩၦလီၩ့ အခိၪဎွံၪလီၩ့း အ့ၪမွဲၦလတီၩလလီၩ့ဘၪအနိၭ မၩဘံၭခွံၬဆၧအၪ့ဂူၬ မၩဆီၪ့လီၫ.",
			"7": "<sup>7</sup> ၦအတီၩအလီၩ့အဆၧနၪ့ထၪ့ထဲၩ့နီၪ, ဘၪဆိၪဂ့ၩ ဝ့ၫး အ့ၪမွဲၦလတီၩလလီၩ့ဘၪအမံၩ့နီၪ, မိအုၪဝ့ၫဒၪ လီၫ.",
			"8": "<sup>8</sup> ၦလၧအၥၭအီၪ လၧဆၧကိၪ့ၥ့ၪနီၪ, မိထိးဆၧၫ့ဆၧ မၪလူၬၥံၪး အ့ၪမွဲၦအဂီၩ့ ချဲၩ့ကြၩ့ထမးဆၧနီၪ မိလၩ့ ထံၩဖါဝ့ၫဒၪလီၫ.",
			"9": "<sup>9</sup> ၦလၧအလ့ၩဆၧလီၩ့လီၩ့နီၪ, လ့ၩဝ့ၫဂုးဂုးခၧၫ့ခၧၫ့း အ့ၪမွဲၦလၧအမၩကဲၪ့အဖၧၩ့ၥၭၥံၪနီၪ, ဆၧမိဒုၭဖျီၪ ထၪ့ဝ့ၫဒၪလီၫ.",
			"10": "<sup>10</sup> ၦလၧအဖျၭအမ့ၬနီၪ ဒုၭၥုၪ့အုၭၥၭအုၭဆၧး ဒဲၦအ ဂီၩ့ချဲၩ့ကြၩ့ထမးဆၧနီၪ မိလၩ့ထံၩဖါဝ့ၫဒၪလီၫ.",
			"11": "<sup>11</sup> ၦတီၩၦလီၩ့အနိၭနီၪ မွဲထံၫမၧၫ့အဖၧၩ့တၭး အ့ၪမွဲ ၦလတီၩလလီၩ့ဘၪအနိၭ မၩဘံၭခွံၬဆၧအၪ့ဂူၬမၩ ဆီၪ့လီၫ.",
			"12": "<sup>12</sup> ဆၧမ့ၬလဲၩၥၭဂဲၫ့နီၪ ထိၪဂဲၩထၪ့ ဆၧအဲၪ့လိၬဆိၭ ချဲၩ့း အ့ၪမွဲဆၧအဲၪဆၧကွံၩ မၩဘံၭခွံၬ ဆၧမၪထီးအ လူၬလီၫ.",
			"13": "<sup>13</sup> ၦလၧအအီၪလၧအၥုၪ့ဖၭၥၭဖၭနီၪ, ၦဒၪန့ဆၧကိၪ့ ဘၪကိၪ့ၥ့ၪ လၧအနိၭဖျံၩလဖၪအလီၩ့း အ့ၪမွဲၦလၧအ ၥုၪ့ဖၭအၥၭဖၭလအီၪဘၪနီၪ, နိၪဖျ့ၪအီၪလၧအချိၫ့ခိၪ အဂးလီၫ.",
			"14": "<sup>14</sup> ၦကိၪ့ၥ့ၪလဖၪ အီၪက့ၪကီၪ့အဆၧၥ့ၪယၫး အ့ၪမွဲၦ အဂီၩ့အနိၭ လၩ့ဘူၭဆၧဂၭဂီၩ့ဂၭစၪလီၫ.",
			"15": "<sup>15</sup> ၦၥထံၫ အစူၪလးခၪ့ခိၪနီၪ, မွဲအဒိၩ့ဂုးခၧၫ့ဝ့ၫတၭး ၦၡၪ့ဖိၪယၬဖိၪအဆၧဂၭဂီၩ့နီၪ, မွဲအဆၧၡၪ့ဆၧယၬ လီၫ.",
			"16": "<sup>16</sup> ၦအတီၩအလီၩ့ အလံၩ့အလဲၫနီၪ, မွဲဆၧမၧၫ့တၭး ၦလတီၩလလီၩ့ဘၪ အဆၧအၪထၪ့နီၪ, မွဲဆၧဒဲၩဘၭ လီၫ.",
			"17": "<sup>17</sup> ၦလၧအထီးန့ဆၧၥီၪ့ဆၧၥၫ့နီၪ, မွဲဆၧမၧၫ့အဖၧၩ့ၥၭ တၭး အ့ၪမွဲၦလၧအစဲၪ့ဒၪခွံၬဆၧအၪ့ၥီၪ့နီၪ, ဒုၭဂၭဖျိၭ ဆၧလီၫ.",
			"18": "<sup>18</sup> ၦလၧအချႃၬဘံၭ ဆၧၥုၪ့ထၪ့ၥၭဂဲၫ့ လၧနိၭဖျံၩအ ဘျံၭအဘျၪနီၪ, ဒဲၦလၧအဒုၭဂၧၫ့ထၪ့ၥၩလၩ့ဆၧပရၧၫ့ အအၧၩ့နီၪ, မွဲၦအဂီၩ့လီၫ.",
			"19": "<sup>19</sup> လၧဆၧချဲၩ့အၪထံၪအကျၩနီၪ, ဆၧအမၪလၡၩဘၪ တၭး အ့ၪမွဲၦလၧအပဒၩ့ အနိၭဖျံၩၥံၪနီၪ, မွဲၦကိၪ့ၥ့ၪ လီၫ.",
			"20": "<sup>20</sup> ၦအတီၩအလီၩ့အဖျ့ၩနီၪ, မွဲစ့ၩလၧဆၧရွံန့ဝ့ၫး ၦ လတီၩလလီၩ့ဘၪအၥၭနီၪ, အဎွ့ၩၡၩခိၬလီၫ.",
			"21": "<sup>21</sup> ၦတီၩၦလီၩ့အနိၭဖျံၩၥံၪ ဒုၭအၪ့ၦအၪဂၩး အ့ၪမွဲၦ အဂီၩ့ၥံၫဝ့ၫ လၧအၥုၪ့လဖၭ အၥၭလဖၭဘၪ အကၠီၩ့ လီၫ.",
			"22": "<sup>22</sup> ယဟိဝၩ အဆၧဆိၪဂ့ၩနီၪ, ဒုၭအီၪထၪ့ဆၧလူဒိၪ ဎွ့ၩဒိၪတၭး အဝ့ၫဒၪအီၪက့ၪဎုၬ ဆၧၥုၪ့အုၭၥၭအုၭ လၧအနီၪဆ့အ့ၬ.",
			"23": "<sup>23</sup> ၦအဂီၩ့မုၬလၩအၥၭ လၧအမၩဆၧအၧၩ့နီၪတၭး အ့ၪမွဲၦၥုၪ့ဖၭၥၭဖၭလဂၩနီၪ, အီၪလၧဆၧကိၪ့ဘၪကိၪ့ ၥ့ၪလီၫ.",
			"24": "<sup>24</sup> ၦလတီၩလလီၩ့ဘၪအဆၧၥၭမဲၪနီၪ, မိဘၪအနၫ့ဆါ ဒၪဝ့ၫအလီၩ့တၭး အ့ၪမွဲၦတီၩၦလီၩ့ အဆၧဆိၫ့န့ဘၪ နီၪ, ယွၩမိဖ့ၪလၫ့ဝ့ၫဒၪလီၫ.",
			"25": "<sup>25</sup> ဘဲၫလံၩၥဝံၭလ့ၩဖီၩ့ခွံၬဝ့ၫအၥိၭနီၪ, ဘဲၫနီၪၥိၭၦလ တီၩလလီၩ့ဘၪ အီၪလၧၩ့အ့ၬး အ့ၪမွဲၦတီၩၦလီၩ့နီၪ, မွဲဆၧအခၪ့ထံၭ အဆိၩအကၠၪလီၫ.",
			"26": "<sup>26</sup> ဘဲၫဆၧဆဲၪ့ထံၫ လၧၥွၫၥံၪအဂးအၥိၭ, ဒဲဘဲၫမ့ၪခူၪ လၧမ့ၬၥၪၥံၪအဂးအၥိၭနီၪး ၦအကၠႃၪ့လဂၩနီၪ မွဲဘဲၫ နီၪၥိၭလၧ ၦလၧအအၪ့မၧၫ့ဝ့ၫအဂး ဆ့လီၫ.",
			"27": "<sup>27</sup> ဆၧၥၭမဲၪ ယဟိဝၩ မိဒုၭအၪထၪ့မုနံၩမုနၩလဖၪး အ့ၪမွဲၦလတီၩလလီၩ့ဘၪ အနံၪ့အလၩၥံၪ မိလၩ့ၡၩ လခီၫလီၫ.",
			"28": "<sup>28</sup> ၦအတီၩအလီၩ့အဆၧယိလါနီၪ, မွဲဆၧၥုၪ့ထိၬၥၭ ထိၬး အ့ၪမွဲၦလတီၩလလီၩ့ဘၪ အဆၧယိလါနီၪမိလၩ့ မါဝ့ၫဒၪလီၫ.",
			"29": "<sup>29</sup> ယဟိဝၩအဖၧၩ့ၥၭနီၪ, မွဲထိၬလၧၦတီၩၦလီၩ့အဂး, အ့ၪမွဲကဲၪဆၧဂၭဂီၩ့ လၧၦမၩအၧၩ့ဆၧအဂးလီၫ.",
			"30": "<sup>30</sup> အဆိၩဆိၩအကၠၪကၠၪနီၪ, ၦအတီၩအလီၩ့ၥုၭဘၪ အလးအ့ၬး အ့ၪမွဲၦလတီၩလလီၩ့ဘၪနီၪ မိအီၪဘၪလၧ ထံၫၥံၪခးၥံၪအဖၧၩ့အ့ၬ.",
			"31": "<sup>31</sup> ၦအတီၩအလီၩ့အနိၭ ဒုၭအီၪထၪ့ဆၧကိၪ့ဘၪကိၪ့ ၥ့ၪး အ့ၪမွဲဆၧအၪ့လီၫအဖျ့ၩနီၪ မိဘၪဆၧထ့ၭထၪ့ခွံၬ ဝ့ၫလီၫ.",
			"32": "<sup>32</sup> ၦအတီၩအလီၩ့အနိၭဖျံၩၥံၪ ၥ့ၪယၫဆၧလၧအဘၪ ဆၧအၥၭး အ့ၪမွဲၦလတီၩလလီၩ့ဘၪအနိၭ ချဲၩ့အၪ့ လီၫဆၧလီၫ."
		},
		"11": {
			"1": "<sup>1</sup> ခံၫ့အၪ့လီၫဆၧနီၪ, မွဲဆၧၥၭလိၪလၧယဟိဝၩအမ့ၬ ယၫး အ့ၪမွဲခံၫ့ၥၪအဘၪနီၪ, မွဲဆၧမုၬလၩလၧအမ့ၬယၫ လီၫ.",
			"2": "<sup>2</sup> ထီးၥၭထၪ့ထီၫအ့ၪဂဲၫနီၪ, ဆၧမ့ၬမဲဂဲၫဆ့း အ့ၪမွဲၦ လၧအဆၪ့လၩ့အၥၭနီၪ, အီၪလၧဆၧကိၪ့ဘၪကိၪ့ၥ့ၪ လီၫ.",
			"3": "<sup>3</sup> ၦအတီၩအလီၩ့အၥၭတီၩနီၪမိၥိၫ့ဝ့ၫဒၪတၭး အ့ၪမွဲ ၦမၩမၪဆၧလဖၪ အဆၧအၪ့လီၫဝ့ၫနီၪ, မိမၩဂၭဂီၩ့ အဝ့ၫၥံၪလီၫ.",
			"4": "<sup>4</sup> ထီးဆၧၥၭထၪ့အမုနံၩနီၪ, ဆၧလူဒိၪဎွ့ၩဒိၪန့ကၩ ဆၧနးမံၩ့အ့ၬး အ့ၪမွဲဆၧတီၩဆၧလီၩ့ မၩဖီၩ့မၩဖျ့ၭ ခွံၬလၧဆၧၥံၫလီၫ.",
			"5": "<sup>5</sup> ၦလၧၫ့လၧၫ့ဎွ့ၩဎွ့ၩ အဆၧတီၩဆၧလီၩ့နီၪ မိမၩပျၩ့ အဖၧၩ့ၥၭး အ့ၪမွဲၦလတီၩလလီၩ့ဘၪနီၪ မိလၩ့ထံၩဖါ လၧအဆၧအၧၩ့အကၠီၩ့လီၫ.",
			"6": "<sup>6</sup> ၦလၧအၥၭဆုးလီၩ့နီၪ အဆၧတီၩဆၧလီၩ့မိမၩဖီၩ့ ဖျ့ၭဝ့ၫ အ့ၪမွဲၦမၩမၪဆၧလဖၪနီၪ, မိဘၪဆၧဖီၪ့ထၬ ဝ့ၫလၧအနၫ့ဆါဒၪဝ့ၫ အဆၧအၧၩ့ဆၧၥၫ့အဖၧၩ့လီၫ.",
			"7": "<sup>7</sup> ထီးၦလတီၩလလီၩ့ဘၪအ့ၪၥံၫနီၪ ဆၧယိလါလၩ့မါ ဝ့ၫတၭး မွဲမၬ, ဆၧအၧၩ့ဆၧၥၫ့ အဆၧယိလါနီၪဂၭဂီၩ့ ဝ့ၫဒၪလီၫ.",
			"8": "<sup>8</sup> ၦတီၩၦလီၩ့ဘၪဆၧမၩဖီၩ့မၩဖျ့ၭယူၭ လၧဆၧခိဆၧ ဝီၩတၭး ၦလတီၩလလီၩ့ဘၪ ဂဲၫနုၬဘၪလၧအဝ့ၫဒၪ အလးလီၫ.",
			"9": "<sup>9</sup> ၦလၧအစံၪစၪဝ့ၫနီၪ လၧအနိၭအကၠီၩ့ မၩဂၭဂီၩ့အ ထံၩအၥိၭး အ့ၪမွဲလၧဆၧၥ့ၪယၫအကၠီၩ့နီၪ, ၦတီၩၦ လီၩ့ဘၪဆၧမၩဖီၩ့မၩဖျ့ၭ ဝ့ၫဒၪလီၫ.",
			"10": "<sup>10</sup> ထီးၦတီၩၦလီၩ့အ့ၪန့ဘၪဆၧဂ့ၩဆၧဘွၩနီၪ, ဒိၩ့ဖိၪ ၥံၪၥုၪ့ထိၬၥၭထိၬတၭး ထီးၦလတီၩလလီၩ့ဘၪနီၪအ့ၪ ထီၩ့လၧဆၧဂၭဂီၩ့တၭ, ဆၧကိၭၡၭထၪ့ ၥၭထိၬဝ့ၫ လီၫ.",
			"11": "<sup>11</sup> ဒိၩ့နီၪဘၪဆၧအီၪက့ၪထၪ့ထီၫဝ့ၫ လၧၦအၥၭဆုး လီၩ့ၥံၪအဆၧဆိၪဂ့ၩအကၠီၩ့း အ့ၪမွဲဘၪဆၧရိလၩ့ခွံၬ ဝ့ၫလၧၦအၧၩ့ၥံၪအနိၭအကၠီၩ့လီၫ.",
			"12": "<sup>12</sup> ၦလၧအမၩကြၩ့ထမး ၦအီၪလၧအနဲၩ့ထံၭနီၪ, အ ၥုၪ့ဖၭၥၭဖၭအီၪအ့ၬး အ့ၪမွဲၦလၧအၥ့ၪယၫဆၧနီၪအီၪ လၩ့မါပံၭလီၫ.",
			"13": "<sup>13</sup> ၦလၧအလ့ၩချဲၩ့ခဲၪဆၧနီၪ, မွဲၦဒုၭဖျီၪထၪ့ဆၧအီၪ ၥူၪၥံၪး အ့ၪမွဲၦအၥၭတီၩလဂၩနီၪ, အီၪက့ၪၥူၪခွံၬဆၧ လီၫ.",
			"14": "<sup>14</sup> ထီးဆၧၥိၫ့ဝ့ၫအ့ၪလအီၪဘၪနီၪ, ၦခမျၧးၥံၪလၩ့ထံၩ ဖါဝ့ၫး အ့ၪမွဲလၧၦဒုၭကိၪ့ဆၧအီၪ အၪဂၩအဖၧၩ့နီၪ, ဆၧဂုးဂုးခၧၫ့ခၧၫ့အီၪဝ့ၫဒၪလီၫ.",
			"15": "<sup>15</sup> ၦလၧအထိးအၥၭ လၧၦလခီၫဘၩ့မုးဖိၪ အဂးနီၪ, မိဘၪဆၧအၧၩ့တၭး အ့ၪမွဲၦလၧအၥၭဂဲၫ့ဆၧထိးအၥၭ လၧဂူၫဂၩအဂးနီၪ အီၪဂုးခၧၫ့ဝ့ၫဒၪလီၫ.",
			"16": "<sup>16</sup> ၦမုၪအဂ့ၩအဘၪနီၪ, န့ဘၪဆၧလၩဖၩ့, ဘဲၫၦဆီၪ့ အၪ့ဂူၬန့ဘၪဆၧအလူဒိၪဎွ့ၩဒိၪ အၥိၭနီၪလီၫ.",
			"17": "<sup>17</sup> ၦယၫ့ၥုၪ့ယၫ့ၥၭဆၧလဂၩနီၪ, မၩဆၧဂ့ၩလၧအၥၭ ဒၪဝ့ၫအဂး အ့ၪမွဲၦမၩခိမၩဝီၩဆၧနီၪ, မၩၡၪ့မၩနၭ လၩ့အဖံၭအယၪဒၪဝ့ၫလီၫ.",
			"18": "<sup>18</sup> ၦလတီၩလလီၩ့ဘၪနီၪ မၩဆၧလၧအလံၩ့အလဲၫ အၪ့လီၫဆၧအဂး, အ့ၪမွဲၦလၧအဎွံၪဆၧတီၩဆၧလီၩ့ နီၪ, မွဲလၧအလံၩ့အလဲၫ တီၩဝ့ၫအဂးလီၫ.",
			"19": "<sup>19</sup> ဘဲၫနီၪၥိၭဆၧတီၩဆၧလီၩ့ မွဲလၧဆၧမၧၫ့အဂးတၭး ၦလၧအဖိၬဆၧအၧၩ့အခဲၫ့နီၪ, မွဲလၧအဆၧၥံၫဒၪဝ့ၫ အဂးလီၫ.",
			"20": "<sup>20</sup> ၦလၧအၥၭကဲၪ့နီၪ, မွဲယဟိဝၩအဆၧၥၭလိၪးအ့ၪမွဲ ၦလၧအဖၧၩ့ၥၭဆုးလီၩ့ဝ့ၫနီၪ, မွဲဆၧဘၪအၥၭလီၫ.",
			"21": "<sup>21</sup> စူၪဖီၪ့ထၬလါနၫ့စူၪနီၪ, ၦအၧၩ့အဆၧဒဲၩဘၭဖီၩ့ဖျ့ၭ အ့ၬး အ့ၪမွဲၦအတီၩအလီၩ့အချံၫအၥၪ ဘၪဆၧဖီၩ့ဖျ့ၭ ဝ့ၫဒၪလီၫ.",
			"22": "<sup>22</sup> ၦမုၪအီၪလၧအဎံၫအလၩတၭ, အဆၧကိၪ့လအီၪ ဘၪနီၪ, မွဲဘဲၫဆၧခွၩ့ထီၫ့ လၧထိၭအနၫဖၧၩ့အၥိၭနီၪ လီၫ.",
			"23": "<sup>23</sup> ၦတီၩၦလီၩ့ အဆၧဆိၫ့န့ဘၪနီၪ, မွဲန့ၫဆၧအဂ့ၩး အ့ၪမွဲၦလတီၩလလီၩ့ဘၪ အဆၧယိလါနီၪ, မွဲဆၧၥၭ ထၪ့လီၫ.",
			"24": "<sup>24</sup> ၦလၧအဎွံၪဖၭဆၧလါနၫ့တၭ, အဆၧအၪထၪ့ထူထူ နီၪအီၪဝ့ၫး ဒဲၦလၧအဖီၪ့ထၬဆၧအၪလၨၪနီၪ, ဒုၭအီၪ ထၪ့ဆၧၡၪ့ဆၧနၭ, အီၪဝ့ၫဒၪဆ့လီၫ.",
			"25": "<sup>25</sup> ၦလၧအၥၭယီၫနီၪ မိန့ဘၪဆၧလူဒိၪဎွ့ၩဒိၪးဒဲၦလၧ အလူၫထံၫလဂၩနီၪ, မိဘၪဆၧလူၫအနၫ့ဆါဒၪဝ့ၫလၧ ထံၫဆ့လီၫ.",
			"26": "<sup>26</sup> ၦလၧအခိၭထၬ ဘုၪၥံၪဂူၫၥံၪနီၪ, ၦခမျၧးၥံၪမိဆိၪ အၧၩ့အဝ့ၫး အ့ၪမွဲၦလၧအအၪ့ဆၫခွံၬဝ့ၫနီၪ, ဆၧဆိၪ ဂ့ၩၥံၪလၩ့ဘၪ လၧအခိၪဎွံၪအလီၩ့လီၫ.",
			"27": "<sup>27</sup> ၦလၧအအၪ့ဎူၫအၪ့ဎၬ တၡါဆၧအဂ့ၩနီၪ, န့ဘၪဆၧ အခိးအတၩး အ့ၪမွဲၦလၧအအၪ့ဎူၫအၪ့ဎၬ ဆၧအၧၩ့ နီၪ,ဆၧအၧၩ့မိလၩ့ဘၪဝ့ၫ လၧအလီၩ့လီၫ.",
			"28": "<sup>28</sup> ၦလၧအဒိၭနဲၩ့အၥၭ လၧအဆၧလူဒိၪဎွ့ၩဒိၪနီၪ, အဝ့ၫဒၪမိလၩ့ထံၩဖါဝ့ၫတၭး အ့ၪမွဲၦတီၩ ၦလီၩ့ၥံၪမိ ဒိၭထၪ့ဘဲၫၥံၪ့လၪဒိၭထၪ့ဝ့ၫ အၥိၭနီၪလီၫ.",
			"29": "<sup>29</sup> ၦလၧအမၩခိမၩဝီၩအဂံၪ့ဒၪဝ့ၫနီၪ, မိန့ၥၫလံၩတၭး ၦအဂီၩ့မိကဲၪ ၦအၥၭကိၪ့ဆၧၥ့ၪအဎီးအၡၩလီၫ.",
			"30": "<sup>30</sup> ၦတီၩၦလီၩ့အဆၧၥၪနီၪ, မွဲၥံၪ့မၧၫ့း ဒဲၦလၧအကိၪ့ န့ဘၪၥၭၡီၩ့လဖၪနီၪ, အီၪလၧဆၧကိၪ့ၥ့ၪလီၫ.",
			"31": "<sup>31</sup> ယိခွါ, ၦတီၩၦလီၩ့ၥံၪ လၧဂၪ့ခိၪချိၫ့ယီၩ, မိန့ဘၪ ဆၧ ဖ့ၪထဲၩ့ဝ့ၫဒၪတၭး ၦလတီၩလလီၩ့ဘၪ ဒဲၦမၩမၪ ဆၧနီၪ, မိန့ဘၪဆၧဖ့ၪထဲၩ့ဝ့ၫအၪဒၪဆၧဒံၭလီၫ."
		},
		"12": {
			"1": "<sup>1</sup> ၦလၧအအဲၪဆၧၥီၪ့ဆၧၥၫ့နီၪ အဲၪဆၧၥ့ၪယၫး အ့ၪမွဲ ၦလၧအမ့ၬလဲၩၥၭဂဲၫ့ဆၧအၪ့ၥီၪ့ဝ့ၫနီၪ, မၩအၥၭဘဲၫ ဆၧဖိၪဆၧဎါအၥိၭ နီၪလီၫ.",
			"2": "<sup>2</sup> ၦအဂ့ၩၥံၪမိန့ဘၪ ယဟိဝၩအခိးအတၩး အ့ၪမွဲၦ လၧအကိၪ့ဆၧအၧၩ့လဂၩနီၪ, ယွၩမိစ့ၩရၫ့စၪဝ့ၫလ ခီၫလီၫ.",
			"3": "<sup>3</sup> ၦၡၩမိအီၪဂုးခၧၫ့ လၧဆၧလတီၩလလီၩ့ဘၪအကၠီၩ့ အ့ၬ, အ့ၪမွဲၦတီၩၦလီၩ့အဝံနီၪ မိဘၪၥုၭအၥၭအ့ၬ.",
			"4": "<sup>4</sup> ၦမုၪအဂ့ၩအဘၪနီၪ မွဲၥရဖူၩလၧအဝၩအဂးအ့ၪမွဲ ၦမုၪဒုၭမ့ၬမဲဆၧနီၪ မၩအၥၭဘဲၫဆၧအုၪဆၧကျၪလၧ အဎွံၪၥံၪအဖၧၩ့ အၥိၭလီၫ.",
			"5": "<sup>5</sup> ၦအတီၩအလီၩ့ အဆၧဆီၫ့မီၪ့ၥံၪ မွဲဆၧစ့ၩရၫ့တီၩ တၭး ၦလတီၩလလီၩ့ဘၪအဆၧၥိၫ့နီၪ, မွဲဆၧအၪ့လီၫ ဝ့ၫလီၫ.",
			"6": "<sup>6</sup> ၦလတီၩလလီၩ့ဘၪအဆၧချဲၩ့ၥံၪ မွဲဆၧအီၪခိၭၥူၪ လၧဆၧၥွံၪအဂး အ့ၪမွဲၦအတီၩအလီၩ့အနိၭမိမၩဖီၩ့ မၩဖျ့ၭဝ့ၫဒၪလီၫ.",
			"7": "<sup>7</sup> ၦလတီၩလလီၩ့ဘၪၥံၪ ဘၪဆၧဘိၭလၩ့ချႃၬဝ့ၫတၭ, အီၪလၧၩ့အ့ၬး အ့ၪမွဲၦတီၩၦလီၩ့အဂံၪ့နီၪ မိအီၪဂုးအီၪ ခၧၫ့ဝ့ၫဒၪလီၫ.",
			"8": "<sup>8</sup> ၦၡၩမိဘၪဆၧစံၭထၪ့အၪ့အူၭဝ့ၫ ဘဲၫအဆၧကိၪ့ၥ့ၪ အီၪဝ့ၫအၥိၭနီၪး အ့ၪမွဲၦလၧအၥၭကဲၪ့နီၪ, မိဘၪဆၧ အီၪက့ၪဝ့ၫဘဲၫဆၧၥၭလိၪ အၥိၭနီၪလီၫ.",
			"9": "<sup>9</sup> ၦလၧအမၩဆၧ လၧအနၫ့ဆါဒၪဝ့ၫ အဂးနီၪ, အ့ၪ ဘၪဆၧအီၪက့ၪဝ့ၫဘဲၫအလမွဲဘၪ ဆၧနးမံၩ့အၥိၭလါ နၫ့ဘိၩ ဂ့ၩနဲၪ့ဒံၭၦလၧအအီၪက့ၪ ဖိၫလိၫအၥၭတၭ, အကိၪလအီၪဘၪနီၪလီၫ.",
			"10": "<sup>10</sup> ၦတီၩၦလီၩ့ၥံၪယိဆီၫ့မီၪ့ဆၧ လၧအဆၧဖိၪဆၧဎါ မိမၧၫ့ဝ့ၫအဂး အ့ၪမွဲၦလတီၩလလီၩ့ဘၪ အဆၧယၫ့ ၥၭနီၪ, မွဲဆၧၥုၪ့နီၩ့ၥၭနီၩ့လီၫ.",
			"11": "<sup>11</sup> ၦလၧအမၩကၩ လၧအဂၪ့ခိၪဒၪဝ့ၫနီၪ, မိဘျဲၩအၪ့ ဘျဲၩအီၩဝ့ၫး အ့ၪမွဲၦလၧအလီၩ့ဖိၬ ဆၧပျီၩပျီၩအခဲၫ့ နီၪ, အၥုၪ့ဖၭအၥၭဖၭအီၪအ့ၬ.",
			"12": "<sup>12</sup> ၦလတီၩလလီၩ့ဘၪနီၪ မုၬလၩအၥၭလၧၦအၧၩ့အ ၡၬဖၧၩ့း အ့ၪမွဲၦတီၩၦလီၩ့အဝံ မိဒုၭမဲၪထၪ့ဆၧလီၫ.",
			"13": "<sup>13</sup> လၧနိၭဖျံၩအမၩမၪဆၧအဖၧၩ့နီၪ, မွဲဖျံၩခွၩ့အၧၩ့ တၭး အ့ၪမွဲၦတီၩၦလီၩ့ၥံၪ မိစဲၪ့ထၪ့ခွံၬ လၧဆၧခိဆၧ ဝီၩအဖၧၩ့လီၫ.",
			"14": "<sup>14</sup> ၦၡၩမိမံၫ့ၥုၪ့မံၫ့ၥၭလၧဆၧဂ့ၩ ဘၪဆဲၫ့လၧအနိၭအ ဆၧၥၪနီၪတၭး ဆၧမိဖ့ၪထဲၩ့ၦၡၩ ဘဲၫအစူၪမၩဝ့ၫအ ၥိၭနီၪလီၫ.",
			"15": "<sup>15</sup> ၦအဂီၩ့အဖၧၩ့ၥၭလီၩ့ လၧအမ့ၬၥၪဒၪဝ့ၫအဖၧၩ့း အ့ၪမွဲၦလၧအခိၭနၪဆၧ ဒုၭကိၪ့ဝ့ၫနီၪ အီၪလၧဆၧကိၪ့ ၥ့ၪလီၫ.",
			"16": "<sup>16</sup> ၦအဂီၩ့အဆၧၥၭထၪ့ဖျီၪထၪ့ဝ့ၫ လၧမုလနံၩဎးနီၪး အ့ၪမွဲၦၥ့ၪယၫ ထီးလၩ့အၥၭဂ့ၩ အီၪက့ၪၥူၪခွံၬဆၧ မၪလီၫ.",
			"17": "<sup>17</sup> ၦလၧအချဲၩ့ဆၧဘၪနီၪ ဒုၭနဲၪဖျီၪထၪ့ ဆၧမွဲဆၧတီၩး အ့ၪမွဲၦထိးအၥၭအဘျံၭအဘျၪနီၪ, ဒုၭနဲၪဆၧအၪ့လီၫ ဝ့ၫလီၫ.",
			"18": "<sup>18</sup> ၦလၧအချဲၩ့ဆၧ ဘဲၫနၭၥံၪဖၩ့ၥံၪဆ့ၭဆၧအၥိၭနီၪယ အီၪဝ့ၫး အ့ၪမွဲၦကိၪ့ၥ့ၪအဖျ့ၩနီၪ, မွဲဆၧမၩဘျၪထဲၩ့ ဆၧလီၫ.",
			"19": "<sup>19</sup> နိၭဖျံၩတီၩအီၪဂုးခၧၫ့အဆိၩအကၠၪး အ့ၪမွဲဖျ့ၩအ ဘျံၭအဘျၪနီၪ အီၪလဆိဖိၪလီၫ.",
			"20": "<sup>20</sup> ၦလၧအကိၪ့ထၪ့ဆၧအၧၩ့နီၪ အီၪလၧဆၧအၪ့လီၫ လၧအၥၭခံဖၧၩ့း အ့ၪမွဲၦလၧအဒုၭကိၪ့ ဆၧဘၪလိၬ အိၭလိၬနီၪ, အီၪလၧဆၧၥုၪ့ထိၬၥၭထိၬလီၫ.",
			"21": "<sup>21</sup> ဆၧအၧၩ့မိဘၪၦတီၩၦလီၩ့နီၪ နးမံၩ့အ့ၬး အ့ၪမွဲၦ အၧၩ့နီၪမိလၧၫ့ဎွ့ၩ လၧဆၧအၧၩ့ဆၧၥၫ့လီၫ.",
			"22": "<sup>22</sup> နိၭဖျံၩအဘျံၭအဘျၪ, မွဲဆၧၥၭလိၪ လၧယဟိဝၩအ မ့ၬယၫး အ့ၪမွဲၦလၧအမၩဆၧ တီၩတီၩလီၩ့လီၩ့နီၪ,မွဲ အဝ့ၫဒၪအဆၧၥုၪ့ထိၬၥၭထိၬလီၫ.",
			"23": "<sup>23</sup> ၦလၧအၥ့ၪယၫ ထီးလၩ့အၥၭဂ့ၩနီၪ, ချႃၬဘံၭဆၧ ၥ့ၪယၫး အ့ၪမွဲၦအဂီၩ့အၥၭနီၪ ဒုၭဂၧၫ့ထၪ့ ၥၩလၩ့ ဆၧအဂီၩ့နီၪလီၫ.",
			"24": "<sup>24</sup> ၦအဎၭအစူၪမိပၧၩ့ဆၧတၭး အ့ၪမွဲၦအကၠႃၪ့နီၪ,မိ ဘၪဖ့ၪလၫ့အခီၫ့လီၫ.",
			"25": "<sup>25</sup> ဆၧဎၧၫ့လၧၦၡၩအၥၭခံဖၧၩ့နီၪ, ဒုၭလၩ့ကူၭအၥၭး အ့ၪမွဲဆၧချဲၩ့ဂ့ၩလထံၪနီၪ ဒုၭၥုၪ့ထိၬၥၭထိၬဝ့ၫလီၫ.",
			"26": "<sup>26</sup> ၦအတီၩအလီၩ့မိၥိၫ့အထံၩအၥိၭး အ့ၪမွဲၦလတီၩ လလီၩ့ဘၪအဖၧၩ့ၥၭနီၪ မိဒုၭဂၭဖျိၭဆၧလီၫ.",
			"27": "<sup>27</sup> ၦအကၠႃၪ့လဂၩ မိအၪ့ကၪဘၪဆၧလၧ အခၭန့ဝ့ၫဆ့ အ့ၬး အ့ၪမွဲၦအဎၭအဆၧနီၪ မွဲဆၧလူဒိၪဎွ့ၩဒိၪလီၫ.",
			"28": "<sup>28</sup> ဆၧမၧၫ့အီၪလၧဆၧတီၩဆၧလီၩ့ အဖၧၩ့ၥၭဖၧၩ့နီၪ, မွဲဖၧၩ့ၥၭ ၦလ့ၩယုၩယါဝ့ၫတၭ, ဆၧၥံၫအီၪလၧအ ဖၧၩ့နးစီၪ့အ့ၬ."
		},
		"13": {
			"1": "<sup>1</sup> ဖိၪခွၫအီၪလၧဆၧကိၪ့ၥ့ၪနီၪ, မွဲၦလဂၩ လၧအဖါ အၪ့ၥီၪ့ဝ့ၫ, အ့ၪမွဲၦလၧအမၩကြၩ့ထမး ဆၧလဂၩနီၪ, ခိၭနၪဆၧအၪ့ၥီၪ့ဝ့ၫအ့ၬ.",
			"2": "<sup>2</sup> ၦၡၩမိအၪ့ဆၧအဂ့ၩ လၧအနိၭ အဆၧၥၪနီၪတၭး အ့ၪမွဲၦအၪ့လီၫဆၧအၥၭနီၪ, မိဘၪအၪ့ဆၧမၩဆီၪ့ဝ့ၫ အဆၧၥၪလီၫ.",
			"3": "<sup>3</sup> ၦလၧအပၧၩ့အနိၭလဂၩနီၪ, ယိထဲၩ့ခွါထဲၩ့အၥၭ မၧၫ့း အ့ၪမွဲၦလၧအအၩ့လဲထၪ့ အနိၭနီၪ, မိထီၩ့လၧ ဆၧဂၭဂီၩ့ဂၭစၪလီၫ.",
			"4": "<sup>4</sup> ၦအကၠႃၪ့နီၪ အၥၭဆိၫ့န့ဘၪဆၧလါနၫ့တၭ, အဆၧ အီၪနးမံၩ့အ့ၬး အ့ၪမွဲၦအဎၭနီၪ, မိထူၭထၪ့လၧၫ့ထၪ့ ဝ့ၫဒၪလီၫ.",
			"5": "<sup>5</sup> ဆၧချဲၩ့အဘျံၭအဘျၪနီၪ, ၦတီၩၦလီၩ့ မ့ၬလဲၩၥၭ ဂဲၫ့ဝ့ၫး အ့ၪမွဲၦလတီၩလလီၩ့ဘၪအဆၧမၩနီၪ, မွဲဆၧ ၥၭလိၪဒဲဒုၭမဲၦမ့ၬလီၫ.",
			"6": "<sup>6</sup> ဆၧတီၩဆၧလီၩ့မိခိၭထၬ ၦလၧအလမၩမၪဘၪဆၧ နီၪလၧဖၧၩ့ၥၭး အ့ၪမွဲဆၧအၧၩ့ဆၧၥၫ့ မိဘိၭထဲၩ့ဆၧ လၧဆၧဒဲၩဘၭဖၧၩ့လီၫ.",
			"7": "<sup>7</sup> ၦလၧအဒုၭထူၭထၪ့လၧၫ့ထၪ့လါနၫ့ အနၫ့ဆါတၭ, အဆၧလအီၪဘၪနးမံၩ့နီၪ, ၦအီၪဝ့ၫလနၩ့, ၦလၧအ မၩလၩ့ၡၪ့အၥၭလါနၫ့တၭ, အီၪလၧစူၪလးခၪ့ခိၪအၪ အၪလ့ၬနီၪ, အီၪဝ့ၫဆ့လီၫ.",
			"8": "<sup>8</sup> ဆၧဎွ့ၩန့ထဲၩ့ ၦၡၩအၥၭမၧၫ့နီၪ, မွဲအဆၧလူဒိၪ ဎွ့ၩဒိၪတၭး ၦၡၪ့ဖိၪယၬဖိၪနီၪ, နါဂၧၫ့ဆၧအၪ့ၥီၪ့ဝ့ၫ အ့ၬ.",
			"9": "<sup>9</sup> ၦတီၩၦလီၩ့အဆၧဖၩ့နီၪ, မွဲဆၧၥုၪ့ဎွံၫၥၭယီၫး အ့ၪ မွဲၦလတီၩလလီၩ့ဘၪအမ့ၪဒိၩ့နီၪ, မိလၩ့ဖံၬခွံၬဝ့ၫဒၪ လီၫ.",
			"10": "<sup>10</sup> ဆၧအဲၪ့လိၬဆိၭချဲၩ့နီၪ, ဂဲၫထၪ့န့ၫလၧဆၧအီၪက့ၪ ထၪ့ထီၫအၥၭး အ့ၪမွဲၦလၧအဒိၭန့ဆၧဒုၭကိၪ့ဝ့ၫနီၪ, အီၪလၧဆၧကိၪ့ဘၪကိၪ့ၥ့ၪလီၫ.",
			"11": "<sup>11</sup> ဆၧလူဒိၪဎွ့ၩဒိၪနီၪ လၩ့မါဝ့ၫချဲၫ့နဲၪ့ဆၧအွံၩထၪ့နီၪ တၭး အ့ၪမွဲၦလၧအအီၪက့ၪကီၪ့ဆၧလၧအစူၪဖၧၩ့နီၪ, မိဒုၭအၪထၪ့ဆၧလီၫ.",
			"12": "<sup>12</sup> ဆၧယိလါလၧအၥုၪ့အၥၭနီၪ, မၩဆၫၦအၥၭး အ့ၪ မွဲဆၧလၧၦၡၩဆိၫ့န့ဘၪနီၪ, ထီးအ့ၪန့ဘၪယူၭမွဲဆၧ မၧၫ့အၥံၪ့လထံၭလီၫ.",
			"13": "<sup>13</sup> ၦလၧအမၩကြၩ့ထမးဆၧအလူနီၪ, မိဘၪဆၧ ဂၭဂီၩ့ဝ့ၫး အ့ၪမွဲၦလၧအၥၭမဲၪဆၧမၪလူၬနီၪ, မိအီၪမုၬ အီၪဎၩ့ဝ့ၫလီၫ.",
			"14": "<sup>14</sup> ၦကိၪ့ၥ့ၪအဆၧၥီၪ့ဆၧၥၫ့နီၪ, မွဲဆၧမၧၫ့အထံၫထၪ့ ဖျိၭ, ဘဲၫၥိၭအမိဘိၭကၠၪခွံၬ လၧဆၧၥံၫအဖျံၩခွၩ့ ၥံၪလီၫ.",
			"15": "<sup>15</sup> ဆၧၥုၪ့ဖၭၥၭဖၭအဂ့ၩနီၪ ဒုၭအီၪထၪ့ဆၧအခိးအ တၩး အ့ၪမွဲၦမၩမၪဆၧအဖၧၩ့ၥၭနီၪ, ကၪမၬလီၫ.",
			"16": "<sup>16</sup> ကယဲၦလဂၩလါလါ လၧအၥ့ၪယၫ ထီးလၩ့အၥၭ ဂ့ၩနီၪ, မၩဆၧလၧဆၧၥ့ၪယၫအကၠီၩ့, အ့ၪမွဲၦအဂီၩ့ ဒုၭဖျီၪထၪ့အဆၧဂီၩ့နီၪလီၫ.",
			"17": "<sup>17</sup> အၥီၫ့လတီၩလလီၩ့ဘၪနီၪ, လၩ့ဘၪလၧဆၧမၩဂၭ ဂီၩ့အဖၧၩ့း အ့ၪမွဲၦဘၪဆၧအၪ့မၧၫ့ဝ့ၫ အီၪလၧအလူ တီၩနီၪ,မွဲဆၧမၩဘျၪထဲၩ့ဆၧလီၫ.",
			"18": "<sup>18</sup> ၦလၧအခွံၬၡိၭခွံၬဆၧအၪ့ၥီၪ့ဝ့ၫနီၪ, မိဘၪၡၪ့ဘၪ ယၬဒဲဆၧမ့ၬမဲး အ့ၪမွဲၦလၧအဒိၭန့ဆၧအၪ့ၥီၪ့နီၪ, မိန့ ဘၪဆၧလၩဆၧဖၩ့လီၫ.",
			"19": "<sup>19</sup> ဆၧလၧၦဆိၫ့န့ဘၪနီၪ, ထီးအန့ဘၪဝ့ၫမၩမုၬအၥၭး အ့ၪမွဲၦအဂီၩ့စဲၪ့ဒၪဆၧအၧၩ့နီၪ, မွဲဆၧၥၭလိၪလၧအ မ့ၬယၫလီၫ.",
			"20": "<sup>20</sup> ၦလၧအလ့ၩဆၧလၧ ၦကိၪ့ၥ့ၪအၥိၭနီၪ, မိန့ဘၪဆၧ ကိၪ့း အ့ၪမွဲၦအဂီၩ့အထံၩအၥိၭ မိဘၪဆၧအၧၩ့လီၫ.",
			"21": "<sup>21</sup> ဆၧအၧၩ့ဆၧၥၫ့မိလီၩ့ဆီး ၦဆၧဒဲၩဘၭဖိၪး အ့ၪမွဲ ဆၧမိဖ့ၪလၫ့ဆၧအဂ့ၩ လၧၦတီၩၦလီၩ့ၥံၪနီၪလီၫ.",
			"22": "<sup>22</sup> ၦအဂ့ၩၥံၪ မိဒုၭအီၪလၩ့ထးဆၧန့ၥၫ လၧအဖိၪလ ဖၪအဖိၪၥံၪအဂး အ့ၪမွဲဆၧအီၪက့ၪကီၪ့ၦဆၧဒဲၩဘၭ ဖိၪအဆၧလူဒိၪဎွ့ၩဒိၪ လၧၦတီၩၦလီၩ့အဂးလီၫ.",
			"23": "<sup>23</sup> လၧၦၡၪ့ဖိၪယၬဖိၪ ထဲၫဆၧအကၠီၩ့နီၪ, ဆၧအၪ့အီၪ ထၪ့ဝ့ၫအၪအၪလ့ၬး အ့ၪမွဲၦလၧအဘၪဆၧဂၭဂီၩ့ဂၭ စၪလၧဆၧလတိၪ့န့ဘၪနီၪ အီၪဝ့ၫလီၫ.",
			"24": "<sup>24</sup> ၦလၧအလမၩဘၪ လၧနိၪဖျ့ၪနီၪ, မ့ၬလဲၩအဖိၪခွၫ အ့ၪမွဲၦလၧအအဲၪဝ့ၫနီၪ, အၪ့ၥီၪ့ဝ့ၫထီးအဆၧၫ့အထီ ဘၪလီၫ.",
			"25": "<sup>25</sup> ၦတီၩၦလီၩ့အၪ့ဝ့ၫ ထီးအဘျဲၩအၪ့အၥၭး အ့ၪမွဲၦ လတီၩလလီၩ့ဘၪအဂူၭဖိၫ့ လၩ့အိၩဝ့ၫလီၫ."
		},
		"14": {
			"1": "<sup>1</sup> ကယဲၦမုၪကိၪ့ဆၧၥ့ၪလဂၩလါလါနီၪ, မၩထၪ့အ ဂံၪ့း အ့ၪမွဲၦမုၪအဂီၩ့နီၪ ရိလၩ့ခွံၬဝ့ၫ လၧအစူၪဒၪဝ့ၫ လီၫ.",
			"2": "<sup>2</sup> ၦလၧအလ့ၩဆၧလၧဆၧဆုးလီၩ့အဖၧၩ့ၥၭနီၪ, မွဲၦ လၧအၥၭမဲၪယဟိဝၩး အ့ၪမွဲၦလၧအဘိၭကဲၪ့အဖၧၩ့ ၥၭလဖၪနီၪ, ဒူၩယၪ့အဝ့ၫဒၪအ့ၬ.",
			"3": "<sup>3</sup> လၧၦအဂီၩ့အနိၭဖၧၩ့နီၪ, ဆၧအီၪက့ၪထၪ့ထီၫအ ၥၭအနိၪထးအီၪဝ့ၫး အ့ၪမွဲၦကိၪ့ဆၧၥ့ၪအနိၭဖျံၩနီၪ, ယိထဲၩ့ခွါထဲၩ့အနၫ့ဆါၥံၪလီၫ.",
			"4": "<sup>4</sup> ထီးဒၪအလး လၧချီဖၫလအီၪဘၪနီၪ, တၩ့ခူၬအီၪ ခီၫဝ့ၫး အ့ၪမွဲလၧချီဖၫအဂဲးအဘၭအကၠီၩ့ဆၧအၪထၪ့ ဝ့ၫအၪအၪလ့ၬလီၫ.",
			"5": "<sup>5</sup> ၦထိးအၥၭအလူတီၩနီၪ, မိချဲၩ့ဘျံၭချဲၩ့ဘျၪအ့ၬး အ့ၪမွဲၦလၧအၥၪထၪ့ဆၧလတီၩဘၪနီၪ, မွဲၦထိးအၥၭ အဘျံၭအဘျၪလီၫ.",
			"6": "<sup>6</sup> ၦဒုၪဒွ့ၪဆၧလဂၩနီၪ, အၪ့ဎူၫအၪ့ဎၬလါနၫ့ဆၧကိၪ့ ၥ့ၪတၭ, ဒၪဘၪဝ့ၫအ့ၬး အ့ၪမွဲလၧၦၥုၪ့ဖၭၥၭဖၭအဂး နီၪ, ဆၧၥ့ၪယၫအီၪယီၫလီၫ.",
			"7": "<sup>7</sup> ထီးနအ့ၪဒၪဘၪလၧၦအဂီၩ့လဂၩ လအီၪဘၪလၧ ဆၧၥ့ၪယၫအနိၭဖျံၩနီၪ, စဲၪ့ထၪ့ခွံၬလၧအအီၪဘီၪ.",
			"8": "<sup>8</sup> ၦၥ့ၪယၫ ထီးလၩ့အၥၭဂ့ၩ အဆၧကိၪ့ဘၪ ကိၪ့ၥ့ၪ နီၪ, မွဲလၧအနၪၥ့ၪအဖၧၩ့ၥၭအဂဲးအကၠီၪ့း အ့ၪမွဲၦအ ဂီၩ့အဆၧဂီၩ့နီၪ, မွဲဆၧအၪ့လီၫလီၫ.",
			"9": "<sup>9</sup> ၦအဂီၩ့ၥံၪမၩကြၩ့ထမးဆၧလၧ ဆၧဒဲၩဘၭအကၠီၩ့း အ့ၪမွဲလၧၦမၩဆုးလီၩ့အၥၭၥံၪအကျၩနီၪ, ဆၧအခိး အတၩအီၪဝ့ၫလီၫ.",
			"10": "<sup>10</sup> ၦၡၩအၥၭနီၪၥ့ၪယၫအဆၧခၪဒၪဝ့ၫတၭး ၦလခီၫဘၩ့ မုးဖိၪနီၪ, မၩထံၬထၬအဝ့ၫလၧအဆၧၥၭထိၬဆ့အ့ၬ.",
			"11": "<sup>11</sup> ၦအၧၩ့အဂံၪ့နီၪ မိဘၪဆၧဂၭဂီၩ့း အ့ၪမွဲၦအတီၩ အီၪဝ့ၫအလးနီၪ, မိဘီၪထၪ့ယီၫထၪ့ဝ့ၫဒၪလီၫ.",
			"12": "<sup>12</sup> ဖၧၩ့ၥၭလီၩ့ဝ့ၫ လၧၦၡၩအမ့ၬယၫလါနၫ့တၭ, အ ထုၬနီၪ, မွဲဆၧၥံၫအဖၧၩ့ၥၭလီၫ.",
			"13": "<sup>13</sup> လၧၦနံဝ့ၫအဘိၩ့ဘၭဒၪလ့ၬနီၪး ၥၭဘၪဆၧၥုၪ့အုၭ ၥၭအုၭလခီၫ, ဒဲလၧဆၧမၩမုၬ မၩလၩအၥၭနီၪ, အ ထုၬမွဲဆၧၥၭဎၧၫ့လီၫ.",
			"14": "<sup>14</sup> ၦလၧအဂုၩ့ထဲၩ့အၥၭလဂၩနီၪ, မိလၧၫ့ထၪ့ဎွ့ၩထၪ့ လၧအဖၧၩ့ၥၭဒၪဝ့ၫး ဒဲၦအဂ့ၩလဂၩနီၪ, မိမံၫ့ၥုၪ့မံၫ့ ၥၭလၧအနၫ့ဆါဒၪဝ့ၫ အဖၧၩ့ဆ့လီၫ.",
			"15": "<sup>15</sup> ၦလၧအလမၩလိၪဘၪဆၧနီၪ, နဲၩဆၧကိၭအမံၩ့ဒ့ၭး အ့ၪမွဲၦၥ့ၪယၫထီးလၩ့အၥၭဂ့ၩလဂၩနီၪ, ယိဆီၫ့မီၪ့ အခၫထၪ့ဆၧအဂဲးအကၠီၪ့လီၫ.",
			"16": "<sup>16</sup> ၦကိၪ့ဆၧၥ့ၪလဂၩၥၭမဲၪဆၧတၭ, ကၠၪခွံၬအၥၭလၧ ဆၧအၧၩ့း အ့ၪမွဲၦအဂီၩ့ မၩဖိၫအၥၭတၭ, မၩဒူၩအ ၥၭလီၫ.",
			"17": "<sup>17</sup> ၦလၧအၥၭထၪ့ချဲၫ့နီၪ မၩဆၧဘဲၫၦအဂီၩ့အၥိၭး အ့ၪမွဲၦလၧအကိၪ့ ဆၧအၧၩ့လဖၪနီၪ ဘၪဆၧမ့ၬလဲၩ ၥၭဂဲၫ့ဝ့ၫလီၫ.",
			"18": "<sup>18</sup> ၦလၧအလမၩလိၪဘၪဆၧနီၪ, န့ၥၫဆၧအဂီၩ့း အ့ၪ မွဲၦၥ့ၪယၫထီးလၩ့အၥၭဂ့ၩနီၪ, ချႃၬဘၪဆၧၥ့ၪယၫ အၥရဖူၩလီၫ.",
			"19": "<sup>19</sup> ၦအအၧၩ့ၥံၪၡီၫ့လၩ့အၥၭ လၧၦအဂ့ၩအမ့ၬယၫး ဒဲၦလတီၩလလီၩ့ဘၪ လၧၦတီၩၦလီၩ့အတရၫ့ထံၭနီၪ လီၫ.",
			"20": "<sup>20</sup> ၦၡၪ့ဖိၪယၬဖိၪနီၪဘၪဆၧမ့ၬလဲၩဝ့ၫ လၧအထံၩအ ၥိၭဒၪလ့ၬး အ့ၪမွဲၦလၧအအဲၪၦၥထံၫၥံၪ, အီၪဝ့ၫအၪ ဂၩလီၫ.",
			"21": "<sup>21</sup> ၦလၧအမၩကြၩ့ထမးအထံၩအၥိၭနီၪ မၩမၪဆၧး အ့ၪမွဲၦလၧအယၫ့ၥၭၦၡၪ့ဖိၪယၬဖိၪနီၪ, အီၪရှူၪအီၪ မုၬဝ့ၫလီၫ.",
			"22": "<sup>22</sup> ၦလၧအကိၪ့ဆၧအၧၩ့ဆၧၥၫ့နီၪ, မၩမၪဘၪဆၧ, မွဲ အ့ၬဧၪး အ့ၪမွဲၦကိၪ့ဆၧဂ့ၩနီၪ, အီၪလၧဆၧအခိးအ တၩဒဲဆၧမွဲဆၧတီၩလီၫ.",
			"23": "<sup>23</sup> လၧဆၧဖံၭဆၧမၩ ထီးအလူၬအဖၧၩ့နီၪ, အီၪလၧ ဆၧန့ကၩဝ့ၫတၭး အ့ၪမွဲနိၭဖျံၩအဆၧချဲၩ့လဖၪနီၪဘၪ ဆဲၫ့န့ၫဆၧၡၪ့ဆၧယၬလီၫ.",
			"24": "<sup>24</sup> ၦကိၪ့ၥ့ၪအၥရဖူၩနီၪ, မွဲအဝ့ၫၥံၪအဆၧလူဒိၪဎွ့ၩ ဒိၪး အ့ၪမွဲၦအဂီၩ့အဆၧဂီၩ့နီၪ, မွဲန့ၫဆၧဂီၩ့လီၫ.",
			"25": "<sup>25</sup> ၦထိးအၥၭလၧအလူတီၩနီၪ, မၩဖီၩ့မၩဖျ့ၭၦၥၭမၧၫ့ လဖၪး အ့ၪမွဲၦအၪ့လီၫဆၧနီၪ ချဲၩ့ဘျံၭချဲၩ့ဘျၪဆၧလီၫ.",
			"26": "<sup>26</sup> ဆၧဒိၭနဲၩ့အၥၭအလးဂုးခၧၫ့ အီၪဝ့ၫလၧဆၧၥၭမဲၪ ယဟိဝၩအဖၧၩ့တၭး အဖိၪအလံၩၥံၪ အီၪလၧဆၧဖ လ့ၬအၥၭအလးလီၫ.",
			"27": "<sup>27</sup> ဆၧၥၭမဲၪယဟိဝၩနီၪ, မွဲဆၧမၧၫ့အထံၫဖၧၩ့, ဘဲၫ ၥိၭၦမိဂၭဎ့ၭခွံၬဆၧၥံၫအဖျံၩခွၩ့နီၪလီၫ.",
			"28": "<sup>28</sup> လၧၦခမျၧးၥံၪအီၪအၪအၪလ့ၬအကၠီၩ့နီၪ, စဎွၩလ ဖၪအီၪလၧအလၩအဖၩ့တၭး လၧၦခမျၧးလအီၪဘၪ အကၠီၩ့နီၪ, ၦဒိၪဖၭဒိၪၥံၪဘၪဆၧဂၭဂီၩ့ဝ့ၫလီၫ.",
			"29": "<sup>29</sup> ၦလၧအၥၭထၪ့ကၪလဂၩနီၪ အီၪလၧအၥုၪ့ဖၭအ ၥၭဖၭဖၭဒိၪး အ့ၪမွဲၦလဂၩ လၧအၥၭထၪ့ချဲၫ့နီၪဒုၭ ဖျီၪထၪ့ဆၧအဂီၩ့လီၫ.",
			"30": "<sup>30</sup> ၦမိၡါအဆၧမၧၫ့နီၪ, မွဲလၧအၥၭအီၪဂုးဖုးတၭး အ့ၪမွဲဆၧၥၭခ့ၬ မွဲဆၧအုၪဆၧကျၪလၧဎွံၪၥံၪအကျၩ နီၪလီၫ.",
			"31": "<sup>31</sup> ၦလၧအမၩအၧၩ့ၦၡၪ့ဖိၪယၬဖိၪနီၪ, မၩကြၩ့ထမး ၦလၧအတဲၩ့လၩ့အဝ့ၫလဂၩး အ့ၪမွဲၦလၧအဒူၩယၪ့ အဝ့ၫနီၪ, မွဲၦယၫ့ၥုၪ့ယၫ့ၥၭ ၦၡၪ့ဖိၪယၬဖိၪၥံၪလီၫ.",
			"32": "<sup>32</sup> ၦလတီၩလလီၩ့ဘၪအီၪဝ့ၫ လၧအဆၧအၧၩ့ဆၧၥၫ့ အဖၧၩ့နီၪ, ဘၪဆၧနၫ့ထၪ့ခွံၬဝ့ၫး အ့ၪမွဲၦအတီၩအ လီၩ့လၧအဆၧၥံၫအခၫနီၪ အီၪလၧဆၧဒိၭနဲၩ့အၥၭအ လးလီၫ.",
			"33": "<sup>33</sup> ဆၧကိၪ့ဘၪကိၪ့ၥ့ၪအီၪဂုးခၧၫ့ လၧၦၥုၪ့ဖၭၥၭဖၭအ ၥၭခံဖၧၩ့း အ့ၪမွဲလၧၦအဂီၩ့အဖၧၩ့နီၪ, ဆၧဘၪနဲၪလိၪ ဝ့ၫလီၫ.",
			"34": "<sup>34</sup> ဆၧတီၩဆၧလီၩ့နီၪ ဒုၭထီၫထၪ့ၦခမျၧးၥံၪး အ့ၪမွဲ ဆၧဒဲၩဘၭနီၪ, မွဲဆၧဒုၪဒွ့ၪလၧၦဆၨၩၥံၪအဂးလီၫ.",
			"35": "<sup>35</sup> အဎီးအၡၩ လၧအအီၪလၧဆၧကိၪ့ၥ့ၪနီၪ, န့ဘၪစ ဎွၩအခိးအတၩး အ့ၪမွဲၦအအၧၩ့လဂၩနီၪ ထိးဘၪအ ဆၧၥၭထၪ့လီၫ."
		},
		"15": {
			"1": "<sup>1</sup> ဆၧချဲၩ့ဆၧၫ့ဖူၬလူၭနီၪဘိၭကၠၪခွံၬဆၧၥၭထၪ့း အ့ၪ မွဲဆၧချဲၩ့ဆီၪ့နီၪ ထိၪဂဲၩဆၧၥၭထၪ့လီၫ.",
			"2": "<sup>2</sup> ၦကိၪ့ဆၧၥ့ၪအဖျ့ၩနီၪလီၩဖျီၪထၪ့ ဆၧၥ့ၪယၫအဂ့ၩ အဘၪး အ့ၪမွဲၦအဂီၩ့အနိၭနီၪ လူၫလၩ့ခွံၬဆၧအဂီၩ့ လီၫ.",
			"3": "<sup>3</sup> ယဟိဝၩအမ့ၬၥၪၥံၪ အီၪလၧအလးကိၭစီၪ့ဒ့ၭတၭ, ယိဝ့ၫဆၧအၧၩ့ဒဲဆၧဂ့ၩလီၫ.",
			"4": "<sup>4</sup> ၦအဖျ့ၩလၧအမၩမုၬထၪ့ဆၧနီၪ မွဲဆၧမၧၫ့အၥံၪ့လ ထံၭး အ့ၪမွဲဆၧအၪ့လီၫအီၪဝ့ၫ လၧအဖၧၩ့နီၪ မွဲဖၧၩ့ လးလၧၥၭဖၧၩ့လီၫ.",
			"5": "<sup>5</sup> ၦအဂီၩ့မၩကြၩ့ထမး အဖါအဆၧအၪ့ၥီၪ့; အ့ၪမွဲၦ လၧအထိးဆၧၫ့ဆၧအၪ့ၥီၪ့နီၪ, ကိၪ့ဆၧၥ့ၪလီၫ.",
			"6": "<sup>6</sup> လၧၦတီၩၦလီၩ့အဂံၪ့ဖၧၩ့နီၪ, ဆၧလူဒိၪဎွ့ၩဒိၪအီၪ ဝ့ၫအၪအၪလ့ၬ, အ့ၪမွဲလၧၦလတီၩလလီၩ့ဘၪအဆၧ အၪထၪ့အဖၧၩ့နီၪ, ဆၧခိဆၧဝီၩအီၪဝ့ၫလီၫ.",
			"7": "<sup>7</sup> ၦကိၪ့ၥ့ၪအနိၭဖျံၩၥံၪဎွံၪဆၧၥ့ၪယၫတၭး ၦအဂီၩ့ၥံၪ အၥၭမွဲဘဲၫနီၪၥိၭအ့ၬၬ",
			"8": "<sup>8</sup> ၦလတီၩလလီၩ့ဘၪအဆၧလုနီၪ, မွဲဆၧၥၭလိၪလၧ ယဟိဝၩအမ့ၬယၫး အ့ၪမွဲၦအၥၭဆုးလီၩ့ အဆၧဘၩ ဆိၪဖၪနီၪ မွဲဆၧဘၪအၥၭလီၫ.",
			"9": "<sup>9</sup> ၦလတီၩလလီၩ့ဘၪအဖၧၩ့ၥၭနီၪ, မွဲဆၧၥၭလိၪလၧ ယဟိဝၩအမ့ၬယၫး အ့ၪမွဲၦလၧအလီၩ့ ဆၧတီၩဆၧ လီၩ့အဖၧၩ့ၥၭလဂၩနီၪ, အဲၪဝ့ၫလီၫ.",
			"10": "<sup>10</sup> ၦလၧအစဲၪ့ဒၪခွံၬဖၧၩ့ၥၭနီၪ အီၪလၧဆၧအၪ့ၥီၪ့ဝ့ၫ နၭမၬတၭ, ၦလၧအၥၭဂဲၫ့ဆၧအၪ့ၥီၪ့နီၪ မိၥံၫဝ့ၫဒၪလီၫ.",
			"11": "<sup>11</sup> ဖျႃဖၧၩ့ဒဲဆၧဂၭဂီၩ့အလး အီၪလၧယဟိဝၩအမ့ၬ ယၫတၭး ၦၡၩအဖိၪၥံၪအၥၭလဖၪနီၪ မွဲအအၪနဲၪ့ဒံၭ အနီၪဆံၭအၪလဲၪၬ",
			"12": "<sup>12</sup> ၦဒုၪဒွ့ၪဆၧနီၪ အဲၪၦလၧအအၪ့ၥီၪ့အဝ့ၫဆ့အ့ၬး တၭမိလ့ၩဘၪအၥၭ လၧၦကိၪ့ဆၧၥ့ၪအအီၪနီၪနးဆံၭ အ့ၬ.",
			"13": "<sup>13</sup> ၦၥုၪ့ထိၬၥၭထိၬနီၪ မၩဎွံၫထၪ့ၦမ့ၬး အ့ၪမွဲလၧဆၧ ၥုၪ့အုၭၥၭအုၭအကၠီၩ့နီၪ, မၩၥုၪ့ခါၥၭလၩ့ၦၥၭလီၫ.",
			"14": "<sup>14</sup> ၦၥုၪ့ဖၭၥၭဖၭအၪ့ဎူၫအၪ့ဎၬ ဆၧၥ့ၪယၫတၭး အ့ၪမွဲၦ အဂီၩ့အနိၭနီၪ အၪ့ဝ့ၫလၧဆၧအဂီၩ့လီၫ.",
			"15": "<sup>15</sup> ၦၡၪ့ဖိၪယၬဖိၪအမုနံၩမုနၩၥံၪ ထီးအလူၬနီၪမွဲဆၧ အၧၩ့း အ့ၪမွဲၦအၥၭဎွံၫနီၪ မွဲဆၧဘိၪ့ထံၪဎးဘီၩ့ဎးလီၫ.",
			"16": "<sup>16</sup> ဆၧလဆံၭဖိၪ အီၪဎုၬလၧဆၧၥၭမဲၪယဟိဝၩနီၪ,မွဲ ဆၧဂ့ၩနဲၪ့ဆၧလူဒိၪဎွ့ၩဒိၪဖၭဒိၪ လၧအအီၪဎုၬလၧ ဆၧခိဆၧဝီၩလီၫ.",
			"17": "<sup>17</sup> ၦအီၪလၧဆၧအဲၪ အၪ့ဘၪန့ၫဆၧဒိၭဆၧလၪၥံၪနီၪ, မွဲအဂ့ၩနဲၪ့ ၦအီၪလၧဆၧၥုၪ့ထၪ့ၥၭဂဲၫ့ အၪ့ဘၪချီဖၫ ဘီၪ့လဒုၩလီၫ.",
			"18": "<sup>18</sup> ၦလၧအၥၭထၪ့ယီၫလဂၩနီၪ ထိၪဂဲၩဆၧအဲၪ့လိၬ ဆိၭချဲၩ့ အ့ၪမွဲၦလၧအၥၭထၪ့ကၪလဂၩ ဒုၭလၩ့ဖံၬခွံၬ ဆၧအဲၪ့လိၬဆိၭချဲၩ့လီၫ.",
			"19": "<sup>19</sup> ၦကၠႃၪ့အဖၧၩ့ၥၭနီၪ မၩအၥၭဘဲၫဆၧဆူၪထနါ,အ့ၪ မွဲၦအၥၭဆုးလီၩ့အဖၧၩ့ၥၭနီၪ မွဲဖၧၩ့ၥၭမုလီၫ.",
			"20": "<sup>20</sup> ဖိၪခွၫအီၪလၧဆၧကိၪ့ၥ့ၪနီၪ ဒုၭၥုၪ့ထိၬၥၭထိၬအဖါ, အ့ၪမွဲၦအဂီၩ့လဂၩ မၩကြၩ့ထမးအမိလီၫ.",
			"21": "<sup>21</sup> ဆၧအဂီၩ့နီၪမွဲဆၧၥုၪ့ဎွံၫၥၭယီၫ လၧၦလၧအဆၧ ကိၪ့ဘၪကိၪ့ၥ့ၪလအီၪဘၪအမ့ၬယၫး အ့ၪမွဲၦအၥုၪ့ဖၭ ၥၭဖၭလဂၩ လ့ၩဝ့ၫလီၩ့ထ့ၬဒ့ၭလီၫ.",
			"22": "<sup>22</sup> ဆၧကိၪ့လိၬအၥၭ အ့ၪလအီၪဘၪတၭ, ဆၧလၧၦ ကၩ့ကၩဝဲၩဝ့ၫနီၪ, ကဲၪထၪ့ဝ့ၫဒၪအ့ၬး အ့ၪမွဲလၧၦဒုၭ ကိၪ့ဆၧအၪဂၩအကၠီၩ့, ဆၧလဖၪနီၪမိကဲၪထၪ့ဝ့ၫလီၫ.",
			"23": "<sup>23</sup> ၦလဂၩအီၪလၧဆၧၥုၪ့ဎွံၫၥၭယီၫ လၧအချဲၩ့ဆၧၫ့ ဆၧလၧအနိၭအကၠီၩ့တၭ, ဆၧချဲၩ့လထံၪလၧအဆၧၫ့ အထီဘၪဝ့ၫနီၪ မွဲဆၧဂ့ၩဆံၭဒိၪလဲၪၬ",
			"24": "<sup>24</sup> လၧၦကိၪ့ဆၧၥ့ၪအဂးနီၪ, ဆၧမၧၫ့အဖၧၩ့ၥၭဖိးလၧ ထၭလခီၫး ဘဲၫၥိၭအမိကၠၪခွံၬအၥၭ လၧဖျႃဖၧၩ့အီၪ လၧလၬလခီၫနီၪလီၫ.",
			"25": "<sup>25</sup> ၦအီၪက့ၪထၪ့ထီၫအၥၭအဂံၪ့နီၪ, ယဟိဝၩမိမၩဂၭ ဂီၩ့ခွံၬဝ့ၫး အ့ၪမွဲၦမုၪမဲၫအခးဆၧၫ့နီၪ, အဝ့ၫမိမၩဂုး ထၪ့ခၧၫ့ထၪ့ဝ့ၫလီၫ.",
			"26": "<sup>26</sup> ဆၧကိၪ့ထၪ့ဖၭလၩ့အအၧၩ့လဖၪနီၪ, မွဲဆၧၥၭလိၪ လၧယဟိဝၩအမ့ၬယၫး အ့ၪမွဲဆၧအခိးအတၩအဆၧ ချဲၩ့ၥံၪနီၪ, မွဲဆၧဆံၫ့ဎံၪလီၫ.",
			"27": "<sup>27</sup> ၦလၧအၥၭလိဖၭလဂၩနီၪ, မၩခိမၩဝီၩအဂံၪ့ဖိၪဒၪ ဝ့ၫး အ့ၪမွဲၦလၧအမ့ၬလဲၩၥၭဂဲၫ့ လၬဆီၪ့ၥံၪ မိမၧၫ့ဝ့ၫ လီၫ.",
			"28": "<sup>28</sup> ၦတီၩၦလီၩ့အၥၭနီၪ ဆီၫ့မီၪ့ဆၧဘဲၫၥိၭအချဲၩ့ဆၧၫ့ ဆၧမိၥ့ၪး အ့ၪမွဲၦလတီၩလလီၩ့ဘၪအနိၭနီၪ လူၫလၩ့ ခွံၬဆၧအၧၩ့လဖၪလီၫ.",
			"29": "<sup>29</sup> ယဟိဝၩအီၪယဲၩ့ လၧၦလတီၩလလီၩ့ဘၪနီၪးအ့ၪ မွဲၦတီၩၦလီၩ့ အဆၧဘၩဆိၪဖၪ, အဝ့ၫဒၪမိခိၭနၪဝ့ၫ လီၫ.",
			"30": "<sup>30</sup> ၦမ့ၬၥၪၥံၪအဆၧဖၩ့နီၪ မၩဎွံၫထၪ့ၦၥုၪ့ၦၥၭး ဒဲဆၧ ပရၧၫ့အဂ့ၩနီၪ မၩဘီၪ့ထၪ့ၦဎွံၪၥံၪလီၫ.",
			"31": "<sup>31</sup> ၦအနါလၧအခိၭနၪ ဆၧမၧၫ့အဆၧအၪ့ၥီၪ့ဝ့ၫနီၪ,မိ အီၪဂုးခၧၫ့ လၧၦကိၪ့ဆၧၥ့ၪလဖၪအကျၩလီၫ.",
			"32": "<sup>32</sup> ၦလၧအခွံၬၡိၭဆၧအၪ့ၥီၪ့နီၪ မၩကြၩ့ထမးအၥၭဒၪ ဝ့ၫး အ့ၪမွဲၦလၧအခိၭနၪဆၧအၪ့ၥီၪ့နီၪ န့ဘၪအၥုၪ့ဖၭ အၥၭဖၭလီၫ.",
			"33": "<sup>33</sup> ဆၧၥၭမဲၪယဟိဝၩနီၪ မွဲဆၧၥီၪ့ဆၧၥၫ့လၧဆၧကိၪ့ ဘၪကိၪ့ၥ့ၪအဖၧၩ့း ဒဲဆၧဆၪ့လၩ့ၥၭနီၪ အီၪဆိၫနဲၪ့ ဆၧလၩဆၧဖၩ့လီၫ."
		},
		"16": {
			"1": "<sup>1</sup> ၦၥၭအဆၧကိၪ့ထၪ့ဖၭလၩ့ၥံၪ ဘၪဆဲၫ့လၧၦၡၩးအ့ၪ မွဲဖျ့ၩအဆၧစံၭဆၧၫ့နီၪ ဂဲၫလၧယဟိဝၩလီၫ.",
			"2": "<sup>2</sup> ၦၡၩအဖၧၩ့ၥၭထီးအလူၬၥံၪ ဆံၫ့လၧအမ့ၬၥၪဒၪဝ့ၫ အဖၧၩ့နီၪး အ့ၪမွဲၦလၧအခံၫ့ၦၥၭၥံၪ မွဲယဟိဝၩလီၫ.",
			"3": "<sup>3</sup> အီၪက့ၪနဆၧမၩလဖၪ လၧယဟိဝၩအစူၪဖၧၩ့တၭး နကိၪ့ထၪ့ဖၭလၩ့ဆၧလဖၪနီၪ မိဂုးထၪ့ခၧၫ့ထၪ့ဆ့လီၫ.",
			"4": "<sup>4</sup> ယဟိဝၩမၩကဲၪထၪ့ဆၧထီးအလူၬ လၧအလးဒၪဝ့ၫ အဂးတၭး ၦအၧၩ့ဖိၪဒၪလ့ၬ လၧမုအၧၩ့လနံၩအဂး လီၫ.",
			"5": "<sup>5</sup> ကယဲၦလဂၩလါလါ လၧအအီၪက့ၪထၪ့ထီၫအၥၭ ကိၭဂၩဒ့ၭနီၪ, မွဲဆၧၥၭလိၪ လၧယဟိဝၩ အမ့ၬယၫ တၭး စူၪဖီၪ့ထၬစူၪလါနၫ့ အဆၧဒဲၩဘၭမိဘၪဆၧဖျါ ခွံၬဝ့ၫအ့ၬ.",
			"6": "<sup>6</sup> လၧဆၧအခိးအတၩ ဒဲဆၧမွဲဆၧတီၩအကၠီၩ့နီၪဆၧ အၧၩ့ဆၧၥၫ့လၧဆၧချႃၬဘံၭဝ့ၫး ဒဲလၧဆၧၥၭမဲၪယဟိ ဝၩအကၠီၩ့နီၪ မွဲဆၧဂၭဎ့ၭဆၧအၧၩ့လီၫ.",
			"7": "<sup>7</sup> ထီးၦၡၩအဖၧၩ့ၥၭၥံၪ အ့ၪဘၪယဟိဝၩ အၥၭနီၪ, အဝ့ၫဒုၭဘၪလိၬအိၭလိၬ အဒုၪအဒၩၥံၪဒၪလ့ၬ လၧအ ဝ့ၫဒၪလဂၩနီၪလီၫ.",
			"8": "<sup>8</sup> ဆၧလဆံၭဖိၪအီၪဎုၬ လၧဆၧတီၩဆၧလီၩ့တၭ,ဂ့ၩ နဲၪ့ဆၧအၪထၪ့ဖၭဒိၪ လၧဆၧတီၩဆၧလီၩ့လအီၪဘၪ နီၪလီၫ.",
			"9": "<sup>9</sup> ၦၡၩအၥၭကိၪ့ထၪ့ဖၭလၩ့အဖၧၩ့ၥၭး အ့ၪမွဲယဟိ ဝၩၥိၫ့အခၫထၪ့ဆၧလဖၪလီၫ.",
			"10": "<sup>10</sup> ဆၧတီၩအလူအီၪလၧ စဎွၩအနိၭဖျံၩအဖၧၩ့တၭးလၧ အစ့ၩရၫ့ဆၧအဖၧၩ့နီၪ အနိၭအၪ့လီၫဆၧအ့ၬ.",
			"11": "<sup>11</sup> ခံၫ့ၥၪၥံၪဒဲခံၫ့အတီၩနီၪ အီၪလၧယဟိဝၩတၭ,ကယဲ ခံၫ့ၥၪလၧထိၪ့ဖၧၩ့နီၪ မွဲအဝ့ၫဒၪအဆၧမၩလီၫ.",
			"12": "<sup>12</sup> ဆၧမၩလတီၩလလီၩ့ဘၪနီၪ မွဲစဎွၩၥၭလိၪဝ့ၫတၭး အဂဲးဘဲၫယီၩ လၧဆၧတီၩဆၧလီၩ့အကၠီၩ့နီၪလးဆီၩ့ ဆီအီၪဂုးခၧၫ့ဝ့ၫလီၫ.",
			"13": "<sup>13</sup> နိၭဖျံၩၥံၪအတီၩအလီၩ့နီၪ ဘၪစဎွၩၥံၪအၥၭး ဒဲအအဲၪ ၦလၧအချဲၩ့ဆၧတီၩလီၫ.",
			"14": "<sup>14</sup> စဎွၩအၥၭထၪ့နီၪ မွဲဘဲၫဆၧၥံၫဒိၪအၥီၫ့တၭး အ့ၪ မွဲၦကိၪ့ဆၧၥ့ၪလဂၩနီၪ မိမၩလၩ့ဆါထဲၩ့ဝ့ၫလီၫ.",
			"15": "<sup>15</sup> လၧစဎွၩ အမ့ၬဖၩ့အဖၧၩ့နီၪ ဆၧမၧၫ့အီၪဝ့ၫတၭး အခိးအတၩနီၪ မွဲဘဲၫဆၧဆၧၩ့လၩ့ လၧခဲၫ့လဖၧၫ့အၥိၭ နီၪလီၫ.",
			"16": "<sup>16</sup> ဆၧန့ဘၪဆၧကိၪ့ၥ့ၪနီၪ, ဂ့ၩနဲၪ့ထီၫ့ဆံၭဒိၪလဲၪၬ ဒဲ ဆၧရွံန့ဘၪၥုၪ့ဖၭၥၭဖၭနီၪ ဂ့ၩနဲၪ့စ့ၩလီၫ.",
			"17": "<sup>17</sup> ၦၥၭဆုးလီၩ့ အဖၧၩ့ၥၭမုနီၪ မွဲဆၧစဲၪ့ဖၭလၧဆၧ အၧၩ့တၭး ၦလၧအယိအဖၧၩ့ၥၭဒၪဝ့ၫ လဂၩနီၪခိၭထၬ အၥၭမၧၫ့လီၫ.",
			"18": "<sup>18</sup> ဆၧအီၪက့ၪထၪ့ထီၫအၥၭနီၪ အီၪလၧဆၧဂၭဂီၩ့အ မ့ၬယၫး ဒဲဆၧမၩဖိၫလိၫအၥၭ လၧဆၧလၩ့ထံၩဖါအ မ့ၬယၫလီၫ.",
			"19": "<sup>19</sup> ၦဆၪ့လၩ့အၥၭလၧၦၥၭဆၧၩ့အကျၩနီၪ, ဂ့ၩနဲၪ့အၪ့ နၩ့ဖၭဆၧအၪ့ဂူၬဆီၪ့ လၧၦအီၪက့ၪထၪ့ထီၫအၥၭအ ၥိၭနီၪလီၫ.",
			"20": "<sup>20</sup> ၦလၧအထီးလၩ့အၥၭလၧ ဎယွၩၭ အလူနီၪ, မိဒၪန့ ဆၧဂ့ၩ, ဒဲၦလၧအဒိၭနဲၩ့အၥၭ လၧယဟိဝၩ အဖၧၩ့ နီၪ, ဘၪဆိၪဂ့ၩဝ့ၫလီၫ.",
			"21": "<sup>21</sup> ၦၥၭလၧအကိၪ့ၥ့ၪနီၪ, ဆၧမိကိၭအဝ့ၫၥံၪ လၧၦၥုၪ့ ဖၭၥၭဖၭတၭး ၥ့ၪထၪ့ဆၧမၩလိၪနီၪ မၩအၪထၪ့ဆၧ ဆၧၫ့လၧအနိၭဖျံၩအဂးလီၫ.",
			"22": "<sup>22</sup> ဆၧကိၪ့ဆၧဖၭနီၪ မွဲထံၫမၧၫ့ထၪ့ဖျိၭ လၧၦလၧအန့ ဘၪဝ့ၫအဂး အ့ၪမွဲၦအဂီၩ့အဆၧၥီၪ့လိၪနီၪ မွဲဆၧအ ဂီၩ့လီၫ.",
			"23": "<sup>23</sup> ၦကိၪ့ၥ့ၪအၥၭနီၪ ၥီၪ့လိၪအနိၭး ဒဲမၩအၪထၪ့ဆၧ မၩလိၪလၧအနိၭဖျံၩၥံၪအလီၩ့လီၫ.",
			"24": "<sup>24</sup> ဆၧချဲၩ့မုၬၥံၪမၩအၥၭ ဘဲၫန့ၫခိၪထံၫအၥိၭနီၪ, ဆၧၫ့ ဝ့ၫလၧၥၭအဂး, ဒဲမၩဘျၪထဲၩ့ဆၧလၧဎွံၪၥံၪ အဂးဆ့ လီၫ.",
			"25": "<sup>25</sup> ဖၧၩ့ၥၭလၧအလီၩ့ဝ့ၫ လၧၦၡၩအမ့ၬယၫနီၪ,အီၪဝ့ၫ လဘီၩ့း အ့ၪမွဲအထုၬနီၪ မွဲဆၧၥံၫအဖၧၩ့ၥၭၥံၪလီၫ.",
			"26": "<sup>26</sup> ၦလၧအမၩဆၧနီၪ မၩလၧအနၫ့ဆါဒၪဝ့ၫအဂး, အ ဂဲးဘဲၫယီၩ အနိၭပဂၨၪထၪ့ဝ့ၫလီၫ.",
			"27": "<sup>27</sup> ၦအၧၩ့လဂၩ ကိၪ့ထၪ့ဖၭလၩ့ဆၧအၧၩ့း ဒဲလၧအ နိၭဖျံၩအလီၩ့နီၪ ဆၧမၩအၥၭဘဲၫမ့ၪခဲၩထၪ့ဝ့ၫအၥိၭ လီၫ.",
			"28": "<sup>28</sup> ၦလၧအအၪ့လီၫဆၧလဂၩနီၪ ထိၪဂဲၩထၪ့ဆၧအဲၪ့ လိၬဆိၭချဲၩ့တၭး ၦချဲၩ့ခဲၪဆၧလဂၩနီၪ ဒုၭလၩ့ဖၭၦ ထၧၫ့ထံၩထၧၫ့ၥိၭၥံၪလီၫ.",
			"29": "<sup>29</sup> ၦၡၩအဆီၪ့လဂၩ အၪ့လွ့ၫန့အထံၩအၥိၭ, ဒဲမီၩ့ဝ့ၫ လၧဖၧၩ့ၥၭလဂ့ၩဘၪ လဘီၩ့နီၪလီၫ.",
			"30": "<sup>30</sup> ထီးအ့ၪဘံၪ့အမ့ၬနီၪ ကၩ့ကၩဆၧအၪ့လီၫဝ့ၫအဂဲး အကၠီၪ့တၭး အ့ၪအဲၪ့ထံၭအနိၭဖျံၩနီၪ ဒုၭကဲၪထၪ့ယူၭ ဆၧအၧၩ့ယူၭလီၫ.",
			"31": "<sup>31</sup> ခိၪဘွၩနီၪ အ့ၪအီၪလၧဆၧတီၩဆၧလီၩ့ အဖၧၩ့ၥၭ ဖၧၩ့တၭ, မွဲဆၧလၩဆၧဖၩ့အၥရဖူၩလီၫ.",
			"32": "<sup>32</sup> ၦလၧအၥၭထၪ့ကၪနီၪဂ့ၩနဲၪ့ၦအဆီၪ့ၥံၪ, ဒဲၦလၧ အပၧၩ့အၥၭဒၪဝ့ၫနီၪဂ့ၩနဲၪ့ဒံၭ ၦလၧအဒုၭန့ဒိၩ့လီၫ.",
			"33": "<sup>33</sup> ၦခွံၬလၩ့ဆၧဖၭလၧဂူၫလၬအဖၧၩ့လါနၫ့တၭ, ယဟိဝၩစ့ၩရၫ့အဂဲးအကၠီၪ့ ထီးအလူၬလီၫ."
		},
		"17": {
			"1": "<sup>1</sup> ဆၧအဎဲၫ့လမိၩ အီၪလၧဆၧမုၬဆၧဎၩ့နီၪ, ဂ့ၩနဲၪ့ ဒံၭဂံၪ့လၧအဎွ့ၩဝ့ၫ လၧဆၧဖိၪဆၧဎါ လၧအဘၪဆၧ မၩၥံၫဝ့ၫဒဲအီၪဎုၬ လၧဆၧအဲၪ့လိၬဆိၭချဲၩ့နီၪလီၫ.",
			"2": "<sup>2</sup> ၦအဎီးအီၪလၧဆၧကိၪ့ၥ့ၪ မိပၧၩ့ဖိၪခွၫ လၧအဒုၭ အီၪထၪ့ဆၧမ့ၬမဲနီၪ, ဒဲမိန့ဎုၬဆၧန့ၥၫနီၪ လၧထၧၫ့ဖုဝဲ ၥံၪအကျၩလီၫ.",
			"3": "<sup>3</sup> ဖၧၩ့ၥိၫ့ဆၧနီၪ မွဲလၧစ့ၩအဂး, ဒဲမ့ၪဖံၫ့ချၪလၧထီၫ့အ ဂး, အ့ၪမွဲၦလၧအမၩခွါၦၡၩအၥၭၥံၪ မွဲယဟိဝၩနီၪ လီၫ.",
			"4": "<sup>4</sup> ၦမၩဆၧအၧၩ့လဂၩနီၪ ခိၭနၪနိၭဖျံၩ အၪ့လီၫဆၧ တၭ, ဆၧအဘျံၭအဘျၪဒိၭအနါ လၧဖျ့ၩအၧၩ့လီၫ.",
			"5": "<sup>5</sup> ၦလၧအမၩကြၩ့ထမး ၦၡၪ့ဖိၪယၬဖိၪနီၪ, ဒုၪဒွ့ၪၦ လၧအတဲၩ့န့ဝ့ၫလဂၩနီၪတၭး ၦလၧအၥုၪ့ထိၬၥၭထိၬ လၧဆၧၡၪ့ဆၧနၭအကၠီၩ့နီၪ မိန့ဘၪဆၧမၩဖီၩ့မၩဖျ့ၭ အဆၧဒဲၩဘၭအ့ၬ.",
			"6": "<sup>6</sup> ၦၥၭၡါအၥရဖူၩနီၪ မွဲအလံၩအလိၩၥံၪး ဒဲဖိၪလဖၪ အလၩအဖၩ့နီၪ မွဲအဖါၥံၪလီၫ.",
			"7": "<sup>7</sup> ဆၧချဲၩ့ဂ့ၩနီၪ ကြၨၭလၧၦအဂီၩ့အ့ၬး နိၭဖျံၩအ ဘျံၭအဘျၪနီၪ ဒံၩ့လကြၨၭဘၪ လၧၦအီၪလၧအလၩ အဖၩ့အဂးလီၫ.",
			"8": "<sup>8</sup> ဆၧဖ့ၪလၫ့မွဲမနံၬထၫ့မျါ လၧၦန့ဘၪဝ့ၫအမ့ၬၥၪ ဖၧၩ့နီၪး ထီးဒၪအလးလၧအဘိၭကၠၪ အၥၭနီၪဘီၪထၪ့ ယီၫထၪ့ဝ့ၫလီၫ.",
			"9": "<sup>9</sup> ၦလၧအမၩဘံၭခွံၬ ဆၧအမၪလမံၩ့နီၪ, အၪ့ဎူၫအၪ့ ဎၬဆၧအဲၪဆၧကွံၩတၭး အ့ၪမွဲၦလၧအလီၩထဲၩ့ဒီၭဝ့ၫ နီၪဒုၭလၩ့ဖၭထၧၫ့ထံၩထၧၫ့ၥိၭလီၫ.",
			"10": "<sup>10</sup> ဆၧအၪ့ၥီၪ့လထံၪနီၪ နုၬလၧၦကိၪ့ဆၧၥ့ၪအဖၧၩ့ ယိၬနဲၪ့ဒံၭဆၧထး ၦအဂီၩ့အထံၪလယၩနီၪလီၫ.",
			"11": "<sup>11</sup> ၦအၧၩ့လဂၩနီၪ အၪ့ဎူၫအၪ့ဎၬန့ၫပိၩ့ထၪ့ဆၧတၭး ဆၧမိအၪ့မၧၫ့လၩ့အၥီၫ့ လၧအၥၭနီၩ့လ့ၩထၫ့ဒုၪဒၩအ ဝ့ၫလဂၩလီၫ.",
			"12": "<sup>12</sup> ဖုၫထၫ့လၧဆၧအၪ့ဂူၬန့ အဖိၪၥံၪဒၪခီၩ့ၦၡၩနီၪ,ဂ့ၩ နဲၪ့ၦအဂီၩ့ လၧအဆၧဂီၩ့အဖၧၩ့နီၪလီၫ.",
			"13": "<sup>13</sup> ၦလဂၩဂၩ အ့ၪဖ့ၪထဲၩ့ဆၧအၧၩ့ လၧဆၧဂ့ၩအဂး နီၪး ဆၧအၧၩ့လမံၩ့စဲၪ့ဖၭ လၧအဝ့ၫဒၪအဂံၪ့ဆ့အ့ၬ.",
			"14": "<sup>14</sup> ဆၧအဲၪ့လိၬဆိၭချဲၩ့အခၪ့ထံၭနီၪ မွဲဘဲၫထံၫဆ့ၭဖိး ထၪ့အၥိၭနီၪး အခိးမွဲဂၭဎ့ၭခွံၬ ဆၧဂဲးလိၬတ့ၭလိၬဘိၩ့ အလချႃၭကဲၪထၪ့ဒံၭဘၪနီၪဆံၭ.",
			"15": "<sup>15</sup> ၦလၧအအီၪက့ၪတီၩၦလတီၩလလီၩ့ဘၪ, ဒဲၦလၧ အစ့ၩရၫ့စၪ ၦအတီၩအလီၩ့နီၪ, မွဲယဟိဝၩအဆၧၥၭ လိၪနံၫဂၩလူၬမီၪ့ဎီၩ့လီၫ.",
			"16": "<sup>16</sup> ၦအဂီၩ့နီၪ အၥၭလၧအမိန့ဘၪ ဆၧကိၪ့ၥ့ၪလအီၪ ဘၪတၭး မွဲဘၪနီၫဆၧအီၪက့ၪအဎွ့ၩ လၧအစူၪဖၧၩ့ ဘဲၫၥိၭအမိန့ဘၪနီၪလဲၪၬ",
			"17": "<sup>17</sup> ၦအထံၩအၥိၭအဲၪဆၧကိၭအဆၧၫ့အထီဒ့ၭး ဒဲၦအ ထၧၫ့ဖုဝဲအီၪဖျဲၪဝ့ၫ လၧဆၧၡၪ့ဆၧနၭအဂးနီၪလီၫ.",
			"18": "<sup>18</sup> ၦလၧအဖီၪ့လိၬစူၪ, ဒဲထိးအၥၭလၧဂူၫဂၩအဂးလၧ အထံၩအၥိၭအမ့ၬယၫနီၪ, မွဲၦလၧအၥုၪ့ဖၭၥၭဖၭလ အီၪဘၪလီၫ.",
			"19": "<sup>19</sup> ၦလၧအအဲၪဆၧဂဲးလိၬတ့ၭလိၬနီၪ အဲၪဆၧဒဲၩဘၭ တၭး ၦလၧအအီၪက့ၪထၪ့ထီၫအတရၫ့နီၪ အၪ့ဎူၫအၪ့ ဎၬဆၧဂၭဂီၩ့လီၫ.",
			"20": "<sup>20</sup> ၦအၥၭကဲၪ့နီၪ မိဒၪန့ဆၧဂ့ၩနးစီၪ့အ့ၬး ဒဲၦလၧအ ဖျ့ၩအၪ့လီၫဆၧနီၪ မိလၩ့ထ့ၬလၧဆၧမၩဂၭဂီၩ့အဖၧၩ့ လီၫ.",
			"21": "<sup>21</sup> ၦလဂၩအ့ၪထၪ့ဖိၪအဂီၩ့နီၪ မွဲလၧဆၧၥုၪ့အုၭၥၭ အုၭဒၪဝ့ၫအဂးတၭ, ၦအဂီၩ့အဖါနီၪ အီၪလၧဆၧၥုၪ့ ထိၬၥၭထိၬနးမံၩ့အ့ၬ.",
			"22": "<sup>22</sup> ၥၭအဎွံၫနီၪ ဒုၭအီၪဆီၪ့အီၪချဲၫ့ပနးခီၫ့း အ့ၪမွဲၥုၪ့ခါ ၥၭလၩ့ဒုၭဎဲၫ့ထၬခွံၬဎွံၪၥံၪလီၫ.",
			"23": "<sup>23</sup> ၦလတီၩလလီၩ့ဘၪနီၪ မၩန့လၬဆီၪ့ လၧၥၭနၫအ ဖၧၩ့, ဘဲၫၥိၭအမိဘိၭကၠၪခွံၬ ဆၧစ့ၩရၫ့တီၩအဖၧၩ့ၥၭ လီၫ.",
			"24": "<sup>24</sup> ဆၧကိၪ့ဘၪကိၪ့ၥ့ၪ အီၪလၧၦၥုၪ့ဖၭၥၭဖၭ အၥိၭ, အ့ၪမွဲၦအဂီၩ့အမ့ၬၥၪၥံၪ လ့ၩစိၩလၧဂၪ့ခိၪအထုၬလီၫ.",
			"25": "<sup>25</sup> ဖိၪခွၫအဂီၩ့နီၪ မွဲအဖါအဆၧၥုၪ့အုၭၥၭအုၭ, ဒဲဆၧ အခၪလၧၦလၧအဆီၫ့ အီၪန့ဝ့ၫလဂၩနီၪ အဂးလီၫ.",
			"26": "<sup>26</sup> ဆၧဒုၭထိး ၦအတီၩအလီၩ့ လၧဒၫ့နီၪ ကြၨၭအ့ၬ, ဒဲထးၦအီၪလၧအလၩအဖၩ့နီၪ တီၩဆ့အ့ၬ.",
			"27": "<sup>27</sup> ၦလၧအအီၪလၧဆၧၥ့ၪယၫနီၪ ချဲၩ့ဆၧၡၩထံၪ,ဒဲၦ အီၪလၧဆၧကိၪ့ၥ့ၪနီၪ အၥၭချံၪ့လီၫ.",
			"28": "<sup>28</sup> ၦအဂီၩ့ဒၪလ့ၬ ထီးအအီၪလၩ့မါပံၭနီၪ, ဘၪလဘၪ ဆၧမိအီၪက့ၪဝ့ၫဘဲၫၦကိၪ့ၥ့ၪတၭ, မၩဘံၭထၬအနိၭ ဖျံၩအဘိၩ့ဘၭနီၪ လၧၦအၥုၪ့ဖၭၥၭဖၭဆ့လီၫ."
		},
		"18": {
			"1": "<sup>1</sup> ၦလၧအမၩလၩ့ဖၭအၥၭလဂၩနီၪ အၪ့ဎူၫအၪ့ဎၬအ ဆၧမုၬဆၧလၩဒၪဝ့ၫတၭ, လၧကယဲဆၧဒုၭကိၪ့အဂ့ၩ နီၪအဝ့ၫထၫ့ဒုၪဒၩ ၥၭဂဲၫ့ထီးအလူၬလီၫ.",
			"2": "<sup>2</sup> လၧၥုၪ့ဖၭၥၭဖၭအဖၧၩ့နီၪ ၦအဂီၩ့မုၬလၩအၥၭၥ့ၪ နးစီၪ့အ့ၬး အ့ၪမွဲဘၪအၥၭလၧအမိနဲၪဖျီၪထၪ့ အၥၭဒၪ ဝ့ၫဒိၪဒၪဆၧဒံၭလီၫ.",
			"3": "<sup>3</sup> ထီးၦလတီၩလလီၩ့ဘၪဂဲၫဝ့ၫတၭ, ဆၧမၩကြၩ့ထ မးဂဲၫဝ့ၫဒၪဆ့း ဒဲဆၧဒုၪဒွ့ၪနီၪ အီၪဎုၬလၧဆၧမ့ၬမဲဆ့ လီၫ.",
			"4": "<sup>4</sup> ၦၡၩအနိၭအဆၧချဲၩ့ၥံၪ မွဲထံၫယိၬလဖၪတၭး ဆၧ ကိၪ့ဘၪကိၪ့ၥ့ၪအထံၫထၪ့ဖျိၭနီၪ မွဲထံၫချိၬလၧအလၩ့ ယွၩဝ့ၫလီၫ.",
			"5": "<sup>5</sup> ယိမ့ၬ ၦလတီၩလလီၩ့ဘၪ ဘဲၫၥိၭအမိဘိၭကၠၪခွံၬ ၦတီၩၦလီၩ့အဆၧစ့ၩရၫ့နီၪ, မွဲဆၧအဂ့ၩအ့ၬ.",
			"6": "<sup>6</sup> ၦအဂီၩ့အနိၭဖျံၩနုၬလၧဆၧဂဲးလိၬ တ့ၭလိၬအဖၧၩ့, ဒဲအနိၭကိၭထၪ့ဆၧထးဝ့ၫ အဂးလီၫ.",
			"7": "<sup>7</sup> ၦအဂီၩ့အနိၭနီၪ မွဲဆၧဂၭဂီၩ့, ဒဲအနိၭဖျံၩမွဲဖျံၩခွၩ့ လၧအၥၭမၧၫ့အဂးလီၫ.",
			"8": "<sup>8</sup> ၦလၧအချဲၩ့ခဲၪဆၧအဆၧချဲၩ့ၥံၪ မၩအၥၭဘဲၫဆၧ လၧၦအၪ့အွံၪအၥိၭတၭး အဝ့ၫၥံၪလ့ၩနုၬလၩ့လၧဂူၭ ဖိၫ့အၥၭခံဖၧၩ့နီၪလီၫ.",
			"9": "<sup>9</sup> ၦလၧအမၩကၠႃၪ့အၥၭ လၧအဆၧဖံၭဆၧမၩအဖၧၩ့ နီၪ, မွဲအထၧၫ့ဖုဝဲ လၧၦမၩလူၬဂီၩ့ဆၧနီၪလီၫ.",
			"10": "<sup>10</sup> ယဟိဝၩအမံၩ့နီၪ မွဲတၨၭထီၫအခၧၫ့တၭး ၦအတီၩ အလီၩ့ၥံၪစဲၪ့တလဲးနုၬ လၧအဖၧၩ့တၭ, အီၪဖီၩ့ဖျ့ၭဝ့ၫ လီၫ.",
			"11": "<sup>11</sup> ၦၥထံၫအစူၪလးခၪ့ခိၪနီၪမွဲဒိၩ့အဂုးခၧၫ့, ဒဲလၧအ ဆၧဆီၫ့မီၪ့ဒၪဝ့ၫအဖၧၩ့နီၪ မွဲဝ့ၫဘဲၫခိၪဒၧၩ့ထၪ့ထီၫအ ၥိၭလီၫ.",
			"12": "<sup>12</sup> ၦၡၩအီၪက့ၪထၪ့ထီၫအၥၭ လၧဆၧဂၭဂီၩ့လချႃၭ ထီၩ့ဒံၭဘၪနီၪး ဒဲဆၧဆၪ့လၩ့ၥၭ အီၪဆိၫနဲၪ့ဒံၭဆၧ လၩဖၩ့နီၪလီၫ.",
			"13": "<sup>13</sup> ၦလဂၩဂၩ အ့ၪချဲၩ့ဆၧၫ့ဆၧ လၧအလချႃၭနါဂၧၫ့ ဆၧအဂဲးအကၠီၪ့ဒံၭဘၪနီၪ, မွဲဆၧအဂီၩ့ဒဲဆၧမ့ၬမဲလၧ အဝ့ၫဒၪအဂးလီၫ.",
			"14": "<sup>14</sup> ၦအၥၭနီၩ့ ထိးအဆၧဆၫနၧၩ့း အ့ၪမွဲဆၧၥုၪ့ခါၥၭ လၩ့နီၪ မွဲပလၫထိးဝ့ၫနၧၩ့ လဂၩလဲၪၬ",
			"15": "<sup>15</sup> ၦၥုၪ့ဖၭၥၭဖၭ မိန့ဘၪဆၧၥ့ၪယၫတၭး ၦကိၪ့ၥ့ၪအ နါနီၪ မိအၪ့ဎူၫအၪ့ဎၬ ဆၧၥ့ၪယၫလီၫ.",
			"16": "<sup>16</sup> ၦၡၩအလၬဆီၪ့နီၪ မၩပျၩ့အလး ဒဲၥိၫ့ထၪ့ဝ့ၫလၧ ၦဒိၪၥံၪအမ့ၬယၫလီၫ.",
			"17": "<sup>17</sup> ၦလၧအအီၪဆိၫဝ့ၫ လၧဆၧချဲၩ့ခွးအဖၧၩ့နီၪဆီၫ့မီၪ့ ဝ့ၫလၧအတီၩ လါနၫ့ဘိၩး ၦဂူၫဂၩ ဂဲၫအၪ့စိၭအၪ့စၪ့ နဲၪဖျီၪထၪ့ဝ့ၫ အဂဲးအကၠီၪ့လီၫ.",
			"18": "<sup>18</sup> ဆၧဖၭနီၪဒုၭလၩ့မါ ဆၧဂဲးလိၬတ့ၭလိၬလဖၪ, ဒဲဒုၭ လၩ့ဖၭၦအဆီၪ့ၥံၪလီၫ.",
			"19": "<sup>19</sup> ထၧၫ့ဖုဝဲလၧအၥၭဂၭဂီၩ့နီၪ, ဆၧန့ထဲၩ့အၥၭမွဲဆၧ ကၪနဲၪ့ဒံၭ လၧအန့ဒိၩ့ခၧၫ့း ဒဲဆၧဂဲးလိၬတ့ၭလိၬလဖၪ မွဲဝ့ၫဘဲၫထိၬ အနိၪဘီၩ့ၥံၪ အၥိၭလီၫ.",
			"20": "<sup>20</sup> ၦၡၩအဂူၭဖိၫ့မိလၧၫ့ဎွ့ၩ လၧအနိၭအဆၧၥၪၥံၪ, ဒဲ မိလၧၫ့ဎွ့ၩ လၧအနိၭဖျံၩၥံၪ အဆၧအၪထၪ့ဝ့ၫလီၫ.",
			"21": "<sup>21</sup> ဆၧၥံၫဒဲဆၧမၧၫ့နီၪ အီၪလၧဖျ့ၩအစီၩ့အမၩ့အဖၧၩ့ တၭ, ၦလၧအအဲၪဝ့ၫလဂၩနီၪ မိအၪ့ဝ့ၫအၥၪဆ့လီၫ.",
			"22": "<sup>22</sup> ၦလဂၩဂၩဒၪန့အမၫတၭ, ဒၪန့ဆၧအဂ့ၩလမံၩ့,ဒဲန့ ဘၪယဟိဝၩ အခိးအတၩဆ့လီၫ.",
			"23": "<sup>23</sup> ၦၡၪ့ဖိၪယၬဖိၪနီၪ အၪ့ကံၩ့အၪ့ယၫဆၧလဖၪး အ့ၪ မွဲၦၥထံၫၥံၪ ချဲၩ့ဆၧၫ့ဆၧဆီၪ့ဆီၪ့လ့ၬလီၫ.",
			"24": "<sup>24</sup> ၦလၧအအီၪက့ၪအၥၭ လၧအမိန့ဘၪအထံၩအၥိၭ အၪဂၩနီၪ မိမၩဂၭဂီၩ့အနၫ့ဆါဒၪဝ့ၫ, အ့ၪမွဲၦလၧအ အဲၪဝ့ၫ ဒဲစဲၩဘုၭထၬအၥၭ ထံးနဲၪ့ဒံၭထၧၫ့ဖုဝဲနီၪ အီၪ ဝ့ၫလဂၩလီၫ."
		},
		"19": {
			"1": "<sup>1</sup> ၦၡၪ့ဖိၪယၬဖိၪလၧအလ့ၩဆၧ လၧအၥၭတီၩအဖၧၩ့ နီၪ, ဂ့ၩနဲၪ့ဒံၭ ၦလၧအနိၭဖျံၩအကဲၪ့ ဒဲအမွဲၦအဂီၩ့နီၪ လီၫ.",
			"2": "<sup>2</sup> ၦၥၭလအီၪဘၪ လၧဆၧၥ့ၪယၫနီၪ ဂ့ၩဆ့အ့ၬး ဒဲၦ လၧအခၪ့ဖျဲၪဂၭဖျိၭဖၧၩ့ၥၭလီၫ.",
			"3": "<sup>3</sup> ၦၡၩအဂီၩ့နီၪ ဘိၭကဲၪ့အဖၧၩ့ၥၭတၭး အၥၭထၪ့ ထၫ့ဒုၪဒၩယဟိဝၩလီၫ.",
			"4": "<sup>4</sup> ဆၧအစူၪလးခၪ့ခိၪနီၪ ဒုၭအၪထၪ့ၦထံၩၦၥိၭး အ့ၪ မွဲၦၡၪ့ဖိၪယၬဖိၪ ဘၪဆၧမၩလၩ့ဖၭဝ့ၫ လၧအထံၩအ ၥိၭလီၫ.",
			"5": "<sup>5</sup> ၦထိးအၥၭအဘျံၭအဘျၪလဂၩနီၪ မိဘၪဆၧဖျါခွံၬ အဆၧမၪအ့ၬး ဒဲၦလၧအချဲၩ့ဆၧလတီၩဘၪနီၪ ဖီၩ့ ဖျ့ၭၥ့ၪအ့ၬ.",
			"6": "<sup>6</sup> ၦအၪဂၩ အၪ့လွ့ၫၦဒိၪအၥၭး ဒဲၦကိၭဂၩဒ့ၭထၧၫ့ ထံၩထၧၫ့ၥိၭ လၧၦဖ့ၪလၫ့ဆၧယီၫ လဂၩနီၪလီၫ.",
			"7": "<sup>7</sup> ၦအၡၪ့အယၬ အထၧၫ့ဖုဝဲၥံၪ မ့ၬလဲၩအဝ့ၫကိၭဂၩ ဒ့ၭး အထံၩအၥိၭၥံၪ အီၪယဲၩ့ထၪ့ အၪဒၪအဆၧဒံၭး အဝ့ၫလီၩ့ဆီးဆၧချဲၩ့ၥံၪတၭ, န့ဘၪဆၧနီၪလဖၪလီၫ.",
			"8": "<sup>8</sup> ၦလၧအန့ဘၪဆၧကိၪ့ဘၪကိၪ့ၥ့ၪလဂၩနီၪ အဲၪအၥၭ မၧၫ့ဒၪဝ့ၫတၭး ၦလၧအအီၪက့ၪထၬ ဆၧၥုၪ့ဖၭၥၭဖၭ နီၪဒၪန့ဆၧဂ့ၩလီၫ.",
			"9": "<sup>9</sup> ၦထိးအၥၭအဘျံၭအဘျၪနီၪ မိဘၪဆၧဖျါခွံၬ အဆၧ မၪအ့ၬး ဒဲၦလၧအချဲၩ့ဆၧလတီၩလလီၩ့ဘၪနီၪ မိဘၪ ဆၧဂၭဂီၩ့ဂၭစၪဝ့ၫဒၪလီၫ.",
			"10": "<sup>10</sup> ဆၧအၪ့အွံၪအီၩဆၧၫ့နီၪ ကြၨၭလၧၦအဂီၩ့အ့ၬး ဆၧအခ့ၫအၡၩပၧၩ့ၦဒိၪၥံၪ, ဒံၩ့လကြၨၭဘၪလီၫ.",
			"11": "<sup>11</sup> ၦၡၩအီၪလၧဆၧကိၪ့ဘၪကိၪ့ၥ့ၪနီၪ ၥၭထၪ့ကၪးဒဲယိ ဖၬခွံၬဆၧအမၪနီၪ မွဲအဆၧလၩဖၩ့လီၫ.",
			"12": "<sup>12</sup> စဎွၩအဆၧၥၭထၪ့နီၪ မၩအၥၭဘဲၫဆၬလၥၧၫ့ယုၩ့ ဆၧအၥိၭး အ့ၪမွဲအခိးအတၩနီၪ မၩအၥၭဘဲၫဆၩ့ထံၫ ဘၪနၪ့ၥံၪမံၩ့ၥံၪ အၥိၭနီၪလီၫ.",
			"13": "<sup>13</sup> ဖိၪခွၫအဂီၩ့နီၪ မွဲဖါအဆၧၡၪ့ဆၧနၭး ဒဲမၫအဆၧ ဂဲးလိၬတ့ၭလိၬနီၪ မွဲဆၧလၩ့ဆၩ့လထံၪဎးဘီၩ့ဎးလီၫ.",
			"14": "<sup>14</sup> ဂံၪ့ၥံၪဎၫ့ၥံၪ ဒဲဆၧအစူၪလးခၪ့ခိၪနီၪ, မွဲဆၧလၧၦန့ ၥၫလၧဖါး အ့ၪမွဲမၫလၧအၥ့ၪယၫ ထီးလၩ့အၥၭဂ့ၩ လဂၩနီၪ ဂဲၫဝ့ၫလၧယဟိဝၩလီၫ.",
			"15": "<sup>15</sup> ဆၧကၠႃၪ့နီၪ ဒုၭမံၫမၪဆၧယိၬလ့ၬ, ဒဲၦကၠႃၪ့နီၪဘၪ ထိးဆၧၥၭဝံအၥၭဆ့လီၫ.",
			"16": "<sup>16</sup> ၦလၧအထီးန့ဆၧမၪလူၬနီၪ ယိထဲၩ့ခွါထဲၩ့အၥၭဒၪ ဝ့ၫ, အ့ၪမွဲၦလၧအမၩကြၩ့ထမးအဖၧၩ့ၥၭနီၪ မိဘၪၥံၫ ဝ့ၫလီၫ.",
			"17": "<sup>17</sup> ၦလၧအယၫ့ၥၭၦၡၪ့ဖိၪယၬဖိၪလဂၩနီၪ ဒုၭအၪ့လီး ဆၧလၧယဟိဝၩတၭး အဝ့ၫဒၪမိဖ့ၪလၫ့ထဲၩ့ဆၧလၧ အကြၨၭန့ဘၪလီၫ.",
			"18": "<sup>18</sup> လၧဆၧယိလါအလးအီၪဝ့ၫအဘိၩ့ဘၭနီၪ အၪ့ၥီၪ့ နဖိၪခွၫဆံၭး အ့ၪမွဲထီးဆိၫ့မၩၥံၫအဝ့ၫလဂ့ၩ.",
			"19": "<sup>19</sup> ၦလၧအၥၭထၪ့ဖၭဒိၪလဂၩနီၪ မိဘၪဆၧစ့ၩရၫ့စၪး အဂဲးဘဲၫယီၩ နမၩဖီၩ့မၩဖျ့ၭဝ့ၫလဖၧၫ့လါနၫ့ဘိၩ, န ဘၪမၩဒီၭနးဖၧၫ့ဒီၭဆ့လီၫ.",
			"20": "<sup>20</sup> ဘဲၫၥိၭနမိအီၪလၧဆၧကိၪ့ဘၪကိၪ့ၥ့ၪ လၧနံၪ့လၧယၫ လဖၪနီၪ, ခိၭနၪဆၧဒုၭကိၪ့ ဒဲထိးဆၧၫ့ဆၧအၪ့ၥီၪ့နီၪ ဆံၭ.",
			"21": "<sup>21</sup> ဆၧကိၪ့ထၪ့ဖၭလၩ့ၥံၪ လၧၦၡၩအၥၭခံဖၧၩ့နီၪအီၪ ဝ့ၫအၪမံၩ့း အ့ၪမွဲယဟိဝၩအဆၧဒုၭကိၪ့နီၪ မိအီၪဂုး ခၧၫ့ဝ့ၫလီၫ.",
			"22": "<sup>22</sup> ၦၡၩအဆၧဂ့ၩနီၪ မွဲအခိးအတၩတၭး ၦၡၪ့ဖိၪယၬ ဖိၪလဂၩနီၪ ဂ့ၩနဲၪ့ဒံၭၦချဲၩ့ဘျံၭချဲၩ့ဘျၪဆၧ လဂၩနီၪ လီၫ.",
			"23": "<sup>23</sup> ဆၧၥၭမဲၪယဟိဝၩနီၪ ဘၪဆဲၫ့လၧဆၧမၧၫ့တၭး ၦ မိမံၫ့ၥုၪ့မံၫ့ၥၭ, ဒဲဆၧအၧၩ့ဆၧၥၫ့ ဘၪအဝ့ၫနီၪအ့ၬ.",
			"24": "<sup>24</sup> ၦကၠႃၪ့လဂၩ ဘၧၩ့လၩ့အစူၪ လၧထွ့ၫဖၧၩ့တၭးန့ၫ ထုၭထၪ့ထဲၩ့ဝ့ၫ လၧအနိၭနီၪမၩအ့ၬ.",
			"25": "<sup>25</sup> နအ့ၪထး ၦမၩကြၩ့ထမး ဆၧလဂၩတၭ, ၦလမၩ လိၪဘၪဆၧနီၪ မိထီးလၩ့အၥၭး အၪ့ၥီၪ့ၦၥုၪ့ဖၭၥၭဖၭ တၭ အဝ့ၫဒၪမိမၩလိၪ ဆၧၥ့ၪယၫအဂဲးအကၠီၪ့နီၪလီၫ.",
			"26": "<sup>26</sup> တၭဖိၪခွၫ လၧအဒုၭမ့ၬမဲဆၧ, ဒဲဆၧဒုၪဒွ့ၪနီၪ, မွဲၦ လၧအမၩဂၭဂီၩ့အဖါ ဒဲမၩခိမၩဝီၩ အမိနီၪလီၫ.",
			"27": "<sup>27</sup> ယဖိၪခွၫဧ့, ဆၧၥီၪ့ဆၧၥၫ့လၧအဒုၭဂၭဖျိၭနၧၩလၧ ဆၧၥ့ၪယၫအဆၧချဲၩ့လဖၪနီၪ, ထီးခိၭနၪလဂ့ၩ, ဧီၪ.",
			"28": "<sup>28</sup> ၦထိးအၥၭ အအၧၩ့အၥၫ့လဂၩနီၪ မၩကြၩ့ထမး ဆၧစ့ၩရၫ့တီၩတၭး ၦလတီၩလလီၩ့ဘၪအနိၭနီၪ ယု လၩ့ဆၧအၧၩ့လီၫ.",
			"29": "<sup>29</sup> ဆၧတဲၩ့ဝဲၩဆၧစ့ၩရၫ့ၥံၪ လၧၦမၩကြၩ့ထမးဆၧအ ဂးနီၪး ဒဲဆၧထးဝ့ၫလဖၪ လၧၦအဂီၩ့အချိၫ့ အဂးလီၫ."
		},
		"20": {
			"1": "<sup>1</sup> စဘံၭထံၫနီၪ မွဲဆၧမၩကြၩ့ထမးဆၧး ဒဲၥံၭထံၫဂၬ ထံၫဒုၭအဲၪ့လိၬဆၧဆီၪ့ဆီၪ့လ့ၬတၭး ၦလၧအမၩမၪ ဆၧလၧအနီၪ, အီၪလၧဆၧကိၪ့ၥ့ၪနးဂၩအ့ၬ.",
			"2": "<sup>2</sup> စဎွၩအဆၧဒုၭၥၭမဲၪနီၪ မၩအၥၭဘဲၫဆၬလၥၧၫ့ယုၩ့ ဆၧအၥိၭတၭး ၦလၧအဒုၭၥၭထၪ့အဝ့ၫဒၪနီၪ မၩမၪ ဆၧထၫ့ဒုၪဒၩအၥၭမၧၫ့လီၫ.",
			"3": "<sup>3</sup> ၦအ့ၪအီၪလၩ့ဖၭ လၧဆၧဂဲးလိၬတ့ၭလိၬနီၪ, န့ဘၪ ဆၧလၩဖၩ့း အ့ၪမွဲကယဲၦအဂီၩ့ၥံၪ ၥုၪ့ထၪ့ၥၭဂဲၫ့ဆၧ ကိၭဂၩဒ့ၭဆုၬဆုၬလီၫ.",
			"4": "<sup>4</sup> လၧဆၧဂီးအကၠီၩ့တၭ, ၦကၠႃၪ့လဂၩနီၪ မိထဲၫဆၧ အ့ၬး အဝ့ၫနီၪ အၪ့ကံၩ့ဆၧလၧကူၭဆၧအထီလါနၫ့ ဘိၩန့ဘၪဆၧနးမံၩ့အ့ၬ.",
			"5": "<sup>5</sup> ဆၧကိၪ့ထၪ့ဖၭလၩ့ လၧၦၥၭခံဖၧၩ့နီၪ မွဲထံၫယိၬး အ့ၪမွဲၦလၧအၥုၪ့ဖၭၥၭဖၭနီၪ မိထုၭခွံၬဝ့ၫဒၪလီၫ.",
			"6": "<sup>6</sup> ၦအၪဂၩမိကိၭထၪ့အခိးဒၪဝ့ၫ, လဂၩအခိးဒၪဝ့ၫး အ့ၪမွဲၦလၧအလူတီၩလဂၩနီၪ, မွဲပလၫမိဒၪန့ဝ့ၫလဂၩ လဲၪ.",
			"7": "<sup>7</sup> ၦတီၩၦလီၩ့လ့ၩဆၧ လၧအဆၧလၧၫ့ဆၧဎွ့ၩအဖၧၩ့ နီၪး အဖိၪအလံၩၥံၪ လၧအလးခဲၫ့နီၪ ဘၪဆၧဆိၪဂ့ၩ လီၫ.",
			"8": "<sup>8</sup> စဎွၩဆၧၫ့နၩ့ လၧအဆၧစ့ၩရၫ့ဆၧ အလးဆီၩ့ဆီခိၪ, အမ့ၬၥၪၥံၪ ယိအၪ့ဎူၫအၪ့ဎၬၥ့ၪယၫ ကယဲဆၧအၧၩ့ ဆၧၥၫ့လီၫ.",
			"9": "<sup>9</sup> ယၥူၫဝၭဆံၫ့ခွံၬယၥၭနီၪ, ဒဲယဆံၫ့ခွံၬ လၧယဆၧဒဲၩ ဘၭတၭ, မွဲပလၫစံၭမိၥ့ၪလဂၩလဲၪ.",
			"10": "<sup>10</sup> ခံၫ့နံၫမံၩ့, ဒဲဆၧတိၪ့နံၫမံၩ့, မွဲဆၧၥၭလိၪ လၧယဟိ ဝၩအမ့ၬယၫ နံၫမံၩ့လူၬလီၫ.",
			"11": "<sup>11</sup> ဖိၪၥၪဒၪလ့ၬနီၪ အဆၧဖံၭဆၧမၩၥံၪ, မွဲအဆံၫ့ဧၪ, မွဲ အတီၩဧၪ, ၦၥ့ၪယၫလၧအဆၧမၩဒၪဝ့ၫအကၠီၩ့နီၪလီၫ.",
			"12": "<sup>12</sup> နါလၧအနါဂၧၫ့ဆၧ, ဒဲမ့ၬၥၪလၧအဒၪဆၧနီၪ, ယဟိဝၩတဲၩ့လၩ့ဝ့ၫ နံၫမံၩ့လူၬလီၫ.",
			"13": "<sup>13</sup> အဲၪဆၧမံၫလဂ့ၩ, နမိၡၪ့မိယၬဘၪခိၬ, စၪ့ထၪ့နမ့ၬ ၥၪတၭ, နမိဘျဲၩအၪ့လၧကိၪလီၫ.",
			"14": "<sup>14</sup> ၦလၧအဎွ့ၩဆၧလဂၩစံၭဝ့ၫ, ဆၧနးမံၩ့အ့ၬ, ဆၧနး မံၩ့အ့ၬ, လါနၫ့နီၪး စဲၪ့ထၪ့ခွံၬဝ့ၫတၭ, ထီးနီၪလဖၧၫ့ အူၭလၩ့အၥၭလီၫ.",
			"15": "<sup>15</sup> ထီၫ့ၥံၪလွ့ၫၥံၪဒဲမနံၬထၫ့မျါၥံၪ အီၪအၪအၪလ့ၬး အ့ၪ မွဲဆၧၥ့ၪယၫအနိၭဖျံၩလဖၪနီၪ, မွဲဆၧလၧအလူဒိၪဎွ့ၩ ဒိၪလီၫ.",
			"16": "<sup>16</sup> ၦလၧအထိးအၥၭလၧၦမွံၩအဂးလဂၩနီၪ, မၩန့ထၬ အကီၩ့အၥိၭဘီၪး ဒဲလၧၦလခီၫဘၩ့မုးဖိၪၥံၪ အဂးနီၪ မၩန့ထၬ ဆၧပီၩ့လၩ့နီၪဆံၭ.",
			"17": "<sup>17</sup> အၪ့လီၫန့ဆၧ အကိၪဆၧၫ့ဝ့ၫ လၧၦၡၩအဂးလါနၫ့ တၭ, လၧခဲၫ့ထဲၩ့နီၪ အနိၭမိဎွ့ၩထၪ့ လၧလိးဖိၪမ့ၭဖိၪ လဖၪနီၪလီၫ.",
			"18": "<sup>18</sup> ကယဲဆၧကိၪ့ထၪ့ဖၭလၩ့ လမံၩ့လါလါနီၪ ဂုးထၪ့ ခၧၫ့ထၪ့ လၧဆၧဒုၭကိၪ့တၭး လၧဆၧၥိၫ့ထီးအဂ့ၩအ ဘၪနီၪနမိဒုၭဘၪၥုၭလီၫ.",
			"19": "<sup>19</sup> ၦလၧအလ့ၩချဲၩ့ခဲၪဆၧနီၪ ဒုၭဖျီၪထၪ့ဆၧအီၪၥူၪဝ့ၫ တၭး အခိးမွဲထၧၫ့ထံၩထၧၫ့ၥိၭ လၧၦလၧအချဲၩ့မုၬနါ ဆၧလဂ့ၩ.",
			"20": "<sup>20</sup> ၦလၧအဆိၪအၧၩ့အဖါဒဲအမိနီၪ, အမ့ၪဒိၩ့မိဘၪ ဆၧမၩလၩ့ဖံၬခွံၬဝ့ၫ လၧဆၧခံၭၥၧၫ့အဖၧၩ့လီၫ.",
			"21": "<sup>21</sup> ဆၧန့ၥၫနီၪ ၦန့ဘၪဝ့ၫလၧအခၪ့ထံၭ ချဲၫ့ချဲၫ့လါနၫ့ တၭး အထုၬနီၪ ဘၪဆၧဆိၪဂ့ၩၥ့ၪအ့ၬ.",
			"22": "<sup>22</sup> ယမိဖ့ၪဆၧၫ့ထဲၩ့ဆၧအၧၩ့နီၪ, ထီးစံၭလဂ့ၩ အီၪ ခိၭယဟိဝၩတၭ, အဝ့ၫနီၪ မိမၩဘိၭမၩဆၧၩ့နၧၩလီၫ.",
			"23": "<sup>23</sup> ဆၧခံၫ့ၥၪနံၫမံၩ့နီၪ မွဲဆၧၥၭလိၪလၧယဟိဝၩအမ့ၬ တၭး ခံၫ့အၪ့လီၫဆၧနီၪ မွဲဆၧဂ့ၩအ့ၬ.",
			"24": "<sup>24</sup> ၦၡၩခၫထၪ့ဆၧနီၪ ဘၪဆဲၫ့လၧယဟိဝၩတၭး ၦၡၩ နီၪ, မွဲအနၪအဖၧၩ့ၥၭဒၪဝ့ၫ မိၥ့ၪဘဲၫၥ့ၪလဲၪ.",
			"25": "<sup>25</sup> ၦလၧအချဲၩ့ကြၩ့ဆၧ လၧအဘၪဆဲၫ့လၧယွၩတၭး ဆီၫ့မီၪ့လၩ့အၥၭ လၧအဆိၪလၩ့အၥၭ အလးခဲၫ့နီၪ, ကဲၪထၪ့ဝ့ၫဖျံၩခွၩ့ လၧအဂးလီၫ.",
			"26": "<sup>26</sup> စဎွၩလၧအကိၪ့ဆၧၥ့ၪနီၪ ဂုလၩ့ခွံၬၦအအၧၩ့တၭး ဒုၭလ့ၩလဲၪ့ပၪလၧအလီၩ့လီၫ.",
			"27": "<sup>27</sup> ၦၡၩအၥၭနီၪ မွဲယဟိဝၩအမ့ၪဒိၩ့တၭး ယိအၪ့ဎၬ ၥ့ၪယၫကယဲဆၧအယိၬ လၧဂူၭဖိၫ့ဖၧၩ့ထီးအလူၬလီၫ.",
			"28": "<sup>28</sup> ဆၧအခိးအတၩဒဲဆၧမွဲဆၧတီၩနီၪ မိမၩဂုးထၪ့စဎွၩ အလးတၭး လၧဆၧအခိးအတၩအကၠီၩ့နီၪ ဖီၪ့ခၧၫ့အ လးဆီၩ့ဆီလီၫ.",
			"29": "<sup>29</sup> ဖိၪၥၪခွၫၥံၪအလၩအဖၩ့နီၪ မွဲအဂဲးအဘၭး ဒဲၦၥၭ ၡါၥံၪအဆၧဎံၫဆၧလၩနီၪ မွဲအခိၪဘွၩလီၫ.",
			"30": "<sup>30</sup> ဆၧထးဝ့ၫအဖၧၩ့လးနီၪ မွဲဆၧမၩဆံၫ့လၧၦလတီၩ လလီၩ့ဘၪအဂးတၭး မွဲဆၧဒိၪဝ့ၫထီၩ့လၩ့ လၧဂူၭဖိၫ့ ဖၧၩ့လီၫ."
		},
		"21": {
			"1": "<sup>1</sup> စဎွၩအၥၭအီၪဝ့ၫ လၧယဟိဝၩအစူၪဖၧၩ့ ဘဲၫထံၫ ချိၬအၥိၭနီၪတၭ အဝ့ၫဒၪဘိၭကၠၪဝ့ၫ ထီးဒၪအလးလၧ အဘၪအၥၭလစီၪ့လါလါနီၪလီၫ.",
			"2": "<sup>2</sup> ၦၡၩအဖၧၩ့ၥၭတီၩဝ့ၫလီၩ့ဝ့ၫ လၧအမ့ၬၥၪဒၪဝ့ၫအ ဖၧၩ့ကိၭဘီၩ့ဒ့ၭး အ့ၪမွဲၦလၧအမၩခွါ ၦၡၩအၥၭၥံၪ မွဲယဟိဝၩလဂၩနီၪလီၫ.",
			"3": "<sup>3</sup> မၩဆၧတီၩတီၩလီၩ့လီၩ့ ဒဲစ့ၩရၫ့ဆၧတီၩနီၪ, ဘၪ ယဟိဝၩအၥၭဂ့ၩနဲၪ့ဒံၭဆၧလုဒံၭလီၫ.",
			"4": "<sup>4</sup> ဆၧအီၪက့ၪထၪ့ထီၫမ့ၬၥၪ ဒဲၥၭလၧအမၩဖိၫလိၫအ ၥၭ, ၦလတီၩလလီၩ့ဘၪ အဆၧဖၩ့နီၪ, မွဲဆၧဒဲၩဘၭ လီၫ.",
			"5": "<sup>5</sup> ၦအဎၭအဆၧကိၪ့ထၪ့ဖၭလၩ့နီၪ ဘၪဆဲၫ့န့ၫဆၧအၪ ထၪ့အၪအၪလ့ၬး အ့ၪမွဲကယဲၦလၧအလထီးလၩ့ဘၪ ၥၭနီၪ မၩၡၪ့လၩ့ယၬလၩ့ဝ့ၫလီၫ.",
			"6": "<sup>6</sup> ဆၧလူဒိၪဎွ့ၩဒိၪ လၧၦန့ဘၪ လၧဖျ့ၩအဘျံၭအဘျၪ အကၠီၩ့နီၪ, မၩအၥၭဘဲၫဆၧအွံၩဒံၩခွံၬဒၪဆၧ, ၦအၪ့ ဎၬဆၧၥံၫလီၫၬ",
			"7": "<sup>7</sup> ၦလတီၩလလီၩ့ဘၪ အဆၧမၩဆီၪ့နီၪမိဝ့ၬလၩ့ဘံၭ အနၫ့ဆါၥံၪ, အဂဲးဘဲၫယီၩ ဆၧစ့ၩရၫ့တီၩနီၪ အဝ့ၫၥံၪ မၩအ့ၬ.",
			"8": "<sup>8</sup> ၦၡၩလၧအမၩကဲၪ့အဖၧၩ့ၥၭနီၪ ဂၭဖျိၭဝ့ၫဒၪတၭး အ့ၪမွဲၦအဆံၫ့နီၪ အဆၧမၩတီၩတီၩလီၩ့လီၩ့လီၫ.",
			"9": "<sup>9</sup> ၦအ့ၪအီၪလၧဂံၪ့ခိၪအနိၪ့ဖၧၩ့နီၪ, မွဲဆၧဂ့ၩနဲၪ့ဒံၭ အီၪလၧၦမုၪလဂၩ လၧအဂဲးလိၬတ့ၭလိၬ လၧဂံၪ့ဖၭ လဲဖၧၩ့ဒံၭလီၫ.",
			"10": "<sup>10</sup> ၦလတီၩလလီၩ့ဘၪ ဆိၫ့ဆၧအၧၩ့တၭး ၦအီၪလၧ အနဲၩ့ထံၭနီၪ န့ဘၪဆၧအခိးအတၩ လၧအမ့ၬၥၪဖၧၩ့ နးဆံၭအ့ၬ.",
			"11": "<sup>11</sup> ထီးၦမၩကြၩ့ထမးဆၧလဂၩ အ့ၪဘၪဆၧစ့ၩရၫ့စၪ နီၪ, ၦလၧအလမၩလိၪဘၪဆၧနီၪ န့ဘၪဆၧကိၪ့ၥ့ၪတၭး ထီးၦကိၪ့ၥ့ၪဘၪဆၧၥီၪ့လိၪဝ့ၫနီၪ, အဝ့ၫဒၪန့ဘၪဆၧ ၥ့ၪယၫလီၫ.",
			"12": "<sup>12</sup> ဆၧတီၩဆၧလီၩ့လဂၩနီၪ ယိထံၫယိဆၭၦလတီၩ လလီၩ့ဘၪအဂံၪ့တၭ, ခွံၬလၩ့ၦအၧၩ့ၥံၪ လၧဆၧဂၭ ဂီၩ့ဂၭစၪဖၧၩ့လီၫ.",
			"13": "<sup>13</sup> ၦၡၪ့ဖိၪယၬဖိၪ ကိၭထၪ့ဆၧအဘိၩ့ဘၭနီၪး ၦလဂၩ ဂၩအ့ၪဆွံၫဘံၭအနါဖၧၩ့တၭ, အဝ့ၫဒၪအနၫ့ဆါဒၪဝ့ၫ မိကိၭထၪ့လါနၫ့နီၪ, ဆၧနါဂၧၫ့ဝ့ၫအ့ၬ.",
			"14": "<sup>14</sup> ဆၧဖ့ၪလၫ့ၥူၪနီၪ ဒုၭလၩ့ဆါထဲၩ့ဆၧၥၭထၪ့း ဒဲလၬ ဆီၪ့လၧၥၭနၫၡါအဖၧၩ့နီၪ မၩလၩ့မါဆၧၥၭထၪ့ဆီၪ့ နီၪလီၫ.",
			"15": "<sup>15</sup> ဆၧစ့ၩရၫ့တီၩနီၪ မွဲဆၧၥုၪ့ထိၬၥၭထိၬ လၧၦတီၩၦ လီၩ့အဂး, အ့ၪမွဲဆၧဂၭဂီၩ့နီၪ အီၪလၧၦမၩအၧၩ့ဆၧ အဂးလီၫ.",
			"16": "<sup>16</sup> ၦလဂၩလၧအစဲၪ့ဒၪခွံၬ ဆၧကိၪ့ဘၪကိၪ့ၥ့ၪအဖၧၩ့ ၥၭနီၪ, မိအီၪဝ့ၫလၧၦၥံၫအလၩၥံၪ အဆၧအီၪကီၪ့အ ကျၩနီၪလီၫ.",
			"17": "<sup>17</sup> ၦလၧအအဲၪဆၧမုၬလၩနီၪ မိကဲၪထၪ့ၦၡၪ့ဖိၪယၬဖိၪ တၭးၦလၧအအဲၪစဘံၭထံၫဒဲၥိၪလဂၩနီၪ မိကဲၪၦၥထံၫ ဆ့အ့ၬ.",
			"18": "<sup>18</sup> ၦလတီၩလလီၩ့ဘၪၥံၪ မိကဲၪၦတီၩၦလီၩ့အဆၧဎွ့ၩ န့ထဲၩ့နီၪး ဒဲၦအၪ့လီၫဆၧ မိအီၪလၧၦတီၩအလးလီၫ.",
			"19": "<sup>19</sup> အ့ၪအီၪလၧထံၫၥံၪခးၥံၪအီၪယူဝ့ၫနီၪ, မွဲဆၧဂ့ၩနဲၪ့ ဒံၭအီၪလၧၦမုၪဂဲးလိၬတ့ၭလိၬ ဒဲၥၭထၪ့ဒၪဆၧဘဲၫနီၪ လဂၩအၥိၭလီၫ.",
			"20": "<sup>20</sup> ၥိၪဒဲဆၧလူဒိၪဎွ့ၩဒိၪ လၧအဘၪၦအၥၭနီၪ, အီၪလၧ ၦကိၪ့ဆၧၥ့ၪအဂံၪ့ဖၧၩ့တၭ, အ့ၪမွဲၦအဂီၩ့နီၪယုလၩ့ ခွံၬဝ့ၫလီၫ.",
			"21": "<sup>21</sup> ၦလၧအလီၩ့ဆီးဆၧတီၩဆၧလီၩ့ ဒဲဆၧအခိးအတၩ လဂၩနီၪ, မိဒၪန့ဆၧမၧၫ့, ဆၧတီၩဆၧလီၩ့, ဒဲဆၧလၩ ဆၧဖၩ့နီၪဆ့လီၫ.",
			"22": "<sup>22</sup> ၦကိၪ့ၥ့ၪလဂၩထၪ့ဘၭ လၧၦဆီၪ့ၥံၪအဒိၩ့အခိၪဒၧၩ့ အဖၫ့ခိၪနီၪ, ဒဲမၩလၩ့ဎီးခွံၬ အဆၧဂဲးဆၧဘၭ လၧ ဆၧဒိၭနဲၩ့အၥၭ လၧအဖၧၩ့နီၪလီၫ.",
			"23": "<sup>23</sup> ၦလၧအပၧၩ့အနိၭ ဒဲအဖျ့ၩလဂၩနီၪ, မၩဖီၩ့မၩဖျ့ၭ အၥၭလၧဆၧခိဆၧဝီၩၥံၪလီၫ.",
			"24": "<sup>24</sup> ၦလၧအမၩထၪ့ထီၫအၥၭ မၩဖိၫလိၫအၥၭနီၪ, အ မံၩ့မွဲၦမၩကြၩ့ထမးဆၧ, မၩဝ့ၫလၧအမၩဖိၫလိၫအၥၭ အၪလၨၪအဖၧၩ့လီၫ.",
			"25": "<sup>25</sup> ၦကၠႃၪ့အဆၧဆိၫ့န့ဘၪနီၪ မၩဂၭဂီၩ့အနၫ့ဆါးအဂဲး ဘဲၫယီၩ အစူၪၥံၪမၩဆၧနီၪ အၥၭအီၪအ့ၬ.",
			"26": "<sup>26</sup> အဝ့ၫလဂၩၥၭကွံၩဆိၫ့န့ဘၪဆၧၥံၫ့နံၩချီၩ့း အ့ၪမွဲၦ တီၩၦလီၩ့ၥံၪဖ့ၪလၫ့ဒၪဆၧတၭ, လီၫ့ကီၩ့ဆၧအ့ၬ.",
			"27": "<sup>27</sup> ၦလတီၩလလီၩ့ဘၪ အဆၧလုနီၪ မွဲဆၧၥၭလိၪတၭ, ၦလၧအဂဲၫဆိၬဝ့ၫ လၧဆၧကိၪ့ထၪ့ဖၭလၩ့အအၧၩ့နီၪ နၭနဲၪ့အနီၪဒံၭ, ဆံၭဒိၪလဲၪၬ",
			"28": "<sup>28</sup> ၦထိးအၥၭ အဘျံၭအဘျၪနီၪ မိဂၭဂီၩ့ဝ့ၫး အ့ၪမွဲၦ လၧအခိၭနၪဝ့ၫလဂၩနီၪ မိချဲၩ့ဆၧလထံၪဎးလဘီၩ့ ဎးလီၫ.",
			"29": "<sup>29</sup> ၦလတီၩလလီၩ့ဘၪလဂၩနီၪ မၩနီၩ့ထၪ့အမ့ၬး အ့ၪ မွဲၦအၥၭဆုးလီၩ့လဂၩ မိမၩဂုးထၪ့ခၧၫ့ထၪ့အဖၧၩ့ၥၭ ၥံၪလီၫ.",
			"30": "<sup>30</sup> လၧယဟိဝၩအမ့ၬယၫနီၪ, ဆၧကိၪ့ၥ့ၪကိၪ့ဘၪ, ဆၧၥုၪ့ဖၭၥၭဖၭ, ဆၧဒုၭကိၪ့ၥ့ၪနီၪ, အီၪအ့ၬ.",
			"31": "<sup>31</sup> ကၥ့ၪနီၪဘၪဆၧတဲၩ့ဝဲၩဝ့ၫ လၧဆၧဒုၭၥုၭမုနံၩအ ဂးလါနၫ့တၭ, ဆၧမၩဖီၩ့မၩဖျ့ၭနီၪ ဂဲၫလၧယဟိဝၩ လီၫ."
		},
		"22": {
			"1": "<sup>1</sup> ၦအၪ့ဎူၫအၪ့ဎၬအမံၩ့ဂ့ၩနီၪ မွဲဂ့ၩနဲၪ့ဒံၭဆၧလူဒိၪ ဎွ့ၩဒိၪဖၭဒိၪ, ဒဲဆၧအဲၪအခိးအတၩနီၪ, အၪနဲၪ့ဒံၭ ကျိၪၥံၪစ့ၩၥံၪ, ထီၫ့ၥံၪလွ့ၫၥံၪနီၪလီၫ.",
			"2": "<sup>2</sup> ၦၥထံၫၥံၪ ဒဲၦၡၪ့ဖိၪယၬဖိၪဒၪခီၩ့လိၬအၥၭတၭး မွဲ ယဟိဝၩတဲၩ့လၩ့အဝ့ၫၥံၪ ထီးအလူၬလီၫ.",
			"3": "<sup>3</sup> ၦၥ့ၪယၫ ထီးလၩ့အၥၭဂ့ၩလဂၩ ဒၪစိၩဆၧအၧၩ့, အီၪက့ၪၥူၪခွံၬအၥၭ, အ့ၪမွဲၦလၧအလမၩလိၪဘၪဆၧ လ့ၩဒၪဆၧဘဲၫနီၪတၭ, ဘၪဆၧၡၪ့ဆၧနၭလီၫ.",
			"4": "<sup>4</sup> ဆၧၥုၪ့ဆၧၩ့ၥၭဆၧၩ့ အခိးအတၩ, ဒဲဆၧၥၭမဲၪယ ဟိဝၩနီၪ, မွဲဆၧလူဒိၪဎွ့ၩဒိၪ, ဒဲဆၧလၩဖၩ့, ဒဲဆၧမၧၫ့ လီၫ.",
			"5": "<sup>5</sup> ဆၧဆူၪၥံၪ ဒဲဖျံၩခွၩ့ၥံၪအီၪဝ့ၫ လၧၦၥၭကဲၪ့အဖၧၩ့ ၥၭဖၧၩ့ ၦလၧအယိထဲၩ့ခွါထဲၩ့အၥၭနီၪ အီၪယဲၩ့လၧ ဆၧလဖၪနီၪလီၫ.",
			"6": "<sup>6</sup> ၥိၫ့ဖိၪၥၪလၧအဖၧၩ့ၥၭကြၨၭဆံၭ ထီးအၥၭၡါထၪ့ နီၪ, မိကၠၪခွံၬအၥၭအ့ၬ.",
			"7": "<sup>7</sup> ၦၥထံၫပၧၩ့ဘၪၦၡၪ့ဖိၪယၬဖိၪး ဒဲၦလၧအအၪ့လီး ဆၧနီၪကဲၪထၪ့စ့ၩကဆါအဎီးလီၫ.",
			"8": "<sup>8</sup> ၦလၧအဎွံၪဆၧအၧၩ့ဆၧၥၫ့လဂၩနီၪ, မိကူၭန့ဆၧ ၡၪ့ဆၧနၭး ဒဲနိၪထးလၧအဆၧအီၪက့ၪထၪ့ထီၫအၥၭ အဂးနီၪ, အီၪတဲၩ့ဝဲၩအၥၭလီၫ.",
			"9": "<sup>9</sup> ၦအီၪလၧမ့ၬၥၪယၫ့ၥၭဆၧလဂၩနီၪ, မိဘၪဆၧဆိၪ ဂ့ၩး အဂဲးဘဲၫယီၩ အကိၪနီၪဖ့ၪလၫ့ၦၡၪ့ဖိၪယၬဖိၪၥံၪ လီၫ.",
			"10": "<sup>10</sup> နၫ့ထၪ့ခွံၬ ၦလၧအချဲၩ့ကြၩ့ထမးဆၧတၭ, ဆၧဂဲးလိၬ တ့ၭလိၬနီၪ မိစဲၪ့ထၪ့ခွံၬဆ့တၭး ဆၧချဲၩ့ခွးဒဲဆၧဒုၪဒွ့ၪ နီၪမိလၩ့မါပံၭလီၫ.",
			"11": "<sup>11</sup> ၦလၧအအဲၪၦၡၩအၥၭဆံၫ့ဎံၪၥံၪနီၪ, အနိၭဖျံၩလ ဖၪမွဲဆၧအခိးအတၩ, ဒဲစဎွၩမိကဲၪထၪ့ အထံၩအၥိၭ လီၫ.",
			"12": "<sup>12</sup> ယဟိဝၩအမ့ၬၥၪ ခိၭထၬဆၧၥ့ၪယၫတၭ, အဝ့ၫဒၪ မၩလၩ့ချႃၬ ၦအၪ့လီၫဆၧအဆၧချဲၩ့ လဖၪနီၪလီၫ.",
			"13": "<sup>13</sup> ၦကၠႃၪ့လဂၩစံၭဝ့ၫ, ဆၬလၥၧၫ့လဒုၩ အီၪလၧခီၫ့ တၭး ဆၧမိမၩၥံၫယၧၩ လၧဖၧၩ့ၥၭၥံၪအဖၧၩ့နီၪလီၫ.",
			"14": "<sup>14</sup> ၦမုၪလၩ့မဲၩအနိၭနီၪ မွဲဆၧဖၧၩ့ယိၬတၭ, ၦလၧယ ဟိဝၩၥၭလိၪဝ့ၫလဂၩနီၪ မိလၩ့ထ့ၬလၧအဖၧၩ့လီၫ.",
			"15": "<sup>15</sup> ဆၧအဂီၩ့အီၪဘဲၩ့ဘီၩ့ထၬဝ့ၫ လၧဖိၪၥၪအၥၭခံဖၧၩ့ တၭး ဆၧအၪ့ၥီၪ့အနိၪဖျ့ၪနီၪ မိနၫ့ယဲၩ့ထၪ့ခွံၬဝ့ၫ လၧအ အီၪလီၫ.",
			"16": "<sup>16</sup> ၦလၧအမၩနၧၩ့မၩစၪ ၦၡၪ့ဖိၪယၬဖိၪၥံၪ, ဘဲၫၥိၭအ မိမၩအၪထၪ့ဆၧ လၧအနၫ့ဆါအဂးနီၪ, မွဲၦလၧအဖ့ၪ လၫ့ၦၥထံၫတၭ, မိဘၪတၡါ ဆၧၡၪ့ဆၧနၭဆ့လီၫ.",
			"17": "<sup>17</sup> ဒိၭနနါတၭ, ခိၭနၪၦကိၪ့ၥ့ၪအဆၧချဲၩ့လဖၪး ဒဲအီၪ",
			"18": "<sup>18</sup> က့ၪနၥၭလၧယဆၧၥ့ၪယၫနီၪဆံၭ.- အဂဲးဘဲၫယီၩန အ့ၪအီၪက့ၪထၬဝ့ၫ လၧနၥၭခံဖၧၩ့နီၪ, အ့ၪအီၪတဲၩ့ဝဲၩ",
			"19": "<sup>19</sup> အၥၭလၧနနိၭဖျံၩအလီၩ့နီၪ, မွဲဆၧအမုၬလီၫ.- ဘဲၫၥိၭ နမိဒိၭနဲၩ့နၥၭ လၧယဟိဝၩအဖၧၩ့နီၪး ယၥီၪ့ထဲၩ့ၥၫ့",
			"20": "<sup>20</sup> ထဲၩ့နၧၩမုဆၫလနံၩယီၩ, မွဲမၬနၧၩဒၪလ့ၬလီၫ.- ယ ကွ့ၭန့ဝဲၩယူၭနၧၩ လၧဆၧအဂ့ၩဖ့ၪယူ လၧနဂး, လၧ",
			"21": "<sup>21</sup> ဆၧၥ့ၪယၫဒဲဆၧဒုၭကိၪ့လဖၪး- ဘဲၫၥိၭယမိဒုၭၥ့ၪယၫ နၧၩလၧဆၧမွဲဆၧတီၩ လၩ့ထံးလၩ့ဆ့ၭ, ဘဲၫၥိၭနမိချဲၩ့ ဆၧၫ့ဆၧမွဲဆၧတီၩ လၧၦလၧအအၪ့မၧၫ့နၧၩနီၪ မွဲအ့ၬ ဧၪ.",
			"22": "<sup>22</sup> ၦၡၪ့ဖိၪယၬဖိၪ, လၧအဘၪၡၪ့ဘၪယၬ အကၠီၩ့နီၪ, ထီးအၪ့ဂူၬန့အဆၧလဂ့ၩး ဒဲၦၡၪ့ဖိၪယၬဖိၪလၧတရၫ့",
			"23": "<sup>23</sup> ဖၧၩ့လဖၪနီၪ, ထီးမၩအၧၩ့မၩနၭဝ့ၫလဂ့ၩ.- အဂဲးဘဲၫ ယီၩယဟိဝၩ မိချဲၩ့အဝ့ၫၥံၪအခွးတၭ မိအၪ့ဂူၬန့ဆီၪ့ ၦအၥၭမၧၫ့ လၧအအၪ့ဂူၬန့ဆီၪ့ အဝ့ၫၥံၪအဆၧလီၫ.",
			"24": "<sup>24</sup> ထီးထၧၫ့ထံၩထၧၫ့ၥိၭ လၧၦၡၩအၥၭထၪ့ချဲၫ့နီၪလ ဂ့ၩး ဒဲထီးလ့ၩဆၧ လၧၦၥၭထၪ့ယုၩယါအၥိၭ နးဂၩ",
			"25": "<sup>25</sup> လဂ့ၩး- နမိမၩလိၪဘၪခိၬ အဝ့ၫဒၪအဖၧၩ့ၥၭၥံၪ, ဒဲန ၥၭမိဘၪဘၪခိၬ ဖျံၩခွၩ့နီၪဆ့လီၫ.",
			"26": "<sup>26</sup> ထီးကဲၪထၪ့ၦလဂၩ လၧအဖီၪ့လိၬၦအစူၪနီၪးဒဲၦ",
			"27": "<sup>27</sup> လၧအထိးအၥၭ လၧၦအဒ့ၪအမါအဂးနီၪလဂ့ၩ.- န လိၭထဲၩ့ဆၧနီၪအ့ၪလအီၪဘၪနးမံၩ့တၭ, အဝ့ၫမိမၩ န့နလးမံၫ လၧနဖၫ့လၬနီၪ မွဲဘၪလဲၪၬ",
			"28": "<sup>28</sup> ခးဆၧၫ့အဆၧမၩနဲၪ့, လၧနဖါၥံၪ အီၪက့ၪလၩ့ဝ့ၫ လၧဖျိၩ့နီၪ, ထီးၥုၭခွံၬလဂ့ၩ.",
			"29": "<sup>29</sup> ၦအဎၭလၧအမၩကၩအဖၧၩ့နီၪ, မွဲနဒၪဘၪဆ့ဧၪ, အဝ့ၫဒၪမိဆၧၫ့ထုၪ့ လၧစဎွၩၥံၪအမ့ၬယၫ, မိဆၧၫ့ထုၪ့ လၧၦအန့ၬလဖၪ အမ့ၬယၫနီၪအ့ၬ."
		},
		"23": {
			"1": "<sup>1</sup> ထီးနအ့ၪဆၧၫ့နၩ့အၪ့ဆၧ လၧၦဒိၪဖၭဒိၪအၥိၭနီၪး",
			"2": "<sup>2</sup> ယိထံၫယိဆၭဆၧ လၧအအီၪလၧနမ့ၬယၫနီၪး- နအ့ၪ မွဲၦလၧအအၪ့ဆၧဆီၪ့တၭ, အီၪက့ၪဒီၩလၧနခိၬနီၪ",
			"3": "<sup>3</sup> ဘီၪး- ထီးဆိၫ့န့ဘၪ အဆၧအၪ့အွံၪၥံၪနီၪလဂ့ၩ, အ ဂဲးဘဲၫယီၩ မွဲဆၧအၪ့လၧအၪ့လီၫဆၧလီၫ.",
			"4": "<sup>4</sup> ဘဲၫၥိၭနမိကဲၪၦၥထံၫနီၪ ထီးမၩလဂ့ၩး ထီးဒိၭနဲၩ့",
			"5": "<sup>5</sup> နၥၭလၧနၥုၪ့ဖၭၥၭဖၭဒၪနဝ့ၫနီၪလဂ့ၩ.- မွဲနမိဒုၭယိ နမ့ၬလၧဆၧလၧ အလမွဲဘၪဆၧနးမံၩ့နီၪဆ့ဧၪး အဂဲး ဘဲၫယီၩ မိထၫ့ထၪ့တၡါအဒံၭၥံၪ လၧအဂးဒၪဝ့ၫယူၩ ထၪ့လၧဆၧဖိၭဖၫ့ ဘဲၫလံၬကျီၫ့ကျီၫ့ၥံၪအၥိၭလီၫ.",
			"6": "<sup>6</sup> ၦမ့ၬၥၪအၧၩ့အကိၪနီၪ ထီးအၪ့လဂ့ၩ, ဒဲထီးဆိၫ့န့",
			"7": "<sup>7</sup> ဘၪအဆၧအၪ့အွံၪၥံၪလဂ့ၩ.- အဂဲးဘဲၫယီၩ ဘဲၫအ ဆီၫ့မီၪ့ဆၧ လၧအၥၭခံဖၧၩ့အၥိၭနီၪ, မွဲဝ့ၫဘဲၫနီၪၥိၭ ဆ့း မိစံၭနၧၩ, အၪ့ဆၧအီၩဆၧဘီၪး မွဲလါနၫ့ဘိၩအ",
			"8": "<sup>8</sup> ၥၭအီၪနၧၩအ့ၬ.- ဆၧလၧနအၪ့ဘၪနီၪ, နမိပၠိၭထၪ့ခွံၬ ဝ့ၫတၭ, နဆၧချဲၩ့မုၬလဖၪ မိလၩ့မါပံၭလီၫ.",
			"9": "<sup>9</sup> ထီးချဲၩ့ဆၧလၧၦအဂီၩ့အနါဖၧၩ့လဂ့ၩး အဂဲးဘဲၫ ယီၩ အဝ့ၫနီၪမိမၩကြၩ့ထမး နဆၧချဲၩ့လဖၪ အဆၧ ကိၪ့ဘၪကိၪ့ၥ့ၪလီၫ.",
			"10": "<sup>10</sup> ခးဆၧၫ့အဆၧမၩနဲၪ့ လၧဖျိၩ့လံၩလံၩနီၪ, ထီးၥုၭ ခွံၬလဂ့ၩး တၭထီးနုၬလၧဖိၪဎွ့ၪၥံၪ အဂၪ့ခိၪအဝၩ့ဖၧၩ့",
			"11": "<sup>11</sup> နီၪလဂ့ၩ.- အဂဲးဘဲၫယီၩ ၦလၧအမၩဖီၩ့ဖျ့ၭအဝ့ၫၥံၪ လဂၩနီၪ, အဂဲးဆီၪ့အဘၭဆီၪ့တၭး အဝ့ၫဒၪမိချဲၩ့အ ဝ့ၫၥံၪအခွးလၧနၧၩလီၫ.",
			"12": "<sup>12</sup> အီၪက့ၪနၥၭလၧဆၧၥီၪ့လိၪ လခီၫနီၪဒဲဒိၭနနါၥံၪလၧ ဆၧၥ့ၪယၫအဆၧချဲၩ့လဖၪနီၪဆံၭ.",
			"13": "<sup>13</sup> ထီးပဒၩ့ဆၧအၪ့ၥီၪ့ဖိၪၥၪနီၪလဂ့ၩး အဂဲးဘဲၫယီၩ",
			"14": "<sup>14</sup> နအ့ၪဖျ့ၪအဝ့ၫလၧနိၪဖျ့ၪနီၪတၭ, မိၥံၫအ့ၬ.- နဝ့ၫဒၪန ဖျ့ၪအဝ့ၫလၧနိၪဖျ့ၪလါနၫ့ဘဲၫနီၪတၭ, အၥၭမၧၫ့နီၪ မၩဖီၩ့မၩဖျ့ၭလၧဖျႃဖၧၩ့လီၫ.",
			"15": "<sup>15</sup> ယဖိၪခွၫဧ့, နၥၭအ့ၪကိၪ့ၥ့ၪနီၪ, ယၥၭမိၥုၪ့ဎွံၫၥၭ",
			"16": "<sup>16</sup> ယီၫ, မွဲမၬ, ယၥၭဒၪယဝ့ၫလီၫ.- ထီးနနိၭဖျံၩၥံၪမိ ချဲၩ့ဆၧအတီၩအလီၩ့လဖၪနီၪ, ယၥုၪ့ထိၬၥၭထိၬဒိၪ",
			"17": "<sup>17</sup> မၬလီၫ.- ထီးၥၭခ့ၬၦဒဲၩဘၭဖိၪၥံၪလဂ့ၩး အ့ၪမွဲအီၪ",
			"18": "<sup>18</sup> လၧဆၧၥၭမဲၪယဟိဝၩအဖၧၩ့ ၥံၫ့ၥံၫ့နံၩဆံၭ.- အဂဲး ဘဲၫယီၩဆၧအထုၬနီၪ အ့ၪအီၪဝ့ၫတၭ, ထီးနီၪလဖၧၫ့န ဆၧယိလါနီၪ မိဘၪဆၧဒၪ့ထ့ၬခွံၬဝ့ၫဆ့အ့ၬ.",
			"19": "<sup>19</sup> ယဖိၪခွၫဧ့, ခိၭနၪနဝ့ၫ, ဒဲအီၪလၧဆၧကိၪ့ၥ့ၪး ဒဲၥိၫ့န",
			"20": "<sup>20</sup> ၥၭလၧဖၧၩ့ၥၭဖၧၩ့ အ့ၪလီၩ့ဘီၪ.- လၧၦအီၩလၨၪစ ဘံၭထံၫအကျၩနီၪး ဒဲလၧၦလၧအလူၬပျီၩပျီၩအဖံၭ",
			"21": "<sup>21</sup> အယၪဒၪဝ့ၫအကျၩ, ထီးအီၪလဂ့ၩး- အဂဲးဘဲၫယီၩ ၦလၧအအီၩမၧၩ့အၥၭ, ဒဲၦလူၬဆၧပျီၩပျီၩနီၪ, မိဘၪ ၡၪ့ဘၪယၬတၭး ဆၧမံၫခံၫ့နီၪ မိဒုၭကီၩ့ထၪ့ၦၡၩလၧ ဆၧကီၩ့ဆၧၥိၭယၬလီၫ.",
			"22": "<sup>22</sup> ခိၭနၪနဖါလၧအထၪ့ဖိၪနၧၩအလူဆံၭး ဒဲနမိနီၪထီး",
			"23": "<sup>23</sup> အ့ၪၥၭၡါထၪ့တၭ, ထီးမၩကြၩ့ထမးလဂ့ၩ.- ဎွ့ၩန့ ဆၧမွဲဆၧတီၩတၭ, ထီးအၪ့ဆၫခွံၬလဂ့ၩး ဆၧကိၪ့ဘၪ ကိၪ့ၥ့ၪ, ဒဲဆၧၥီၪ့ဆၧၥၫ့, ဒဲဆၧၥုၪ့ဖၭၥၭဖၭနီၪဆ့ဆံၭ.",
			"24": "<sup>24</sup> ၦတီၩၦလီၩ့အဖါ မိၥုၪ့ထိၬၥၭထိၬဖၭဒိၪတၭး ၦလၧ အထၪ့ဖိၪၦလဂၩအီၪ လၧဆၧကိၪ့ၥ့ၪနီၪ, မိၥၭထိၬလၧ",
			"25": "<sup>25</sup> အဝ့ၫဒၪအကၠီၩ့လီၫ.- မွဲနမိဒဲနဖါၥံၪ ၥုၪ့ထိၬၥၭထိၬးဒဲ ၦလၧအဆီၫ့အီၪန့နၧၩလဂၩနီၪ, မွဲအၥုၪ့ဎွံၫၥၭယီၫဖၭ ဒိၭဆံၭ.",
			"26": "<sup>26</sup> ယဖိၪခွၫဧ့, ဖ့ၪလၫ့ယၧၩလၧနၥၭဆံၭး တၭနမ့ၬၥၪ ၥံၪ, မွဲအမုၬလၩဝ့ၫ လၧယဖၧၩ့ၥၭၥံၪအဖၧၩ့နီၪဆံၭ.",
			"27": "<sup>27</sup> အဂဲးဘဲၫယီၩ ၦမဲၩဎွဲၩမုၪနီၪ မွဲဆၧဖၧၩ့ယိၬ, ဒဲၦမုၪ",
			"28": "<sup>28</sup> လၩ့မဲၩနီၪ, မွဲဆၧဖၧၩ့အံၪ့ခိၬလီၫ.- မွဲမၬ, အဝ့ၫဒၪအီၪ ခိၭၥူၪဝ့ၫ, ဘဲၫလၧဆၧအၪ့ဂူၬန့ဆီၪ့အၥိၭတၭ, ဒုၭအၪ ထၪ့ၦလၧအမၩမၪဆၧ လၧၦၡၩခွၫအကျၩအၪအၪလ့ၬ လီၫ.",
			"29": "<sup>29</sup> မွဲပလၫအီၪဝ့ၫ လၧဆၧခိဆၧဝီၩလဂၩလဲၪၬ မွဲပလၫ ဘၪဆၧၡၪ့ဆၧနၭလဂၩလဲၪၬ မွဲပလၫအီၪဝ့ၫလၧဆၧ ဂဲးလိၬတ့ၭလိၬလဖၪလဲၪၬ မွဲပလၫၥူၭဝံၪၥူၭလၩဆၧ လဖၪလဲၪၬ မွဲပလၫလဘၪဘၪဆၧနးမံၩ့တၭ အီၪလၧ ဖၧၩ့လးၥံၪလဖၪလဲၪၬ မွဲပလၫအီၪလၧအမ့ၬၥၪဝီၩလ",
			"30": "<sup>30</sup> ဖၪလဲၪၬ- မွဲၦလၧအအီၪယံၬ လၧစဘံၭထံၫအနဲၩ့ထံၭ, ၦလၧအအၪ့ဎူၫအၪ့ဎၬ စဘံၭထံၫ လၧအလဲၩဎုၬအၥၭ နီၪလီၫ.",
			"31": "<sup>31</sup> ထီးစဘံၭထံၫနီၪအ့ၪဝီၩထၪ့တၭ, ထီးအဖ့ၪလၫ့အ လွ့လၧထွ့ၫဖၧၩ့နီၪ, ထီးအမၩဂဲၩဒၪအၥၭ လၧအဘၪ",
			"32": "<sup>32</sup> နီၪ, ထီးယိလဂ့ၩ.- လၧအထုၬနီၪ မိအဲၪ့ဆၧဘဲၫဂူအ",
			"33": "<sup>33</sup> ၥိၭ, ဒဲဖျၭဆၧဘဲၫဂူပွ့ၩအၥိၭနီၪလီၫ.- နမ့ၬၥၪမိယိၦ မုၪလၩ့မဲၩနီၪ, ဒဲနၥၭမိဒုၭထၪ့ဖျ့ၭ ဆၧအၪ့လီၫဝ့ၫလၧ",
			"34": "<sup>34</sup> နနိၭဖၧၩ့လီၫ.- နမိအီၪဘဲၫၦလဂၩ လၧအမံၫမၪဝ့ၫလၧ မၫဆမံၭအၥၭခံဖၧၩ့အၥိၭနီၪ, ဒဲဘဲၫၦလၧအမံၫနၩ့မံၫ",
			"35": "<sup>35</sup> ခံၫ့ဝ့ၫလၧယါထုၪ့ခံၫအၥိၭနီၪလီၫ.- နမိစံၭ, ၦလဖၪ ထးယၧၩလါနၫ့, ယဆၫအ့ၬး ဒိၪဝ့ၫထးဝ့ၫလါနၫ့ယ ၥ့ၪယၫအ့ၬး ဆံၭယံၬယမိနၪ့ထၪ့ယၥၭလဲၪၬ တၭယမိ အၪ့ဎူၫအၪ့ဎၬဒံၭ နးဖၧၫ့ဒံၭလီၫ."
		},
		"24": {
			"1": "<sup>1</sup> ၦအၧၩ့ၥံၪထီးၥၭခ့ၬလဂ့ၩး ဒဲထီးဆိၫ့အီၪလၧအဝ့ၫ",
			"2": "<sup>2</sup> ၥံၪအကျၩလဂ့ၩ.- အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪအၥၭကိၪ့ ထၪ့ဖၭလၩ့ဆၧမၩဆီၪ့တၭ, အဝ့ၫၥံၪအနိၭဖျံၩၥံၪချဲၩ့ ဆၧမၩဂၭဂီၩ့ဆ့လီၫ.",
			"3": "<sup>3</sup> ဆၧမၩထၪ့ဂံၪ့ လၧဆၧကိၪ့ဘၪကိၪ့ၥ့ၪအကၠီၩ့း ဒဲလၧ ဆၧၥုၪ့ဖၭၥၭဖၭအကၠီၩ့ မိဂုးထၪ့ခၧၫ့ထၪ့ဝ့ၫဒၪလီၫ.",
			"4": "<sup>4</sup> ဒဲလၧဆၧၥ့ၪယၫအကၠီၩ့နီၪ, ဖၫ့ၥံၪဘၪဆၧမၩဎွ့ၩထၪ့ ဝ့ၫလၧကယဲဆၧဂ့ၩလဖၪ ဒဲဆၧအဎၧၩ့အဎီ လၧအလူ ဒိၪဎွ့ၩဒိၪလီၫ.",
			"5": "<sup>5</sup> ၦကိၪ့ၥ့ၪလဂၩနီၪ အီၪလၧဂဲးဆီၪ့ဘၭဆီၪ့ဒဲၦၥုၪ့ဖၭ",
			"6": "<sup>6</sup> ၥၭဖၭလဂၩနီၪ အဂဲးအဘၭအၪထၪ့ဝ့ၫလီၫ.- အဂဲး ဘဲၫယီၩ နမိဒုၭဘၪၥုၭလၧဆၧကိၪ့ၥ့ၪ အဆၧၥိၫ့ဝ့ၫအ ကၠီၩ့, ဒဲလၧၦဒုၭကိၪ့ဆၧအၪဂၩအကၠီၩ့နီၪ ဆၧဂုးဂုး ခၧၫ့ခၧၫ့အီၪဝ့ၫလီၫ.",
			"7": "<sup>7</sup> ဆၧကိၪ့ဘၪကိၪ့ၥ့ၪ အီၪထၪ့ထီၫလၨၪလၧၦအဂီၩ့ အဂးနီၪ အဝ့ၫဒၪအၩ့ထၪ့အနိၭ လၧတရၫ့ဖၧၩ့နီၪအ့ၬ.",
			"8": "<sup>8</sup> ၦလဂၩဂၩအ့ၪကိၪ့ထၪ့မၩဆၧအၧၩ့နီၪ, ဆၧမိကိၭ ဝ့ၫၦမၩဂၭဂီၩ့ဆၧလီၫ.",
			"9": "<sup>9</sup> ဆၧဂီၩ့အဆၧကိၪ့ထၪ့ဖၭလၩ့နီၪ, မွဲဆၧဒဲၩဘၭတၭ, ၦချဲၩ့ကြၩ့ထမးဆၧလဂၩ, မွဲဆၧၥၭလိၪလၧၦၡၩၥံၪ အမ့ၬယၫလီၫ.",
			"10": "<sup>10</sup> လၧဆၧၡၪ့ဆၧနၭမုနံၩအဖၧၩ့နီၪ, နၥၭအ့ၪလၩ့ဘဲၩ တၭ, နဂဲးနဘၭအီၪလဆံၭဖိၪလီၫ.",
			"11": "<sup>11</sup> ၦလၧဆၧအီၪက့ၪဝ့ၫ လၧဆၧၥံၫအဂးနီၪ, ဒဲၦအီၪ ဘူၭလၧဆၧမိမၩၥံၫဝ့ၫး မွဲနမိမၩဘိၭမၩဆၧၩ့အ့ၬဧၪ.",
			"12": "<sup>12</sup> အဂဲးဘဲၫယီၩ နအ့ၪစံၭ, ယိခွါ, ဆၧလမံၩ့ယီၩ, ပၥ့ၪ ယၫအ့ၬတၭး ၦလၧအမၩခွါၦၡၩအၥၭၥံၪနီၪ, အဝ့ၫ ဒၪမိဒၪဘၪအ့ၬဧၪး ဒဲၦလၧအယိထဲၩ့ခွါထဲၩ့နၥၭမၧၫ့ လဂၩနီၪ, မွဲအဝ့ၫလဂၩမိၥ့ၪယၫဆၧအ့ၬဧၪး တၭအ ဝ့ၫလဂၩ ဖ့ၪထဲၩ့ၦၡၩဆၧလၧအကြၨၭဘဲၫအမၩဆၧ အၥိၭနီၪဆ့လီၫ.",
			"13": "<sup>13</sup> ယဖိၪခွၫဧ့, အၪ့န့ၫစၩ့ဘီၪ, အဂဲးဘဲၫယီၩမွဲဆၧဂ့ၩ",
			"14": "<sup>14</sup> ဒဲန့ၫစၩ့လၩ့ဆၩ့ၥံၪ ဆၧၫ့လၧခိၬဖၧၩ့အဂးလီၫ.- ဘဲၫ နီၪၥိၭမၩလိၪ ဆၧကိၪ့ဘၪကိၪ့ၥ့ၪ လၧနၥၭအဂးဆံၭး နအ့ၪဒၪဘၪတၭ, ထီးနီၪလဖၧၫ့ ထီးမုနံၩထုၬမိအီၪဝ့ၫ တၭ, နဆၧယိလါၥံၪ မိဘၪဆၧဒၪ့ထ့ၬခွံၬအ့ၬ.",
			"15": "<sup>15</sup> ၦလတီၩလလီၩ့ဘၪလဂၩဧ့, လၧၦတီၩၦလီၩ့အဂံၪ့ နီၪ, ထီးအီၪခိၭၥူၪလဂ့ၩ ထီးမၩဂၭဂီၩ့အဆၧအီၪပွံၭ",
			"16": "<sup>16</sup> အလးနီၪလဂ့ၩ.- အဂဲးဘဲၫယီၩ ၦတီၩၦလီၩ့လၩ့ထံၩ ဖါနွ့ၫဘျၩ့လါနၫ့တၭ, မိဂဲထုၪ့ထဲၩ့ဒီၭ, အ့ၪမွဲၦလတီၩ လလီၩ့ဘၪနီၪ မိလၩ့ထံၩဖါ လၧဆၧဂၭဂီၩ့အဖၧၩ့လီၫ.",
			"17": "<sup>17</sup> ထီးနဒုၪနဒၩအ့ၪလၩ့ထံၩဖါနီၪ, ထီးၥုၪ့ထိၬၥၭထိၬ လဂ့ၩး အခၪ့အ့ၪဘၪထၧၩ့တၭ, ထီးၥုၪ့ဎွံၫၥၭယီၫလ",
			"18": "<sup>18</sup> ဂ့ၩ.- ယဟိဝၩမိဒၪဘၪခိၬတၭ, မိကဲၪဆၧအၧၩ့လၧ အမ့ၬၥၪဖၧၩ့, ဒဲအမိဒုၭကၠၪခွံၬ အဆၧၥၭထၪ့ လၧအ ဝ့ၫလဂၩနီၪလီၫ.",
			"19": "<sup>19</sup> ထီးမၩခိနၥၭ လၧၦမၩဆၧအၧၩ့အကၠီၩ့နီၪလဂ့ၩး",
			"20": "<sup>20</sup> ထီးၥၭခ့ၬၦလတီၩလလီၩ့ဘၪလဖၪနီၪလဂ့ၩ.- အဂဲးဘဲၫ ယီၩဆၧအလံၩ့အလဲၫ လၧၦအၧၩ့ဖိၪၥံၪအဂးအီၪအ့ၬး ၦလတီၩလလီၩ့ဘၪအမ့ၪဒိၩ့ မိဘၪဆၧမၩလၩ့ဖံၬခွံၬ ဝ့ၫလီၫ.",
			"21": "<sup>21</sup> ယဖိၪခွၫဧ့, ၥၭမဲၪယဟိဝၩ ဒဲစဎွၩဆံၭး ထီးထၧၫ့ ထံၩထၧၫ့ၥိၭ လၧၦလၧအမၩ ကဒံၩကဒၩ အၥၭနီၪလ",
			"22": "<sup>22</sup> ဂ့ၩ.- အဂဲးဘဲၫယီၩ အဝ့ၫၥံၪအဆၧၡၪ့ဆၧနၭ မိဂဲထုၪ့ ရှုၭဝ့ၫတၭး အဝ့ၫၥံၪနံၫဂၩလူၬနီၪ မွဲပလၫၥ့ၪယၫအ ဆၧဂၭဂီၩ့လဂၩလဲၪ.",
			"23": "<sup>23</sup> ဆၧယီၩလဖၪဆ့ ဘၪဆဲၫ့လၧၦကိၪ့ဘၪကိၪ့ၥ့ၪလီၫ.",
			"24": "<sup>24</sup> လၧဆၧစ့ၩရၫ့အဖၧၩ့နီၪ ဆၧယိမ့ၬၦၡၩဂ့ၩအ့ၬ.- ၦလ ဂၩလၧအစံၭ ၦလတီၩလလီၩ့ဘၪနီၪ, နဝ့ၫဒၪနမွဲၦအ တီၩအလီၩ့, တၭၦခမျၧးၥံၪ မိဆိၪအၧၩ့အဝ့ၫဒၪ, ၦ",
			"25": "<sup>25</sup> ဆၨၩၥံၪအီၪက့ၪၥၭလိၪခွံၬဝ့ၫဒၪလီၫ.- အ့ၪမွဲၦလၧအ အၪ့ၥီၪ့ဝ့ၫနီၪ မိန့ဘၪဆၧမုၬလၩး ဒဲၦဂ့ၩၥံၪအဆၧဆိၪ ဂ့ၩနီၪမိဘၪအလီၩ့လီၫ.",
			"26": "<sup>26</sup> ၦၡၩမိအဲၪဂါ ၦလၧအချဲၩ့ဆၧၫ့ဆၧလၧဆၧချဲၩ့အ တီၩအလီၩ့လဖၪနီၪလီၫ.",
			"27": "<sup>27</sup> တဲၩ့ဝဲၩနဆၧမၩလၧခီၫ့တၭ, မၩဆၧလၧနနၫ့ဆါအ ဂးလၧဆံၬၥံၪနၩၥံၪအဖၧၩ့တၭး ထီးနီၪလဖၧၫ့, လၧ အလးခဲၫ့နီၪ, မၩထၪ့နဂံၪ့ဘီၪ.",
			"28": "<sup>28</sup> ထီးအလးအ့ၪလအီၪဘၪနီၪ, ထီးထိးနၥၭ ထၫ့ဒၩ ၦလၧနနဲၩ့ထံၭနီၪလဂ့ၩး အဂဲးဘဲၫယီၩ မွဲနမိအၪ့လီၫ ဆၧလၧနနိၭဖျံၩၥံၪဆ့ဧၪ.",
			"29": "<sup>29</sup> ဘဲၫအဝ့ၫလဂၩမၩယၧၩအၥိၭ, ယမိမၩအဝ့ၫဘဲၫ နီၪအၥိၭဆ့း ယမိမၩဆၧၩ့ၦၡၩ ဘဲၫအမၩဆၧအၥိၭ နီၪတၭ, ထီးစံၭလဂ့ၩ.",
			"30": "<sup>30</sup> ယလ့ၩလၧၦကၠႃၪ့ အဆံၬအနၩအနဲၩ့ထံၭး ဒဲလၧၦ အၥုၪ့ဖၭၥၭဖၭလအီၪဘၪနီၪ, အစဘံၭလးအနဲၩ့ထံၭ",
			"31": "<sup>31</sup> တၭ,- ယိခွါ, လၭဆၫၥံၪဒဲနၪ့ၥံၪခဲၪဘံၭခွံၬတၭ, ဆၧ ဆူၪဆၧမဲၪအီၪဝ့ၫ လၧအဖၫ့ခိၪထၧၫ့ဘံၪ့ယၫ, ဒဲအခိၪဒၧၩ့လိးနီၪ လၩ့ဎီးခွံၬဝ့ၫဒၪလီၫ.-",
			"32": "<sup>32</sup> ထီးနီၪလဖၧၫ့ယယိ ဆၧတၭ, ယဆီၫ့မီၪ့ဆၧ ထံၫထံၫဆၭဆၭတၭ, ယဒၪ",
			"33": "<sup>33</sup> ဘၪတၭယဒိၭန့ဆၧၥီၪ့ဆၧၥၫ့လီၫ.-",
			"34": "<sup>34</sup> မံၫလဆံၭ, မံၫခံၫ့ လဆံၭဆံၭ, ချံၭလၩ့စူၪလၧဆၧအီၪပွံၭအဂး, တၭဆၧ ၡၪ့ဆၧယၬမိဂဲၫဘၪနၧၩ, ဘဲၫထမျၬအၥိၭ, ဒဲဆၧမၩခိ မၩဝီၩနၧၩ ဘဲၫၦအီၪလၧစူၪဝဲၩအၥိၭနီၪလီၫ."
		},
		"25": {
			"1": "<sup>1</sup> အယီၩမွဲစစီလမၧၫ့ အဆၧချဲၩ့ဒီၩ့လၩ့ၥံၪး လၧယု ဒၫအစဎွၩဟ့ၭဇကဲအၫ အခ့ၫအၡၩၥံၪ ကွ့ၭဆဲၫဝ့ၫဒၪ နီၪလီၫ.",
			"2": "<sup>2</sup> ယွၩအလၩအဖၩ့နီၪ မွဲအအီၪက့ၪၥူၪခွံၬ ဆၧလမံၩ့ တၭ, အ့ၪမွဲစဎွၩၥံၪအလၩအဖၩ့နီၪ, မွဲအအၪ့ဎူၫအၪ့ ဎၬနဲၪဖျီၪထၪ့ဆၧလီၫ.",
			"3": "<sup>3</sup> မူၭခိၪလၧဆၧထၪ့ထီၫအဂး, ဂၪ့ခိၪလၧဆၧယိၬအ ဂး ဒဲစဎွၩၥံၪအၥၭ, မွဲဆၧလၧၦအၪ့ဎူၫအၪ့ဎၬၥ့ၪယၫ လၥ့ၪဘၪလီၫ.",
			"4": "<sup>4</sup> မၩန့ခွံၬစ့ၩ အအ့ၪလၧစ့ၩအဖၧၩ့နီၪတၭ, ၦၥိၫ့ဆၧ",
			"5": "<sup>5</sup> လဂၩနီၪ ဒုၭကဲၪထၪ့ထွ့ၫၥ့ၪလီၫ.- မၩန့ခွံၬၦလတီၩ လလီၩ့ဘၪ လၧစဎွၩအမ့ၬယၫနီၪ, အလးဆီၩ့ဆီမိအီၪ ဂုးခၧၫ့ လၧဆၧတီၩဆၧလီၩ့အဖၧၩ့လီၫ.",
			"6": "<sup>6</sup> ထီးမၩထၪ့ထီၫနၥၭ လၧစဎွၩအမ့ၬယၫနီၪလဂ့ၩး",
			"7": "<sup>7</sup> ဒဲလၧၦဒိၪၥံၪအလးနီၪ, ထီးဆၧၫ့ထုၪ့လဂ့ၩ.- အဂဲး ဘဲၫယီၩ ၦလဂၩစံၭနၧၩ ဂဲၫထၪ့လၧထၭယီၩဘီၪးမွဲ ဆၧဂ့ၩနဲၪ့ဒံၭ လၧဆၧဒုၭလ့ၩလၩ့နၧၩ လၧလၬလဆၫ့ လၧၦဒိၪဖၭဒိၪအမ့ၬယၫနီၪ, ၦလဂၩလၧနဒၪဘၪလၧ နမ့ၬၥၪလီၫ.",
			"8": "<sup>8</sup> ထီးလ့ၩထၪ့ချဲၫ့ဘဲၫၥိၭနမိချဲၩ့ခွးနီၪလဂ့ၩး ထီးၦ လၧနနဲၩ့ထံၭလဂၩ အ့ၪဒုၭမ့ၬမဲနၧၩတၭ, နမိမၩဘဲၫ ၥ့ၪလဲၪ.",
			"9": "<sup>9</sup> ကၩ့ကၩဒၪခလူၬနမူၭဒၪနဝ့ၫ လၧၦအီၪလၧနနဲၩ့ထံၭ အနၫ့ဆါအၥိၭဆံၭး ထီးဒုၭဖျီၪထၪ့ၦဂူၫဂၩ အဆၧအီၪ",
			"10": "<sup>10</sup> ၥူၪနီၪလဂ့ၩ.- ဘၪလဘၪၦလၧအနါဂၧၫ့ဝ့ၫနီၪ မိဒုၭမ့ၬ မဲနၧၩတၭ, နလၩနဖၩ့မိလၩ့မါခွံၬလီၫ.",
			"11": "<sup>11</sup> ဆၧချဲၩ့လၧၦချဲၩ့ထီးအဆၧၫ့အထီဘၪနီၪ, မၩအၥၭ ဘဲၫပရၧၭၥၪထီၫ့ အီၪလၧစ့ၩဒ့ၭကံၪအဖၧၩ့နီၪလီၫ.",
			"12": "<sup>12</sup> ၦကိၪ့ၥ့ၪလဂၩအၪ့ၥီၪ့ဆၧ လၧၦခိၭနၪဆၧအနါဖၧၩ့ နီၪ, မၩအၥၭဘဲၫနါခွၩ့ထီၫ့, ဒဲဆၧကယၧၩ့ထီၫ့ဆံၫ့နီၪ လီၫ.",
			"13": "<sup>13</sup> ဘဲၫမူၭခိၪဖီၫအဆၧချံၪ့ လၧကူၭဆၧအထီအၥိၭနီၪး ၦအၥီၫ့လဂၩ လၧအလူတီၩ လၧၦအၪ့မၧၫ့ဝ့ၫအဂးမွဲ ဘဲၫနီၪၥိၭဆ့း အဂဲးဘဲၫယီၩ ဒုၭမုၬထၪ့ထဲၩ့အကဆါ အၥၭလီၫ.",
			"14": "<sup>14</sup> ၦလဂၩလၧအအူၭလၩ့အၥၭ လၧဆၧဖ့ၪအၪ့လီၫအ ကၠီၩ့နီၪ, မၩအၥၭဘဲၫဆၧအုၪ့, ဒဲလံၩလၧဆၧလဂဲၫ ဆၧၩ့ဘၪအၥိၭနီၪလီၫ.",
			"15": "<sup>15</sup> လၧဆၧအွံၪၥၭဆၧၩ့ယံၬအကၠီၩ့နီၪ, ၦဒိၪဖၭဒိၪဘၪ ဆၧအၪ့လွ့ၫန့တၭ, ဖျ့ၩဖူၬလူၭနီၪ မၩခါခွံၬဎွံၪလီၫ.",
			"16": "<sup>16</sup> န့ၫစၩ့နီၪမွဲနဒၪဘၪယူၭဧၪး အၪ့ဘျဲၩအၪ့ဘီၪး ဘၪ လဘၪနအၪ့အၪလၨၪတၭ, နမိပၠိၭထၪ့ခွံၬဘၪခိၬလီၫ.",
			"17": "<sup>17</sup> လ့ၩလၧနထံၩနၥိၭ အဂံၪ့နီၪပဒၩ့နခၪ့ဘီၪး ဘၪလ ဘၪအဝ့ၫဒၪမိဘၪဆၧမၩပွံၭအၥၭတၭ, မိမ့ၬလဲၩဘၪ ခိၬနၧၩလီၫ.",
			"18": "<sup>18</sup> ၦလဂၩ လၧအထိးအၥၭ အဘျံၭအဘျၪ ထၫ့ဒုၪဒၩ ၦလၧအနဲၩ့ထံၭနီၪ, မၩအၥၭဘဲၫၥံၪ့မုကုၭ, ဒဲနၭၥံၪ ဖၩ့ၥံၪ, ဒဲဖျါလၧအစူၩဝ့ၫအၥိၭလီၫ.",
			"19": "<sup>19</sup> လၧဆၧခိဆၧဝီၩမုနံၩအဖၧၩ့နီၪ ၦဒိၭနဲၩ့အၥၭလၧ ၦလတီၩဘၪအစူၪဖၧၩ့, မၩအၥၭဘဲၫၥွၫခါလဘံၪ့, ဒဲ ခၪ့ဆၧၫ့တဖျၬခွံၬ အၥိၭနီၪလီၫ.",
			"20": "<sup>20</sup> ဘဲၫၦဘဲၪ့လၩ့ခွံၬ ဆၧကီၩ့ဆၧၥိၭ လၧဆၧဂီးအထီ နီၪ, ဘဲၫဆၧဆဲၪ့ထံၫ လၧဖျၪအ့ၪၥံၫ့အဖၫ့ခိၪအၥိၭနီၪ, ၦလၧအၥံၫကျံၩထၭခိၪ လၧၦၥၭအုၭအဂး, မွဲဘဲၫနီၪ ၥိၭဆ့လီၫ.",
			"21": "<sup>21</sup> နဒုၪနဒၩအ့ၪၥၭဝံအၥၭတၭ, ဒုၭအၪ့ကိၪဘီၪး အ့ၪ",
			"22": "<sup>22</sup> ၥူၫအီၩအၥၭနီၪ ဒုၭအီၩထံၫဘီၪ.- အဂဲးဘဲၫယီၩနအီၪ က့ၪကီၪ့မ့ၪအၧၩ့ လၧအခိၪဎွံၪလီၩ့တၭ, ယဟိဝၩမိဖ့ၪ ဆၧၫ့ထဲၩ့နၧၩလီၫ.",
			"23": "<sup>23</sup> လံၩလၧမုဖၩနီၪဒုၭဆၧၩ့လၩ့ဆၧး ဒဲဖျ့ၩလၧအဒုၭ အဲၪ့လိၬဆၧနီၪ ဒုၭအီၪထၪ့ဆၧၥၭထၪ့လီၫ.",
			"24": "<sup>24</sup> ၦအီၪလၧဂံၪ့ခိၪအနိၪ့ဖၧၩ့နီၪ, ဂ့ၩနဲၪ့အီၪဝ့ၫလၧၦမုၪ လၧအဂဲးလိၬတ့ၭလိၬဆၧလၧဂံၪ့ဖၭလဲအဖၧၩ့ဒံၭလီၫ.",
			"25": "<sup>25</sup> ဆၧပရၧၫ့ဂ့ၩ လၧထံၫယဲၩ့ခးယဲၩ့နီၪ, မၩအၥၭဘဲၫ ထံၫချံၪ့, လၧၦလၧအၥၭလၩ့ဘဲၩအဂးအၥိၭနီၪလီၫ.",
			"26": "<sup>26</sup> ၦတီၩၦလီၩ့လၩ့ထံၩဖါ လၧၦလတီၩလလီၩ့ဘၪအ မ့ၬယၫတၭး မွဲဘဲၫထံၫထၪ့ဖျိၭဒုၪဝ့ၫ, ဒဲထံၫဖၧၩ့ဘၪ ဆၧစံၪစၪအၥိၭနီၪလီၫ.",
			"27": "<sup>27</sup> ၦအၪ့န့ၫစၩ့ အၪလၨၪဂ့ၩအ့ၬး ဘဲၫနီၪအၥိၭၦအၪ့ ဎၬအလၩအဖၩ့ဒၪဝ့ၫနီၪ မွဲဆၧလၩဖၩ့ဆ့အ့ၬ.",
			"28": "<sup>28</sup> ၦလဂၩလၧအလပၧၩ့ဘၪအၥၭ ဒၪဝ့ၫနီၪ, မၩအၥၭ ဘဲၫဒိၩ့လၩ့ဎီးခွံၬ, ဒဲအခိၪဒၧၩ့လအီၪဘၪ အၥိၭနီၪလီၫ."
		},
		"26": {
			"1": "<sup>1</sup> ဘဲၫမူၭခိၪဖီၫလၧဆၧခိခၫအၥိၭ, ဒဲဆၧဂဲၫဆၧၩ့လၧ ကူၭဘုၪအထီအၥိၭနီၪး ဘဲၫနီၪၥိၭဆ့ဆၧလၩဆၧဖၩ့ ကြၨၭလၧၦအဂီၩ့အဂးအ့ၬ.",
			"2": "<sup>2</sup> ဘဲၫထိၪဎွံၭယူၩဝံၩ့ဝၩ့, ဒဲထိၪမးလံၫ့ယူၩထၪ့ခွံၬအ အၥိၭနီၪ, ဆၧဆိၪအၧၩ့ လၧအဂဲးလအီၪဘၪနီၪ ဘၪ ဆၧဆ့အ့ၬ.",
			"3": "<sup>3</sup> နိၪဖျ့ၪလၧကၥ့ၪအဂး, ဒဲဖျံၩလၧကၥ့ၪယီၩ့အဂးနီၪး ဒဲနိၪထးလၧၦအဂီၩ့ အချိၫ့ခိၪအဂးနီၪဆ့လီၫ.",
			"4": "<sup>4</sup> ထီးစံၭဆၧၫ့ၦအဂီၩ့ ဘဲၫအဆၧဂီၩ့ အၥိၭနီၪလဂ့ၩး နမိလၩ့ဂၬဘၪခိၬအဝ့ၫနီၪလီၫ.",
			"5": "<sup>5</sup> စံၭဆၧၫ့ၦအဂီၩ့ ဘဲၫအဆၧဂီၩ့အီၪဝ့ၫအၥိၭနီၪဆံၭး မိကဲၪထၪ့ဘၪခိၬ ၦကိၪ့ၥ့ၪလၧအမ့ၬၥၪဒၪဝ့ၫအဖၧၩ့လီၫ.",
			"6": "<sup>6</sup> ၦလၧအမၪလူၬ ဆၧလၧၦအဂီၩ့အစူၪဖၧၩ့နီၪ, ဒၪ့ ထ့ၬခွံၬၦခၪ့ဒဲအီၩဆၧ မၩဂၭဂီၩ့လီၫ.",
			"7": "<sup>7</sup> ၦလၧအခၪ့ဂၭဂီၩ့ဖၨၪထီၫဝ့ၫနီၪး ဆၧချဲၩ့ဒီၩ့လၩ့လ မံၩ့လၧၦအဂီၩ့အနိၭဖၧၩ့, မွဲဘဲၫနီၪၥိၭဆ့လီၫ.",
			"8": "<sup>8</sup> ဘဲၫၦစၧၩ့ထၬ လိးလဖျိၪ့ လၧဖလီအဖၧၩ့အၥိၭနီၪး ၦလၧအမၩလၩမၩဖၩ့ၦအဂီၩ့နီၪ, မွဲဘဲၫနီၪၥိၭဆ့လီၫ.",
			"9": "<sup>9</sup> ဘဲၫဆၧဆူၪဘၪဆ့ၭၦအီၩ မၧၩ့အၥၭအစူၪအၥိၭနီၪ, ဆၧချဲၩ့ဒီၩ့လၩ့လမံၩ့ လၧၦအဂီၩ့အနိၭဖၧၩ့ မွဲဘဲၫနီၪ ၥိၭဆ့လီၫ.",
			"10": "<sup>10</sup> ၦမၩဆၧအခိၪလဂၩ မၩထၪ့ဆၧထီးအလူၬ အခံး အဂၩ့း အ့ၪမွဲၦလၧအအၪ့လံၩ့ ၦအဂီၩ့လဂၩ, မၩအၥၭ ဘဲၫၦလၧအအၪ့လံၩ့ ၦလ့ၩဆၧလဂၩ အၥိၭနီၪလီၫ.",
			"11": "<sup>11</sup> ၦအဂီၩ့လဂၩ လၧအမၩထဲၩ့ဒီၭ အဆၧဂီၩ့နီၪ,မၩ အၥၭဘဲၫထွံၪ လၧအကၠၪထဲၩ့အၥၭ လၧအဆၧပၠိၭထၪ့ ဒၪဝ့ၫအၥိၭနီၪလီၫ.",
			"12": "<sup>12</sup> ၦလၧအကိၪ့ၥ့ၪ လၧအမ့ၬၥၪဒၪဝ့ၫအဖၧၩ့နီၪ, မွဲနဒၪ ဘၪဆ့ဧၪး ဆၧယိလါၦအဂီၩ့နီၪ အီၪအၪနဲၪ့ဒံၭအဝ့ၫ ဒၪလီၫ.",
			"13": "<sup>13</sup> ၦအကၠႃၪ့လဂၩစံၭဝ့ၫ, ဆၬလၥၧၫ့လဒုၩအီၪလၧဖၧၩ့ ၥၭနီၪး ဒဲဆၬလၥၧၫ့လဒုၩ အီၪဝ့ၫ လၧဖၧၩ့ၥၭမုနီၪဆ့ လီၫ.",
			"14": "<sup>14</sup> ဘဲၫတရၫ့ကၠၪအၥၭ လၧအခွၩ့ဖၧၩ့အၥိၭ, ၦကၠႃၪ့ လဂၩကၠၪအၥၭ လၧအလးမံၫအဖၧၩ့ ဘဲၫနီၪၥိၭဆ့",
			"15": "<sup>15</sup> လီၫ.- ၦကၠႃၪ့လဂၩ ဘၧၩ့လၩ့အစူၪ လၧဆၧဖၧၩ့နီၪ တၭးထုၭထၪ့ထဲၩ့ဒီၭ လၧအနိၭနီၪ ဆၧပွံၭအၥၭလီၫ.",
			"16": "<sup>16</sup> ၦကၠႃၪ့လဂၩ လၧအမ့ၬၥၪဒၪဝ့ၫအဖၧၩ့, အီၪလၧဆၧ ကိၪ့ၥ့ၪအၪနဲၪ့ၦနွ့ၫဂၩ လၧအလီၩဖျီၪထၪ့ ဆၧအဂဲး အကၠီၪ့ၥ့ၪဒံၭလီၫ.",
			"17": "<sup>17</sup> ၦလၧအလ့ၩဆၧလၧဖၧၩ့ၥၭနီၪတၭ, ၥၭထၪ့ဆၧဂဲး လိၬတ့ၭလိၬ လဘၪဆဲၫ့ဘၪအနၫ့ဆါနီၪး မၩအၥၭဘဲၫ ၦဖီၪ့ထၬ ထွံၪအနါၥံၪ အၥိၭနီၪလီၫ.",
			"18": "<sup>18</sup> ဘဲၫၦဖျႃလဂၩ, ခွံၬဖျါမ့ၪ, ဖၩ့ၥံၪနၭၥံၪ, ဒဲဆၧၥံၫအ",
			"19": "<sup>19</sup> ၥိၭနီၪး- ၦလဂၩလၧအအၪ့လီၫန့ ၦလၧအနဲၩ့ထံၭတၭ, စံၭဝ့ၫ, ယချဲၩ့လိၬကွ့ၩနီၪမွဲအ့ၬဧၪ, မၩအၥၭဘဲၫနီၪ ၥိၭဆ့လီၫ.",
			"20": "<sup>20</sup> ထီးဒၪအလးလၧၥံၪ့မုလအီၪဘၪတၭ, မ့ၪလၩ့ဖံၬ ခွံၬဝ့ၫဒၪး ဒဲၦချဲၩ့ခဲၪဆၧနီၪ အ့ၪလအီၪဘၪတၭ, ဆၧဂဲး လိၬတ့ၭလိၬလၩ့ဖံၬခွံၬ ဘဲၫနီၪၥိၭဆ့လီၫ.",
			"21": "<sup>21</sup> ဘဲၫၥွၫထီး လၧမ့ၪအၧၩ့အဂးအၥိၭ, ဒဲၥံၪ့မုလၧမ့ၪ အဂးအၥိၭနီၪး ၦလၧအဂဲးလိၬတ့ၭလိၬ ဆၧလဂၩနီၪ ဒုၭအီၪထၪ့ ဆၧအၪ့ဂူၬလိၬအၥၭ ဘဲၫနီၪၥိၭဆ့လီၫ.",
			"22": "<sup>22</sup> ၦချဲၩ့ခဲၪဆၧ အဆၧချဲၩ့ၥံၪ မၩအၥၭဘဲၫဆၧလၧၦ အၪ့အွံၪအၥိၭနီၪး ဒဲဆၧနီၪလဖၪ နုၬလၩ့လၧဂူၭဖိၫ့ယိၬ ထုၬအဖၧၩ့နီၪလီၫ.",
			"23": "<sup>23</sup> နိၭဖျံၩၥံၪခဲၩ ထၪ့ဒဲၥၭအၧၩ့နီၪ မၩအၥၭဘဲၫဖၧၩ့ဂၪ့ ခိၪဖၩ့ထၬအၥၭ လၧစ့ၩအအ့ၪအၥိၭနီၪလီၫ.",
			"24": "<sup>24</sup> ၦလၧအၥၭဂဲၫ့ဆၧနီၪ အၪ့လီၫဆၧလၧအနိၭဖျံၩၥံၪး အ့ၪမွဲလၧအၥၭခံဖၧၩ့ အီၪက့ၪထၬဆၧအၪ့လီၫဝ့ၫနီၪ",
			"25": "<sup>25</sup> လီၫ.- ထီးအဝ့ၫဒၪအ့ၪချဲၩ့ဆၧ လၧအလူမုၬမုၬနီၪ, နဲၩ လဂ့ၩး အဂဲးဘဲၫယီၩ ဆၧစံၪစၪနွ့ၫမံၩ့ၥံၪ အီၪလၧအ",
			"26": "<sup>26</sup> ၥၭခံဖၧၩ့လီၫ.- အဆၧအၪ့လီၫနီၪ မၩလၩ့ဘံၭခွံၬအ ဆၧၥုၪ့ထၪ့ၥၭဂဲၫ့တၭး အဆၧအၧၩ့နီၪ မိဘၪဆၧဒုၭ ဖျီၪထၪ့လၧဆၧအီၪကီၪ့ အဖၧၩ့လီၫ.",
			"27": "<sup>27</sup> ၦလၧအခုၪ့ဆၧဖၧၩ့နီၪ မိလၩ့ထ့ၬလၧအဖၧၩ့း ဒဲၦ လၧအချံးလိးလဖျိၪ့နီၪ, ဆၧမိဂဲၫထဲၩ့ထဲၩ့ လၧအလီၩ့ ဒၪဝ့ၫလီၫ.",
			"28": "<sup>28</sup> ဖျ့ၩအဘျံၭအဘျၪနီၪ ၥၭဂဲၫ့မ့ၬလဲၩၦလၧအမၩအၧၩ့ ဝ့ၫး ဒဲနိၭချဲၩ့မုၬနါဆၧနီၪ မၩဂၭဂီၩ့ဆၧလီၫ."
		},
		"27": {
			"1": "<sup>1</sup> ထီးအူၭလၩ့နၥၭ လၧကဲဂီၩအဂးလဂ့ၩး အဂဲးဘဲၫ ယီၩ မုလနံၩမိမၩအၥၭ ဘဲၫၥ့ၪလဲၪဘဲၫၥ့ၪလဲၪနီၪ, နၥ့ၪ ယၫနဝ့ၫအ့ၬ.",
			"2": "<sup>2</sup> မွဲၦဂူၫဂၩအၪ့အူၭနၧၩဘီၪ, ထီးမွဲနနိၭဒၪနဝ့ၫနီၪလ ဂ့ၩ.",
			"3": "<sup>3</sup> လိးလဖျိၪ့မွဲဆၧအဎၧၫ့, ဒဲမ့ၭနီၪအီၪလၧအလယၧး ဆ့း အ့ၪမွဲၦအဂီၩ့အဆၧၥၭထၪ့နီၪ ဎၧၫ့နဲၪ့ဒံၭဆၧနီၪ နံၫမံၩ့လူၬလီၫ.",
			"4": "<sup>4</sup> ၥၭခဲၩထၪ့မွဲၥၭနီၩ့, ဒဲၥၭထၪ့နီၪမွဲဆၧမၩဂၭဂီၩ့တၭး အ့ၪမွဲၦလၧအဆၧၫ့ထုၪ့ လၧဆၧၥၭကဲၪ့အမ့ၬယၫနၧၩ့ နီၪ, မွဲပလၫလဂၩလဲၪ.",
			"5": "<sup>5</sup> အၪ့ၥီၪ့ဆၧအီၪဖျီၪနီၪ, ဂ့ၩနဲၪ့ဒံၭဆၧအဲၪအီၪၥူၪဝ့ၫ",
			"6": "<sup>6</sup> လီၫ.- ထံၩၥိၭမၩဖၧၩ့လးနီၪ မွဲအတီၩအဘၪး ဒဲဒုၪဒၩ အဆၧအဲၪဂါနီၪ အီၪအၪအၪလ့ၬလီၫ.",
			"7": "<sup>7</sup> ၦလၧအဘျဲၩအၪ့ဝ့ၫနီၪ ယဲးထဲးန့ၫခိၪထံၫလၩ့ဆၩ့း အ့ၪမွဲလၧၦၥၭဝံအၥၭအဂးနီၪ, ကယဲဆၧအခၪလမံၩ့ လါလါမွဲဆၧအအွံၪလီၫ.",
			"8": "<sup>8</sup> ၦလၧအစဲၪ့ဒၪခွံၬအလးဒၪဝ့ၫနီၪ, မၩအၥၭဘဲၫထိၪ လၧအခွံၬၡိၭအၥွံၫ အၥိၭနီၪလီၫ.",
			"9": "<sup>9</sup> ဆၧၥိၪဒဲဆၧနၧၫ့မၧၫ့နီၪ ဒုၭၥုၪ့ထိၬၥၭထိၬၦအၥၭး အ့ၪမွဲၦအထံၩအၥိၭ အဆၧမုၬနီၪ မုၬနဲၪ့ဒံၭဆၧဘဲၫနီၪ ၥိၭလီၫ.",
			"10": "<sup>10</sup> နထံၩနၥိၭဒဲနဖါအထံၩအၥိၭနီၪ ထီးစဲၪ့ဒၪလဂ့ၩးဒဲ ထီးနအ့ၪဘၪၡၪ့ဘၪနၭအမုနံၩနီၪ, လ့ၩနုၬလၧနထၧၫ့ ဖုဝဲခွၫအဂံၪ့ဖၧၩ့နီၪလဂ့ၩး အဂဲးဘဲၫယီၩ ၦအီၪလၧန နဲၩ့ထံၭလဂၩနီၪ ဂ့ၩနဲၪ့ထၧၫ့ဖုဝဲခွၫ လၧအအီၪယဲၩ့ လီၫ.",
			"11": "<sup>11</sup> ယဖိၪခွၫဧ့, ဘဲၫၥိၭယမိစံၭဆၧၫ့ ၦလၧအဒုၪဒွ့ၪ ယၧၩလဂၩနီၪ အီၪလၧဆၧကိၪ့ၥ့ၪတၭ, ဒုၭၥုၪ့ထိၬၥၭ ထိၬယၧၩဆံၭ.",
			"12": "<sup>12</sup> ၦလၧအၥ့ၪယၫ ထီးလၩ့အၥၭဂ့ၩလဂၩနီၪ ဒၪဘၪ ဝဲၩဆၧအၧၩ့တၭ, အီၪက့ၪၥူၪခွံၬအၥၭး အ့ၪမွဲၦလၧ အလမၩလိၪဘၪဆၧနီၪ လ့ၩဒၪဆၧဘဲၫနီၪတၭ, ဘၪၡၪ့ ဘၪနၭဝ့ၫလီၫ.",
			"13": "<sup>13</sup> ၦလၧအထိးအၥၭလၧၦမွံၩအဂးနီၪ, မၩန့အကီၩ့ အၥိၭဘီၪး ၦလၧအထိးအၥၭ လၧၦမုၪလၩ့မဲၩအဂးနီၪ, မွဲအပီၩ့လၩ့ ဆၧလမံၩ့မံၩ့ဆံၭ.",
			"14": "<sup>14</sup> ၦလၧအဂဲထုၪ့ဂီၩဂီၩ, ဒဲဆိၪဂ့ၩအထံၩအၥိၭလၧအ လူၥီၫဖၭဒိၪနီၪး ဆၧမိအီၪက့ၪဝ့ၫ လၧဆၧဆိၪအၧၩ့ လၧအဝ့ၫဒၪအကၠီၩ့လီၫ.",
			"15": "<sup>15</sup> ဆၧဂဲၫဆၧၩ့လၩ့ဖၭဒိၪ ဒဲဆၧလၩ့ဆၩ့လထံၪဎးဘီၩ့ ဎးနီၪး ဒဲၦမုၪလၧအဂဲးလိၬတ့ၭလိၬဆၧ, မွဲဆၧမီၪ့ဎီၩ့ လီၫ.",
			"16": "<sup>16</sup> ၦလၧအဘဲၩ့ထၬၦမုၪနီၪ ဘဲၩ့ထၬလံၩး ဘဲၫအစူၪ ထွ့ၪဖီၪ့ၥိၪအၥိၭဆ့လီၫ.",
			"17": "<sup>17</sup> ထၭနီၪဘၪဆၧကျဲၩ့အဲၪ့ဝ့ၫ လၧထၭအလီၩ့တၭး ၦ ၡၩဒုၭအဲၪ့အထံၩအၥိၭ အမ့ၬဘဲၫနီၪၥိၭဆ့လီၫ.",
			"18": "<sup>18</sup> ၦလၧအခိၭချိၪ့ဒိၩ့ထံၭနီၪ မိအၪ့ဘၪအၥၪတၭး ၦ လၧအယူၭယၪ့အကဆါနီၪ မိန့ဘၪဆၧလၩဖၩ့လီၫ.",
			"19": "<sup>19</sup> ဘဲၫၦအမ့ၬယိဆၧၫ့ယၫ လၧထံၫကျၩအၥိၭနီၪးၦၡၩ အၥၭလၧၦၡၩအၥၭ မွဲဘဲၫနီၪၥိၭဆ့လီၫ.",
			"20": "<sup>20</sup> ဖျႃဖၧၩ့ဒဲဆၧမၩဂၭဂီၩ့နီၪ လၧၫ့ဎွ့ၩဝ့ၫအ့ၬး ဒဲၦၡၩ အမ့ၬၥၪၥံၪ ယိဆၧဘျဲၩၥ့ၪအ့ၬ.",
			"21": "<sup>21</sup> ဘဲၫဆၧဖၧၩ့ၥိၫ့ဆၧ လၧစ့ၩအဂး, ဒဲဖံၫ့ချၪဖၧၩ့လၧ ထီၫ့အဂးနီၪး ၦၡၩမွဲဘဲၫနီၪၥိၭ လၧၦနိၭစံၭထၪ့အၪ့ အူၭဝ့ၫအဂးလီၫ.",
			"22": "<sup>22</sup> နအ့ၪအၪ့ဆူၫ ၦအဂီၩ့ လၧဆုၪ့ဖၧၩ့ လၧချံၪ့ဆူၫမၩ လၩ့ဘျ့ၭ ဂူၫဆၪအကျၩလါနၫ့တၭး အဆၧဂီၩ့နီၪစဲၪ့ ထၪ့ခွံၬလၧအဖၧၩ့အ့ၬ.",
			"23": "<sup>23</sup> နၥိၪၥံၪဘ့ၪၥံၪအဒီၪ့လဖၪနီၪ, ယိထဲၩ့ခွါထဲၩ့ဂ့ၩဘၪ",
			"24": "<sup>24</sup> စဲၪး ဒဲထီးလၩ့နၥၭ လၧချီအဒီၪ့ၥံၪအဂးဘီၪး- အဂဲး ဘဲၫယီၩ ဆၧလူဒိၪဎွ့ၩဒိၪအီၪဝ့ၫ အဆိၩအကၠၪအ့ၬး ဒဲ",
			"25": "<sup>25</sup> ၥရဖူၩနီၪ လၩ့ဆၨၩလဆိၩဘၪ လဆိၩဆ့အ့ၬ.- နၪ့ဎဲၫ့ လူၬတၭ, နၪ့ၥၫ့နီၪမဲၪထၪ့, ဒဲခိၪလီၩ့အဆၧဒိၭဆၧလၪ",
			"26": "<sup>26</sup> ဘၪဆၧအၪ့ထုၫ့ကီၪ့ဝ့ၫလီၫ.- ၥိၪဖိၪၥံၪ လၧနကီၩ့နၥိၭ",
			"27": "<sup>27</sup> အဂးအီၪဝ့ၫနီၪး ဒဲဘ့ၪဖၫၥံၪမွဲဂၪ့ခိၪဝၩ့အဎွ့ၩလီၫ.- ဒဲ ဘ့ၪအနူထံၫလၧၫ့ လၧနဆၧအၪ့အဂး, ဆၧအၪ့လၧန ဂံၪ့ဖိၪၥံၪအဂး, ဒဲနၡၩမုၪၥံၪအဆၧအၪ့အဂးနီၪ ဆ့လီၫ."
		},
		"28": {
			"1": "<sup>1</sup> ထီးၦၡၩ လီၩ့ဆီးဝ့ၫ လအီၪဘၪလါနၫ့တၭ, ၦလ တီၩလလီၩ့ဘၪၥံၪစဲၪ့ဖျိၭဝ့ၫး အ့ၪမွဲၦတီၩၦလီၩ့ၥံၪအ ၥၭဒူၩဘဲၫဆၬလၥၧၫ့ အၥိၭနီၪလီၫ.",
			"2": "<sup>2</sup> ထီးၦထံၫဖိၪခးဖိၪၥံၪ အ့ၪမၩမၪဆၧတၭ, ၦဒိၪဖၭ ဒိၪၥံၪအီၪဝ့ၫအၪအၪလ့ၬး အ့ၪမွဲလၧၦအီၪလၧဆၧကိၪ့ ဆၧဖၭဒဲအဆၧၥ့ၪယၫအကၠီၩ့နီၪ, ဆၧဂုးဆၧခၧၫ့အီၪ ဝ့ၫဒၪဆ့လီၫ.",
			"3": "<sup>3</sup> ၦၡၩလၧအမွဲလါနၫ့ၦၡၪ့ဖိၪနီၪ အ့ၪမၩအၧၩ့မၩၥၫ့ ၦၡၪ့ဖိၪတၭ, မၩအၥၭဘဲၫဆၧဆၧၩ့လၩ့ ဝ့ၬခွံၬဆၧ တၭ, ဆၧအၪ့အီၪလၩ့ထး နးမံၩ့အ့ၬ.",
			"4": "<sup>4</sup> ၦလၧအစဲၪ့ဒၪခွံၬဆၧၥီၪ့ဆၧၥၫ့နီၪ, အၪ့အူၭၦအၧၩ့ ဖိၪၥံၪး အ့ၪမွဲၦလၧအထီးန့ဝ့ၫ လဂၩလါလါနီၪဂဲးလိၬ တ့ၭလိၬ လၧအဝ့ၫၥံၪလီၫ.",
			"5": "<sup>5</sup> လၧဆၧစ့ၩရၫ့တီၩ အဂဲးအကၠီၪ့နီၪ ၦအၧၩ့ဖိၪၥံၪနၪ ဝ့ၫၥ့ၪအ့ၬး အ့ၪမွဲၦလၧအအၪ့ဎူၫအၪ့ဎၬ ယဟိဝၩနီၪ နၪဆၧၥ့ၪထီးအလူၬလီၫ.",
			"6": "<sup>6</sup> ၦၡၪ့ဖိၪယၬဖိၪလၧအလ့ၩဆၧ လၧအၥၭတီၩအဖၧၩ့ နီၪး ဂ့ၩနဲၪ့ဒံၭၦကဲၪဒိၪလါနၫ့, အဖၧၩ့ၥၭၥံၪကဲၪ့ဝ့ၫဒၪ လီၫ.",
			"7": "<sup>7</sup> ၦလၧအထီးန့ဆၧၥီၪ့ဆၧၥၫ့နီၪ မွဲၦဖိၪခွၫကိၪ့ဘၪကိၪ့ ၥ့ၪး အ့ၪမွဲၦလၧအထၧၫ့ထံၩထၧၫ့ၥိၭ လၧၦလၧအအၪ့ လၨၪအီၩလၨၪဆၧလဂၩနီၪ, မၩမဲအဖါအမ့ၬလီၫ.",
			"8": "<sup>8</sup> ၦလၧအမၩအၪထၪ့ အစူၪလး အခၪ့ခိၪလၧစ့ၩအ အ့ၪထၪ့ဒဲဆၧအၪထၪ့နီၪ, မိအီၪက့ၪကီၪ့ဝ့ၫလၧၦလၧ အယၫ့ၥၭၦၡၪ့ဖိၪယၬဖိၪၥံၪ အဂးလီၫ.",
			"9": "<sup>9</sup> ၦလၧအဘိၭကၠၪခွံၬအနါ ဘဲၫၥိၭအထီးနါဂၧၫ့ဆၧ ၥီၪ့ဆၧၥၫ့လဂ့ၩနီၪ, အဝ့ၫဒၪအဆၧဘၩဆိၪဖၪဒၪလ့ၬ ကဲၪထၪ့ဆၧၥၭလိၪနီၪလီၫ.",
			"10": "<sup>10</sup> ၦလဂၩလၧအဒုၭလ့ၩ ၦအတီၩအလီၩ့လၧဖၧၩ့ၥၭ အၧၩ့ဖၧၩ့နီၪ, အနၫ့ဆါမိလၩ့ထ့ၬ လၧအဆၧဖၧၩ့ဒၪ ဝ့ၫး အ့ၪမွဲၦတီၩၦလီၩ့ၥံၪ မိန့ၥၫဆၧအဂ့ၩလီၫ.",
			"11": "<sup>11</sup> ၦၥထံၫလဂၩ အီၪလၧဆၧကိၪ့ဘၪကိၪ့ၥ့ၪ လၧအမ့ၬ ၥၪဒၪဝ့ၫအဖၧၩ့နီၪး အ့ၪမွဲၦၡၪ့ဖိၪ အီၪလၧဆၧၥုၪ့ဖၭ ၥၭဖၭမိအၪ့ဎၬယိအဝ့ၫလီၫ.",
			"12": "<sup>12</sup> ထီးၦတီၩၦလီၩ့ အ့ၪပၧၩ့ဆၧတၭ, ဆၧလၩဖၩ့အီၪ အၪအၪလ့ၬး အ့ၪမွဲထီးၦလတီၩလလီၩ့ဘၪအ့ၪဂဲထုၪ့ တၭ, ၦၡၩအီၪက့ၪၥူၪခွံၬ အၥၭလီၫ.",
			"13": "<sup>13</sup> ၦလဂၩအ့ၪမၩလၩ့ဘံၭခွံၬ အမၩမၪဆၧနီၪ, မိဘီၪ ထၪ့ယီၫထၪ့အ့ၬး အ့ၪမွဲၦလၧအလီၩလၩ့အၥၭ ဒဲစဲၪ့ ဒၪခွံၬနီၪ မိဒၪန့ဆၧယၫ့ၥုၪ့ယၫ့ၥၭလီၫ.",
			"14": "<sup>14</sup> ၦလၧအၥၭမဲၪဆၧ လထံၪဎးလဘီၩ့ဎးလဂၩနီၪဘၪ ဆၧဆိၪဂ့ၩဝ့ၫး အ့ၪမွဲၦလၧအမၩနီၩ့ထၪ့အၥၭလဂၩ နီၪမိလၩ့ဘၪ လၧဆၧအၧၩ့ဖၧၩ့လီၫ.",
			"15": "<sup>15</sup> ၦလတီၩလလီၩ့ဘၪလဂၩ အ့ၪပၧၩ့ၦၡၪ့ဖိၪယၬဖိၪ နီၪး မၩအၥၭဘဲၫဆၬလၥၧၫ့ယုၩ့ဆၧ, ဒဲဖုၫထၫ့ဂၭဝံၩ့ ဝၩ့ဝ့ၫအၥိၭနီၪလီၫ.",
			"16": "<sup>16</sup> ၦဒိၪဖၭဒိၪ လၧအၥုၪ့ဖၭၥၭဖၭ လအီၪဘၪနီၪ, မၩ အၧၩ့ဆၧအၪအၪလ့ၬတၭ, အ့ၪမွဲၦလၧအၥၭဂဲၫ့ဆၧ ၥၭကွံၩနီၪ, အနံၩအၥၫ့လဖၪ မိအၪထၪ့ဝ့ၫလီၫ.",
			"17": "<sup>17</sup> ၦလၧအမၩန့ဆီၪ့ ၦၡၩအၥွံၪနီၪ, မိဘၪစဲၪ့ဖျိၭစိၩ လၧဆၧဖၧၩ့အအီၪ, ဘဲၫၥိၭၦဖီၪ့န့ဝ့ၫၥ့ၪအ့ၬ.",
			"18": "<sup>18</sup> ၦလၧအလ့ၩဆၧဆုးလီၩ့လဂၩနီၪ, မိထီၩ့လၧဆၧ ထိးထဲၩ့တၩ့ထဲၩ့ဝ့ၫး အ့ၪမွဲၦလၧအဖၧၩ့ၥၭ ကဲၪ့ဝ့ၫလ ဂၩနီၪ မိလၩ့ထံၩဖါဝ့ၫချဲၫ့လ့ၬလီၫ.",
			"19": "<sup>19</sup> ၦလဂၩအ့ၪမၩကၩ လၧအဆံၬၥံၪနၩၥံၪနီၪ မိဘျဲၩ အၪ့ဝ့ၫး အ့ၪမွဲၦလၧအလီၩ့ဆီးဆၧပျီၩပျီၩနီၪ, မိလၧၫ့ ဎွ့ၩလၧဆၧၡၪ့ဆၧနၭနီၪလီၫ.",
			"20": "<sup>20</sup> ၦလဂၩလၧအလူတီၩနီၪ အီၪလၧဆၧဆိၪဂ့ၩအၪမံၩ့း အ့ၪမွဲၦလဂၩ လၧအအၪ့ဎၬ န့ဘၪစူၪလးခၪ့ခိၪချဲၫ့ချဲၫ့ တၭဖီၩ့ဖျ့ၭဆၧဒဲၩဘၭၥ့ၪအ့ၬ.",
			"21": "<sup>21</sup> ဆၧယိမ့ၬ ၦၡၩနီၪမွဲဆၧဂ့ၩအ့ၬး အဂဲးဘဲၫယီၩၦလ ဂၩနီၪ မိမၩမၪဆၧ လၧကိၪလမိၩအဂးလီၫ.",
			"22": "<sup>22</sup> ၦလဂၩအ့ၪၥၭကွံၩဆၧအစူၪလးခၪ့ခိၪနီၪ, အီၪလၧ အမ့ၬၥၪအၧၩ့တၭး ဆၧၡၪ့ဆၧနၭ မိဘၪဝ့ၫအဆၧၫ့အ ထီနီၪၥ့ၪယၫဝ့ၫ နးစီၪ့အ့ၬ.",
			"23": "<sup>23</sup> ၦလဂၩအ့ၪအၪ့ၥီၪ့ၦၡၩနီၪ, လၧခဲၫ့ထဲၩ့တၭမိန့ဘၪ ဆၧအခိးအတၩ အၪနဲၪ့ဒံၭ ၦလၧအချဲၩ့မုၬနါဆၧလၧ အဖျ့ၩလဂၩနီၪလီၫ.",
			"24": "<sup>24</sup> ၦလဂၩအ့ၪအၪ့ဂူၬန့ အမိအဖါအဆၧတၭ, စံၭဝ့ၫ, မွဲဆၧမၪနးမံၩ့အ့ၬနီၪ, အဝ့ၫလဂၩမွဲၦမၩဂၭဂီၩ့ဆၧအ ထံၩအၥိၭနီၪလီၫ.",
			"25": "<sup>25</sup> ၦလၧအအီၪက့ၪထၪ့ထီၫအၥၭ လဂၩနီၪထိၪဂဲၩဆၧ ဂဲးလိၬတ့ၭလိၬး အ့ၪမွဲၦလၧအဒိၭနဲၩ့အၥၭ လၧယဟိ ဝၩအဖၧၩ့မိန့ဘၪ စူၪလးခၪ့ခိၪလီၫ.",
			"26": "<sup>26</sup> ၦလဂၩဂၩအ့ၪဒိၭနဲၩ့အၥၭ လၧအၥၭဒၪဝ့ၫအဖၧၩ့ နီၪ, အဝ့ၫလဂၩမွဲၦအဂီၩ့း အ့ၪမွဲၦလၧအလ့ၩဆၧလၧ ဆၧကိၪ့ဘၪကိၪ့ၥ့ၪအဖၧၩ့း အနီၪမိဖီၩ့မိဖျ့ၭဝ့ၫဒၪလီၫ.",
			"27": "<sup>27</sup> ၦလၧအဖ့ၪလၫ့ဆၧ လၧၦၡၪ့ဖိၪယၬဖိၪလဂၩနီၪ, အနၫ့ဆါၡၪ့ဝ့ၫဒၪအ့ၬး အ့ၪမွဲၦလၧအအီၪက့ၪၥူၪခွံၬ အမ့ၬၥၪလဂၩနီၪ, မိဘၪဆၧဆိၪအၧၩ့ အၪမံၩ့လီၫ.",
			"28": "<sup>28</sup> ထီးၦလတီၩလလီၩ့ဘၪ အ့ၪဂဲထုၪ့တၭ, ၦၡၩအီၪ က့ၪၥူၪအၥၭး အ့ၪမွဲထီးအဝ့ၫၥံၪ အ့ၪဂၭဂီၩ့နီၪ, ၦတီၩ ၦလီၩ့ၥံၪ အၪထၪ့အၪအၪလ့ၬလီၫ."
		},
		"29": {
			"1": "<sup>1</sup> ၦလၧအဘၪဆၧအၪ့ၥီၪ့အၪဖၧၫ့တၭ, မၩဆီၪ့ထၪ့အ ခိၬနီၪ, မိဘၪဆၧဂၭဂီၩ့ရှုၭဝ့ၫတၭ, ဆၧမၩဖီၩ့မၩဖျ့ၭ ဝ့ၫအီၪအ့ၬ.",
			"2": "<sup>2</sup> ထီးၦတီၩၦလီၩ့ အ့ၪအၪထၪ့နီၪ, ၦခမျၧးၥံၪၥုၪ့ထိၬ ၥၭထိၬး အ့ၪမွဲထီးၦလတီၩလလီၩ့ဘၪ အ့ၪပၧၩ့ဆၧ တၭ, ၦခမျၧးၥံၪ ၥုၪ့အုၭၥၭအုၭဝ့ၫဒၪလီၫ.",
			"3": "<sup>3</sup> ၦလဂၩအ့ၪအဲၪ ဆၧကိၪ့ဘၪကိၪ့ၥ့ၪနီၪ ဒုၭၥုၪ့ထိၬၥၭ ထိၬအဖါး အ့ၪမွဲၦထၧၫ့ထံၩထၧၫ့ၥိၭ လၧၦမဲၩဎွဲၩမုၪ ၥံၪ, လူၬခွံၬပျီၩပျီၩ ဆၧအဎၧၩ့အဎီနီၪလီၫ.",
			"4": "<sup>4</sup> လၧဆၧစ့ၩရၫ့တီၩအကၠီၩ့နီၪ စဎွၩဒုၭဂုးထၪ့ခၧၫ့ထၪ့ ထံၫၥံၪခးၥံၪ, အ့ၪမွဲၦလၧအအၪ့ကံၩ့ဆီၪ့ အခီၫ့ၥံၪအ ကီၭၥံၪနီၪ, မၩလၩ့ချႃၬဝ့ၫဒၪလီၫ.",
			"5": "<sup>5</sup> ၦလၧအချဲၩ့မုၬၦလၧအနဲၩ့ထံၭနီၪ, ခွံၬလၩ့ၡၬလၧ အခၪ့အဂးလီၫ.",
			"6": "<sup>6</sup> လၧၦအအၧၩ့ လၩ့မၪဆၧအဖၧၩ့နီၪ, အီၪလၧဖျံၩ ခွၩ့တၭး အ့ၪမွဲၦတီၩၦလီၩ့ ၥုၪ့ဎွံၫၥၭယီၫဒဲမုၬလၩအ ၥၭလီၫ.",
			"7": "<sup>7</sup> ၦတီၩၦလီၩ့ ဒူၩယၪ့ၦၡၪ့ဖိၪယၬဖိၪအမူၭနီၪး အ့ၪ မွဲၦလတီၩလလီၩ့ဘၪၥံၪ မိဒၪဘၪဆၧၥ့ၪယၫ အဂဲးအ ကၠီၪ့နးစီၪ့အ့ၬ.",
			"8": "<sup>8</sup> ၦလၧအမၩကြၩ့ထမးဆၧနီၪ ဆူၭခဲၩထၪ့ဒိၩ့, အ့ၪ မွဲၦကိၪ့ၥ့ၪလဖၪ ဘိၭကၠၪခွံၬဆၧၥၭထၪ့လီၫ.",
			"9": "<sup>9</sup> ၦကိၪ့ဆၧၥ့ၪလဂၩ အ့ၪချဲၩ့ခွးလၧၦအဂီၩ့လဂၩနီၪး အ့ၪၥၭထၪ့မွဲဂ့ၩ, အ့ၪနံထၪ့မွဲဂ့ၩ, ဆၧအီၪပွံၭအလး အီၪအ့ၬ.",
			"10": "<sup>10</sup> ၦလၧအဆိၫ့န့ဘၪ ၦၡၩအၥွံၪနီၪ မ့ၬလဲၩၦၥၭဆုး လီၩ့လဖၪး အ့ၪမွဲၦတီၩၦလီၩ့ မိယိထဲၩ့ခွါထဲၩ့ဝ့ၫဒၪ လီၫ.",
			"11": "<sup>11</sup> ၦအဂီၩ့လီၩဖျီၪထၪ့အၥၭထီးအလူၬး အ့ၪမွဲၦကိၪ့ ဘၪကိၪ့ၥ့ၪဖီၪ့ထၬဝ့ၫဒၪလီၫ.",
			"12": "<sup>12</sup> ၦဒိၪလဂၩလၧအခိၭနၪ ဆၧချဲၩ့အဘျံၭအဘျၪၥံၪအ ခ့ၫအၡၩလဖၪ မွဲၦအအၧၩ့ ထီးအလူၬလီၫ.",
			"13": "<sup>13</sup> ၦၡၪ့ဖိၪယၬဖိၪ ဒဲၦလၧအမၩအၧၩ့မၩၥၫ့ဆၧနီၪဒၪ ခီၩ့လိၬအၥၭတၭး ယဟိဝၩဒုၭဖၩ့ထၪ့ အမ့ၬၥၪနံၫဂၩ လူၬလီၫ.",
			"14": "<sup>14</sup> စဎွၩလဂၩ လၧအစ့ၩရၫ့ ၦၡၪ့ဖိၪယၬဖိၪ တီၩတီၩ လီၩ့လီၩ့နီၪ,အဝ့ၫလဂၩ အလးဆီၩ့ဆီနီၪမိအီၪဂုးခၧၫ့ အဆိၩဆိၩအကၠၪကၠၪလီၫ.",
			"15": "<sup>15</sup> နိၪဖျ့ၪဒဲဆၧအၪ့ၥီၪ့ဝ့ၫ လၧနိၭနီၪဒုၭအီၪထၪ့ဆၧကိၪ့ ဘၪကိၪ့ၥ့ၪး အ့ၪမွဲဖိၪၥၪလဂၩ အ့ၪလီၩ့အၥၭဒၪဝ့ၫ တၭ, ဒုၭမဲအမိအမ့ၬလီၫ.",
			"16": "<sup>16</sup> ထီးၦလတီၩလလီၩ့ဘၪ အ့ၪအၪထၪ့နီၪ,ၦမၩမၪဆၧ အၪထၪ့ဆ့း အ့ၪမွဲၦတီၩၦလီၩ့ၥံၪ မိဒၪဘၪအဝ့ၫၥံၪအ ဆၧလၩ့ထ့ၬနီၪလီၫ.",
			"17": "<sup>17</sup> အၪ့ၥီၪ့နဖိၪခွၫတၭ, အဝ့ၫဒၪမိဒုၭအီၪပွံၭနၧၩး ဒဲမိ ဒုၭၥုၪ့ဎွံၫၥၭယီၫနၧၩဆ့လီၫ.",
			"18": "<sup>18</sup> ထီးဆၧဒၪဘၪ လၧယၫလခီၫ အ့ၪလအီၪဘၪတၭး ၦခမျၧးၥံၪဘၪဆၧပဒၩ့ဝ့ၫ နးမံၩ့အ့ၬး အ့ၪမွဲၦလၧအ ထီးန့ဆၧၥီၪ့ဆၧၥၫ့လဂၩနီၪ, ဘၪဆၧဆိၪဂ့ၩဝ့ၫလီၫ.",
			"19": "<sup>19</sup> လၧဆၧချဲၩ့ၥံၪအကၠီၩ့နီၪ, ဆၧအခ့ၫအၡၩဘိၭကၠၪ လီၩ့အၥၭအ့ၬး အဂဲးဘဲၫယီၩ မွဲအနၪၥ့ၪလါနၫ့တၭ, စံၭဆၧၫ့ဆၧနးမံၩ့အ့ၬ.",
			"20": "<sup>20</sup> ၦလဂၩအနိၭဖျဲၪနီၪ, မွဲနဒၪဘၪဆ့ဧၪး ၦယိလါဆၧ လၧၦအဂီၩ့အလး အီၪအၪနဲၪ့ဒံၭ ၦလဂၩနီၪလီၫ.",
			"21": "<sup>21</sup> ၦလဂၩလုအၪ့လုအီၩ အခ့ၫအၡၩမုၬမုၬ ခီၫလၧအ ဖိၪၥၪနီၪတၭး လၧခဲၫ့အဝ့ၫဒၪ မိကဲၪထၪ့ဘဲၫအဖိၪခွၫ အၥိၭလီၫ.",
			"22": "<sup>22</sup> ၦလၧအၥၭထၪ့ဆီၪ့နီၪ ထိၪဂဲထုၪ့ ဆၧဂဲးလိၬတ့ၭ လိၬး ဒဲၦၡၩလၧအၥၭထၪ့နီၪ မၩမၪဆၧအၪမၬလီၫ.",
			"23": "<sup>23</sup> ၦၡၩအၥၭထၪ့ထီၫနီၪ မိဒုၭဆၪ့လၩ့အနၫ့ဆါး အ့ၪ မွဲၦလၧအၥုၪ့ဆၧၩ့ၥၭဆၧၩ့ၥံၪ မိဒိၭန့ထၬဆၧလၩဖၩ့ ဆ့လီၫ.",
			"24": "<sup>24</sup> ၦလၧအထၧၫ့ထံၩထၧၫ့ၥိၭ လၧၦအၪ့ဂူၪဆၧနီၪၥၭ ဂဲၫ့အၥၭဒၪဝ့ၫတၭး နါဂၧၫ့လါနၫ့ဆၧဆိၪအၧၩ့တၭ, ဒုၭဖျီၪထၪ့ဝ့ၫအ့ၬ.",
			"25": "<sup>25</sup> ဆၧၥၭမဲၪၦၡၩနီၪ ဒုၭအီၪထၪ့ဖျံၩခွၩ့း အ့ၪမွဲၦလၧ အဒိၭနဲၩ့အၥၭ လၧယဟိဝၩအစူၪဖၧၩ့နီၪ, မိဘၪဆၧ အီၪက့ၪထၪ့ထီၫဝ့ၫလီၫ.",
			"26": "<sup>26</sup> ၦအၪဂၩအၪ့ဎူၫအၪ့ဎၬ ၦဒိၪဖၭဒိၪအမ့ၬး အ့ၪမွဲၦ ၡၩအဆၧစ့ၩရၫ့နီၪ ဂဲၫလၧယဟိဝၩလီၫ.",
			"27": "<sup>27</sup> ၦလတီၩဘၪလဂၩနီၪ မွဲဆၧၥၭလိၪလၧၦတီၩၦလီၩ့ အမ့ၬယၫတၭး ၦလၧအဖၧၩ့ၥၭတီၩဝ့ၫနီၪ, မွဲဆၧၥၭ လိၪလၧၦလတီၩဘၪ အမ့ၬယၫဆ့လီၫ."
		},
		"30": {
			"1": "<sup>1</sup> စယ့ကံၫအဖိၪခွၫ စအ့ဂၧၫအဆၧချဲၩ့လဖၪးယွၩအ ဆၧချဲၩ့လီၫ. အလဂၩနီၪ ချဲၩ့ဆၧလၧစအံၭၥအ့ၫလၭ လၧစအံၭၥအ့ၫလၭဒၪလ့ၬ ဒဲစယုၫကလၭလီၫ.",
			"2": "<sup>2</sup> မွဲမၬ, ယၥၭကၪနဲၪ့ၦၡၩထီးအလူၬတၭ, ယအီၪလၧ",
			"3": "<sup>3</sup> ၦၡၩအၥုၪ့ဖၭၥၭဖၭဆ့အ့ၬ.- ယမၩလိၪဆၧကိၪ့ဘၪ ကိၪ့ၥ့ၪအ့ၬး ဆၧဆံၫ့ဎံၪလဂၩနီၪ ယၥ့ၪယၫဆ့အ့ၬ.",
			"4": "<sup>4</sup> မွဲပလၫထၪ့ဘၭမူၭခိၪနီၪ ဒဲဂဲၫထဲၩ့လၩ့ဒီၭလဂၩလဲၪး မွဲပလၫထီၩ့ဒူၪလံၩ လၧအစူၪဖၧၩ့လဂၩလဲၪး မွဲပလၫ ဘီၪ့ထၬထံၫၥံၪ လၧဖၬဘဲၩ့ဖၧၩ့လဂၩလဲၪး မွဲပလၫအီၪ က့ၪလၩ့ဂၪ့ခိၪထုၬ ထီးအလူၬနီၪလဂၩလဲၪး အဝ့ၫဒၪ အမံၩ့ဘဲၫၥ့ၪလဲၪး ဒဲအဖိၪခွၫနီၪ အမံၩ့ဘဲၫၥ့ၪလဲၪး အ ဂဲးဘဲၫယီၩ နၥ့ၪယၫနဝ့ၫလီၫ.",
			"5": "<sup>5</sup> ယွၩအလူအထၫနီၪ မွဲဆၧဆံၫ့ဎံၪကိၭအထံၪဒ့ၭး အဝ့ၫနီၪမွဲဆၧထၩ့ဖံၭ လၧကယဲၦလၧအဒိၭနဲၩ့ အၥၭလၧ",
			"6": "<sup>6</sup> အဖၧၩ့နီၪအဂးလီၫ.- နဝ့ၫဒၪထီးအီၪက့ၪ အၪထၪ့ဆၧ လၧအဝ့ၫဒၪအဆၧချဲၩ့နီၪလဂ့ၩး အဝ့ၫဒၪမိအၪ့ၥီၪ့ဘၪ ခိၬနၧၩတၭ, ဆၧမိဖျီၪထၪ့ လၧနမွဲၦအဘျံၭအဘျၪလီၫ.",
			"7": "<sup>7</sup> ယအၪ့ကံၩ့ဆၧလၧနၧၩနံၫမံၩ့ လၧယလချႃၭၥံၫဒံၭ",
			"8": "<sup>8</sup> ဘၪနီၪဖ့ၪလၫ့ယၧၩဆံၭ.- ဆၧပျီၩပျီၩနီၪ ဒဲဆၧဘျံၭ ဆၧဘျၪၥံၪအီၪက့ၪခွံၬယဲၩ့ လၧယၧၩဆံၭး ဆၧၡၪ့ဆၧ ယၬမွဲဂ့ၩ, ဆၧလူဒိၪဎွ့ၩဒိၪမွဲဂ့ၩနီၪ, ထီးဖ့ၪလၫ့ယၧၩ လဂ့ၩဧီၪး ဒုၭအၪ့ယဆၧအၪ့ ကြၨၭလၧယဂးဆံၭ.",
			"9": "<sup>9</sup> ယမိလၧၫ့ဎွ့ၩဘၪခိၬတၭ, မီၪ့ဘံၭခွံၬနၧၩး ဒဲစံၭ, ယ ဟိဝၩနီၪ, မွဲပလၫလဂၩလဲၪး ဒဲယဘၪၡၪ့ဘၪယၬဘၪ ခိၬတၭ, အၪ့ဂူၪဆၧဒဲကိၭထၪ့ ယယွၩအမံၩ့နီၪ ပျီၩပျီၩ ဆ့လီၫ.",
			"10": "<sup>10</sup> ထီးချဲၩ့ခဲၪဆၧအခ့ၫအၡၩ လၧအကဆါအမ့ၬယၫ လဂ့ၩး အဝ့ၫမိဆိၪအၧၩ့ဘၪခိၬနၧၩတၭ, ဆၧမၪမိအီၪ",
			"11": "<sup>11</sup> လၧနလီၩ့လီၫ.- ၦအဆိၩလၧအဆိၪအၧၩ့အဖါ, ဒဲလ",
			"12": "<sup>12</sup> ဆိၪဂ့ၩဘၪအမိနီၪၬ- ၦအဆိၩ လၧအဆံၫ့ဎံၪ လါနၫ့ လၧအမ့ၬၥၪဒၪဝ့ၫအဖၧၩ့, လဘၪဘၪဆၧၥူၫဝၭခွံၬအ",
			"13": "<sup>13</sup> ဆၧစံၪစၪနီၪၬ- ၦအဆိၩ, အမ့ၬၥၪၥံၪထၪ့ထီၫဆံၭထီၫ",
			"14": "<sup>14</sup> လဲၪ, ဒဲအမ့ၬဖံၭၥံၪဆိၬထၪ့အၥၭနီၪၬ- ၦအဆိၩၥံၪလၧ အၥွၫၥံၪ မွဲနၭလဖၪ, ဒဲအၥွၫခၫ့မွဲဒီၩၥံၪ, ဘဲၫၥိၭအမိ အၪ့ခွံၬ ၦၡၪ့ဖိၪယၬဖိၪၥံၪ လၧဂၪ့ခိၪချိၫ့ယီၩ, ဒဲၦလၧ အကြၨၭန့ဘၪဆၧလမံၩ့မံၩ့ လၧၦၡၩၥံၪအကျၩလီၫ.",
			"15": "<sup>15</sup> ၥလံၩနီၪအီၪလၧအဖိၪမုၪနံၫဂၩ, စံၭဝ့ၫ, ဖ့ၪလၫ့ဘီၪ, ဖ့ၪလၫ့ဘီၪး ဆၧလၧအလမံၫ့ၥုၪ့မံၫ့ၥၭဘၪ အီၪဝ့ၫၥၧၫ့ မံၩ့း ဆၧလၧအလစံၭဘၪ, လၧၫ့ယူၭ. အီၪလံမံၩ့ၬ",
			"16": "<sup>16</sup> ဖျႃဖၧၩ့, ဒဲဒၧၩ့လးထူၬဖိၪး ဂၪ့ခိၪလၧအလဘျဲၩအီၩ ဘၪထံၫနီၪ, ဒဲမ့ၪလၧအလစံၭဘၪ, လၧၫ့ယူၭၬ",
			"17": "<sup>17</sup> မ့ၬၥၪလၧအယိကြၩ့ထမးအဖါ, ဒဲလမိခိၭနၪဘၪ အၥၭ လၧအမိအလူနီၪ, ကျၭၥံၪလၧခိၪလီၩ့ဆူၭဖၧၩ့ မိစိၭထၪ့ခွံၬဝ့ၫနီၪ, ဒဲလၫ့ကထၬအဖိၪၥံၪ မိအၪ့ဝ့ၫဒၪ လီၫ.",
			"18": "<sup>18</sup> ဆၧလၧအကၪလၨၪ လၧယမ့ၬယၫအီၪၥၧၫ့မံၩ့, ဒဲလံ",
			"19": "<sup>19</sup> မံၩ့နီၪလၧယနၪၥ့ၪဝါအ့ၬ.- လံၬကျီၫ့ကျီၫ့အဖၧၩ့ၥၭ လၧဆၧဖိၭဖၫ့နီၪးဂူအဖၧၩ့ၥၭ လၧလိးၥံၪလဲၫ့ၥံၪအလီၩ့း ကဘၩ့ လၧမၫဆမံၭဖၧၩ့အဖၧၩ့ၥၭနီၪး ဒဲၦၡၩခွၫလၧ",
			"20": "<sup>20</sup> ၦမုၪနၩ့အဖၧၩ့ၥၭနီၪလီၫ.- ၦမုၪလၧအအဲၪဘိၩ့အဝၩ အဖၧၩ့ၥၭနီၪ မွဲဘဲၫနီၪၥိၭဆ့, အၪ့ဝ့ၫနီၪထူၭခွံၬအနိၭ တၭ, စံၭဝ့ၫ, ယမၩမၪဆၧနးမံၩ့အ့ၬ.",
			"21": "<sup>21</sup> လၧဆၧၥၧၫ့မံၩ့အကၠီၩ့နီၪ ထံၫၥံၪခးၥံၪအီၪဂုးဖုးအ့ၬး",
			"22": "<sup>22</sup> ဒဲလံမံၩ့အကၠီၩ့နီၪ ထိးနၧၩ့ဝါအ့ၬ.- ဆၧအခ့ၫအၡၩ ပၧၩ့ဆၧအကၠီၩ့း ဒဲၦအဂီၩ့ လၧအအၪ့ဆၧဘျဲၩအၪ့",
			"23": "<sup>23</sup> လၧၫ့လၧၫ့ဎွ့ၩဎွ့ၩနီၪး- ဒဲၦမုၪလၧအၥၭဂဲၫ့ဝ့ၫ, ထီးအ န့ဘၪအဝၩအထီနီၪ, ဒဲဎီးမုၪထီးအန့ၥၫဆၧ လၧအက ဆါမုၪအဆၧနီၪလီၫ.",
			"24": "<sup>24</sup> လၧဂၪ့ခိၪချိၫ့ယီၩ ဆၧအဆံၭခိၬလါနၫ့ အီၪလၧဆၧ",
			"25": "<sup>25</sup> ကိၪ့ၥ့ၪဖၭဒိၪ အီၪဝ့ၫလံမံၩ့လီၫ.- ထုးၥံၪ, ဆၧခမျၧး လၧအဂဲးအဘၭ လဆီၪ့ဘၪလါနၫ့တၭ, လၧဆၧခိအ",
			"26": "<sup>26</sup> ခၫနီၪ တဲၩ့ဝဲၩအဆၧအၪ့ဆ့း- ပဒဲၩၥံၪဆၧခမျၧးလၧ အဂဲးဆါအဘၭဆါလါနၫ့နီၪ, အီၪဝ့ၫလၧလိးအိၩဖၧၩ့",
			"27": "<sup>27</sup> လဲၫ့အိၩဖၧၩ့လီၫ.- ထွ့ၥံၪလၧအစဎွၩ လအီၪဘၪလါ",
			"28": "<sup>28</sup> နၫ့တၭး လ့ၩထၪ့ဆၧလဒီၪ့ လဒီၪ့နီၪလီၫ.- ဒၩ့လဲးလၧ အဖီၪ့ထၬ ဆၧလၧအစူၪနီၪး ဒဲအီၪဝ့ၫလၧစဎွၩ အနီး ဖၧၩ့လဖၪနီၪလီၫ.",
			"29": "<sup>29</sup> ဆၧလၧအခၫထၪ့ဂ့ၩအီၪဝ့ၫၥၧၫ့မံၩ့, ဒဲလံမံၩ့လၧအ",
			"30": "<sup>30</sup> လ့ၩဖျီၪဎံၫဆ့လီၫ.- ဆၬလၥၧၫ့ဆီၪ့ဝ့ၫ လၧဆၧဖိၪဆၧ ဎါအကျၩ ဒဲကၠၪထဲၩ့အၥၭ လၧဆၧဂူၫဂၩအကၠီၩ့နးမံၩ့",
			"31": "<sup>31</sup> အ့ၬ.- ထွံၪမၩ့စဲၩ, ဒဲဘ့ၪဖၫလဒုၩး ဒဲစဎွၩလၧၦခမျၧး ၥံၪဂဲထုၪ့ထၫ့ဒုၪဒၩ လၥ့ၪဘၪနီၪလီၫ.",
			"32": "<sup>32</sup> နဝ့ၫဒၪနအ့ၪမၩ ဘဲၫဆၧအဂီၩ့အၥိၭ လၧနအီၪက့ၪ ထၪ့ထီၫနၥၭနီၪမွဲဂ့ၩ, ဒဲနအ့ၪကိၪ့ဆၧအၧၩ့ မွဲဂ့ၩတၭ,",
			"33": "<sup>33</sup> မၩဘံၭထၬနနိၭ လၧနစူၪဘီၪၬ- အဂဲးဘဲၫယီၩ ၡိၫ့ၡိၬ နူထံၫနီၪဒုၭကဲၪထၪ့ နူထံၫခိလီၪ့တၭ, ဒဲဆၧဝံၬနၫဖူၫနီၪ ၥွံၪဂဲၫလၩ့တၭ, ဘဲၫနီၪၥိၭ ထိၪဂဲၩဆၧၥၭထၪ့နီၪ ဒုၭ အီၪထၪ့ဆၧဂဲးလိၬတ့ၭလိၬလီၫ."
		},
		"31": {
			"1": "<sup>1</sup> စဎွၩလ့ၫမုၫအ့လၭ အဆၧချဲၩ့ၥံၪး ယွၩအဆၧချဲၩ့, လၧအမိၥီၪ့လိၪ အဝ့ၫနီၪလီၫ.",
			"2": "<sup>2</sup> ယဖိၪခွၫဧ့, ဆၧနီၪလဲၪ, ဒဲယဒၧၩ့လးအဖိၪခွၫဧ့,ဆၧ နီၪလဲၪး ဒဲယဆိၪလၩ့ယၥၭအဖိၪခွၫဧ့, ဆၧနီၪလဲၪ.",
			"3": "<sup>3</sup> နဂဲးနဘၭနီၪ ထီးဖ့ၪလၫ့ၦမုၪၥံၪလဂ့ၩး ဒဲနဖၧၩ့ၥၭၥံၪ",
			"4": "<sup>4</sup> လၧဆၧလၧအမၩဂၭဂီၩ့ စဎွၩၥံၪလဂ့ၩ.- စလ့ၫမုၫအ့ လၭဧ့, မွဲလၧစဎွၩၥံၪအဂးအ့ၬယ ဆၧအီၩစဘံၭထံၫနီၪ မွဲလၧစဎွၩၥံၪအဂးအ့ၬး ၦဒိၪဖၭဒိၪၥံၪအီၩၥံၭထံၫဂၬ",
			"5": "<sup>5</sup> ထံၫနီၪဘၪဆ့အ့ၬ.- မိအီၩဘၪခိၬတၭ, ၥၭနၪ့ခွံၬဆၧ ၥီၪ့ဆၧၥၫ့နီၪ, ဒဲဘိၭကၠၪခွံၬ ၦၡၪ့ဖိၪယၬဖိၪ လဂၩဂၩ",
			"6": "<sup>6</sup> အမူၭနီၪလီၫ.- ၦလၧအလၩ့ဘူၭ လၧအမိဂၭဂီၩ့တၭ, ဖ့ၪလၫ့ၥံၭထံၫဂၬထံၫး ဒဲစဘံၭထံၫ လၧၦလၧအၥုၪ့အုၭ",
			"7": "<sup>7</sup> ၥၭအုၭဆၧနီၪဆံၭ.- မွဲအအီၩဆၧတၭ, ၥၭနၪ့ခွံၬအ ဆၧၡၪ့ဆၧနၭနီၪဘီၪး ဒဲအဆၧခိဆၧဝီၩနီၪ ဘဲၫၥိၭအ",
			"8": "<sup>8</sup> ထီးနၪ့ထၪ့ထဲၩ့လဂ့ၩ.- အၩ့ထၪ့နနိၭ လၧၦအုၭအၭ ဖိၪအဂး ဒဲလၧကယဲၦဖိၪဎွ့ၪ ထီးအလူၬ အမူၭအဂး",
			"9": "<sup>9</sup> ဆံၭ.- အၩ့ထၪ့အနိၭစ့ၩရၫ့ဆၧ တီၩတီၩလီၩ့လီၩ့နီၪ, ဒဲစ့ၩရၫ့တီၩန့ ၦၡၪ့ဖိၪယၬဖိၪအခွးနီၪဆံၭ.",
			"10": "<sup>10</sup> ၦမုၪအဎၭလၧအမၩဆၧၥ့ၪနီၪ, မွဲပလၫဒၪန့ဝ့ၫလဂၩ လဲၪး အဂဲးဘဲၫယီၩ အဎွ့ၩနီၪဂ့ၩနဲၪ့အၪနဲၪ့ မနံၬထၫ့မျါ",
			"11": "<sup>11</sup> ၥံၪလီၫ.- အဝၩဒိၭနဲၩ့အၥၭ လၧအဖၧၩ့တၭ, အဝ့ၫဒၪ",
			"12": "<sup>12</sup> အစူၪလးခၪ့ခိၪ မိလၧၫ့ဎွ့ၩဝ့ၫဆ့လီၫ.- ၦမုၪနီၪလဆိၩ ဒၪအၥၭ မိဒုၭအီၪထၪ့ဆၧဂ့ၩ လၧအဂးတၭ, မွဲဆၧအ",
			"13": "<sup>13</sup> အၧၩ့အ့ၬး- မိအၪ့ဎူၫအၪ့ဎၬ ၥိၪအဆီၪ့ ဒဲၥီၫကဘၩ့း",
			"14": "<sup>14</sup> ဒဲမၩဆၧလၧအစူၪမုၬမုၬလီၫ.- မၩအၥၭဘဲၫဖနံၬဖိၪ အကဘၩ့ၥံၪအၥိၭး ၦမုၪနီၪဂဲၫဆိၬန့ အဆၧအၪ့လၧထံၫ",
			"15": "<sup>15</sup> ယဲၩ့ခးယဲၩ့လီၫ.- ဂဲထုၪ့လၧဂီၩ လၧဆၧလချႃၭဖၩ့ထၪ့ ဝါဒံၭဘၪနီၪ, ဒဲဖ့ၪလၫ့ဆၧအၪ့ဆၧအီၩ လၧအဂံၪ့ဖိၪ ၥံၪ, ဒဲဒုၭနဲၪအခ့ၫအၡၩမုၪၥံၪ လဂၩလဂၩ အဆၧမၩ",
			"16": "<sup>16</sup> နီၪလီၫ.- အဝ့ၫဒၪယိဆီၫ့မီၪ့ဂၪ့ခိၪ လဝၩ့အဂဲးအကၠီၪ့ တၭ, ဎွ့ၩန့ဝ့ၫတၭး လၧအစူၪအဆၧၥၪအကၠီၩ့နီၪ, ၥုၪ့",
			"17": "<sup>17</sup> လၩ့ဖျၭလၩ့စဘံၭအလးလီၫ.- ခဲးထူၬအယးဒံၩ့လၧ",
			"18": "<sup>18</sup> ဆၧဂဲးဆၧဘၭ, ဒဲမၩဆီၪ့ထၪ့အစူၪဒူၪၥ့ၪဆ့လီၫ.-ၦမုၪ နီၪ ဒၪဘၪလၧအဆၧအၪထၪ့ မွဲဆၧအဂ့ၩတၭး အမ့ၪ",
			"19": "<sup>19</sup> ဒိၩ့နီၪလၩ့ဖံၬခွံၬ လၧမုနၩလခီၫဆ့အ့ၬး- အီၪက့ၪအ စူၪလၧနိၪတလံၭနီၪ, ဒဲအစူၪလဖၪဖီၪ့ထၬချံၪ့စူၪဝံၬဆ့",
			"20": "<sup>20</sup> လီၫ.- ပၠၪလၩ့အစူၪလၧၦၡၪ့ဖိၪယၬဖိၪ, ဒဲယူၬစိၩအ စူၪဆ့ လၧၦလၧအကြၨၭန့ဘၪ ဆၧလမံၩ့မံၩ့နီၪလီၫ.",
			"21": "<sup>21</sup> လၧမူၭခိၪဖီၫအကၠီၩ့နီၪ, ၥၭမဲၪဆၧလၧအၡၩဂံၪ့ဖိၪၥံၪ အဂးနးဆံၭအ့ၬးအဂဲးဘဲၫယီၩ အၡၩဂံၪ့ဖိၪန့ဘၪဆၧ",
			"22": "<sup>22</sup> ကီၩ့ဆၧၥိၭဆၧဝီၩလုၭဖုၭလီၫ.- မၩဝဲၩဆၧလုၬဘံၭ လၧအနၫ့ဆါအဂး ဆၧဘွၩဖျ့ၫလံၬကံၭ ဒဲဆၧလုၭဖုၭ",
			"23": "<sup>23</sup> နီၪမွဲအဆၧကီၩ့ဆၧၥိၭလီၫ.- အဝၩနီၪ ၦၡၩလၧတရၫ့ ဖၧၩ့ၥ့ၪယၫဝ့ၫ ထီးအဆၧၫ့နၩ့ လၧထံၫၥံၪခးၥံၪနီၪအၥုၪ့",
			"24": "<sup>24</sup> က့ၭၥၭၡါလဖၪအကျၩလီၫ.- မၩဝဲၩဆၧကီၩ့ဆၧၥိၭ ဘွၩဖျ့ၫလံၬကံၭတၭ, အၪ့ဆၫခွံၬဝ့ၫနီၪ, ဒဲခၧၩ့ယးၥံၪ",
			"25": "<sup>25</sup> မၩဝ့ၫလၧၦဖနံၬဖိၪအဂးလီၫ.- ဆၧယူၭယၪ့ဒဲဆၧလၩ ဖၩ့မွဲအကီၩ့အၥိၭ, ဒဲနံဘၪလၧမုနံၩမိဂဲၫဝ့ၫလဖၪအဂး",
			"26": "<sup>26</sup> လီၫ.- အၩ့ထၪ့အနိၭလၧဆၧကိၪ့ဘၪကိၪ့ၥ့ၪနီၪ, ဒဲဆၧ ခိးဆၧတၩ အဆၧၥီၪ့ဆၧၥၫ့ အီၪလၧအဖျ့ၩ အလီၩ့",
			"27": "<sup>27</sup> လီၫ.- ယိထဲၩ့ခွါထဲၩ့အၡၩဂံၪ့ဖိၪၥံၪ အဆၧမၩလဖၪ",
			"28": "<sup>28</sup> နီၪ, ဆၧကၠႃၪ့အကိၪအၪ့ဘၪဝ့ၫအ့ၬ.- အဖိၪအလံၩလ ဖၪဂဲထုၪ့ကိၭဝ့ၫးလၧၦဘၪဆၧဆိၪဂ့ၩဝ့ၫး အဝၩနီၪစံၭ",
			"29": "<sup>29</sup> ထၪ့အၪ့အူၭဝ့ၫဆ့လီၫ.- ၦဖိၪမုၪၥံၪမၩဆၧဂ့ၩအၪဂၩ လါနၫ့တၭ, နဝ့ၫဒၪနဂ့ၩနဲၪ့ဒံၭအဝ့ၫၥံၪ ထီးအလူၬဆ့",
			"30": "<sup>30</sup> လီၫ.- ဆၧအဎံၫအလၩနီၪ အၪ့လီၫန့ဆၧ, ဒဲဆၧခံးဘၪ ဂၩ့ဂ့ၩနီၪ မွဲဆၧပျီၩပျီၩး အ့ၪမွဲၦမုၪလၧအၥၭမဲၪယဟိ",
			"31": "<sup>31</sup> ဝၩနီၪ, ဆၧမိစံၭထၪ့အၪ့အူၭဝ့ၫလီၫ.- ဖ့ၪလၫ့အဝ့ၫလၧ အစူၪအဆၧၥ့ၪနီၪတၭ, မွဲအဆၧဖံၭဆၧမၩ ဒၪဝ့ၫအၪ့ အူၭထၪ့ဝ့ၫလၧတရၫ့ၥံၪအဖၧၩ့နီၪဆံၭ."
		}
	}
};
module.exports = book;